INSERT INTO textpattern VALUES (1,'2006-03-17 06:18:00','presbrey','2006-04-12 07:57:53','presbrey','Home Page Footer','','Since 1847, Theta Delta Chi has believed that it is the duty of every member to improve himself intellectually, morally, and socially through friendship.\r\n\r\nWe\'re excited to have a new freshman class coming to MIT in the fall, and will be holding numerous rush events both on and off campus.  If you are interested in joining, it would be great to see you come out for an event.  If you have any questions before then, feel free to e-mail us at *contact-tdc@mit.edu*.\r\n\r\n<br />\r\n\r\n<div align=\"center\"> !/~tdc/images/27t.jpg! </div>','	<p>Since 1847, Theta Delta Chi has believed that it is the duty of every member to improve himself intellectually, morally, and socially through friendship.</p>\r\n	<p>We&#8217;re excited to have a new freshman class coming to MIT in the fall, and will be holding numerous rush events both on and off campus.  If you are interested in joining, it would be great to see you come out for an event.  If you have any questions before then, feel free to e-mail us at <strong>contact-tdc@mit.edu</strong>.</p>\r\n	<p><br />\r\n</p>\r\n<div align=\"center\"> <img src=\"/~tdc/images/27t.jpg\" alt=\"\" /> </div>\r\n\r\n ','','\r\n ','','TDC','',0,'',0,5,1,1,'home','','','home','','','','','','','','','','','becfea8fd42801204463b23701199f28','2005-07-18');
INSERT INTO textpattern VALUES (3,'2006-03-17 07:50:00','presbrey','2006-04-12 04:36:10','presbrey','Theta Deuteron','','Theta Deuteron at MIT was first established March 21, 1890, but, failing to acquire a house, was disbanded in about two years. A decade later (in about 1902), a group of MIT lads founded Alpha Epsilon, a local fraternity, with the intent of its becoming a new Theta Deuteron. The new Theta Deuteron was installed on June 2, 1906.\r\n\r\nSixty years later, the summer of 1966 was a watershed time for the Charge: it acquired the house and land at 372 Memorial Drive. But the anniversary was not overlooked in the excitement of the move. Of those twenty-three MIT lads, only five were still living, men by now in their early eighties. Then-house President Barry Watkins, ‘67, sent each a bouquet of red carnations and a simple message of congratulation, noting the six decades. He received warm replies. (One chuckled that in his eighty years no one had ever sent him flowers before!)\r\n\r\nOur Charge can be best thought of as a house where people of all different personalities can find their own niche. Our distinguished alumni exemplify this - they range from Actor James Woods, ‘69, who lived in our house for a couple of years while he was at MIT, to the founder and CEO of Microstrategy, Michael Saylor, ‘87 and his co-founder Sanju Bansal, ‘87. Dave Blundin, ‘89 is the CEO of Datasage, another successful data mining company.','	<p>Theta Deuteron at MIT was first established March 21, 1890, but, failing to acquire a house, was disbanded in about two years. A decade later (in about 1902), a group of MIT lads founded Alpha Epsilon, a local fraternity, with the intent of its becoming a new Theta Deuteron. The new Theta Deuteron was installed on June 2, 1906.</p>\n	<p>Sixty years later, the summer of 1966 was a watershed time for the Charge: it acquired the house and land at 372 Memorial Drive. But the anniversary was not overlooked in the excitement of the move. Of those twenty-three MIT lads, only five were still living, men by now in their early eighties. Then-house President Barry Watkins, ‘67, sent each a bouquet of red carnations and a simple message of congratulation, noting the six decades. He received warm replies. (One chuckled that in his eighty years no one had ever sent him flowers before!)</p>\n	<p>Our Charge can be best thought of as a house where people of all different personalities can find their own niche. Our distinguished alumni exemplify this &#8211; they range from Actor James Woods, ‘69, who lived in our house for a couple of years while he was at MIT, to the founder and CEO of Microstrategy, Michael Saylor, ‘87 and his co-founder Sanju Bansal, ‘87. Dave Blundin, ‘89 is the CEO of Datasage, another successful data mining company.</p>\n\n ','','\n\n ','','TDC','',0,'',0,4,1,1,'about','','','theta-deuteron','2','','','','','','','','','','670526253d63585d8b859bb65de0ce24','2006-03-17');
INSERT INTO textpattern VALUES (4,'2006-03-17 07:53:00','presbrey','2006-04-12 05:01:49','presbrey','About Us','','We rock.\r\nWe are diverse.\r\n\r\nEmbrace freedom of decisions, living life, etc.\r\n\r\nFriendship and those other mottos.','	<p>We rock.<br />\nWe are diverse.</p>\n	<p>Embrace freedom of decisions, living life, etc.</p>\n	<p>Friendship and those other mottos.</p>\n\n ','','\n\n ','','TDC','',0,'',0,2,1,1,'about','','','our-mission','1','','','','','','','','','','f26c9198e9e2b2fd32938a87f2a4b687','2006-03-17');
INSERT INTO textpattern VALUES (2,'2006-03-17 07:41:00','presbrey','2006-04-12 04:36:14','presbrey','Theta Delta Chi','','Theta Delta Chi, the eleventh oldest of the college fraternities, was founded in 1847 at Union College in Schenectady, NY by six members of the class of 1849: William G. Akin, Abel Beach, Theodore Brown, Andrew H. Green, William Hyslop, and Samuel F. Wile. In 1849, Green and Akin along with Francis Martindale (the first initiate), organized the Beta Charge (later renamed Beta Proteron) at Ballston Law School. However, two years later the school itself moved and the new Charge was disbanded and the members put on Alpha\'s rolls.\r\n\r\nDuring the 1850\'s Theta Delta Chi spread rapidly, adding Charges at Vermont, Rensselaer Polytechnic Institute, William and Mary, Virginia, Hobart, Wesleyan, Harvard, Brown, Bowdoin, Kenyon, Tufts, Washington and Jefferson, and North Carolina. Few of these remained active for long, although several were later revived. Kappa at Tufts (1856) presently enjoys the honor of being the oldest active Charge in continuous existence.\r\n\r\nDuring the 1860\'s new Charges, at, among other institutions, Lafayette and Rochester (1867), Hamilton (1868), and Dartmouth (1869), continued to be chartered at a pace that kept slightly ahead of attrition caused by Charges going inactive. The Civil War, however, severely weakened most Charges as men left for military service; many of the earliest Charges went inactive during this period, and expansion in the South ceased for a century.\r\n\r\nOnly after 1870 did Theta Delta Chi begin to acquire its present configuration. Westward expansion had traditionally been opposed by a large segment of the Fraternity, which worried that supervision and solidarity would suffer if Theta Delta Chi were to stray far from the East. The rise of the large state universities in the West, particularly in the Big Ten, eventually overcame that resistance and the Universities of Michigan, Minnesota, and Wisconsin welcomed Theta Delta Chi between 1889 and 1895. Further Midwest expansion included Illinois (1908) and Iowa State 1919). Berkeley (1900), Stanford (1903), the University of Washington (1913) and UCLA (1929) brought Theta Delta Chi in strength to the Pacific coast.\r\n\r\nExpansion in the East during the 1870\'s, 1880\'s and 1890\'s brought Charges to Cornell, Boston University, Wabash, CCNY, Columbia, Lehigh, Amherst, Yale, MIT, Williams, and George Washington. Pennsylvania (1915) was the last Eastern Charge to become active before World War I, although 1904 and 1910 saw the reactivation of the Southern Charges, Epsilon and Nu.\r\n\r\nTheta Delta Chi became an International Fraternity with charterings at McGill (1901) and Toronto (1912).\r\n\r\nThe Great Depression and the Second World War saw a number of Charges go inactive and brought a halt to expansion. At its Centennial Convention in 1947, Theta Delta Chi stood at 28 Charges, a number that would begin to increase only in the 1950\'s.','	<p>Theta Delta Chi, the eleventh oldest of the college fraternities, was founded in 1847 at Union College in Schenectady, NY by six members of the class of 1849: William G. Akin, Abel Beach, Theodore Brown, Andrew H. Green, William Hyslop, and Samuel F. Wile. In 1849, Green and Akin along with Francis Martindale (the first initiate), organized the Beta Charge (later renamed Beta Proteron) at Ballston Law School. However, two years later the school itself moved and the new Charge was disbanded and the members put on Alpha&#8217;s rolls.</p>\n	<p>During the 1850&#8217;s Theta Delta Chi spread rapidly, adding Charges at Vermont, Rensselaer Polytechnic Institute, William and Mary, Virginia, Hobart, Wesleyan, Harvard, Brown, Bowdoin, Kenyon, Tufts, Washington and Jefferson, and North Carolina. Few of these remained active for long, although several were later revived. Kappa at Tufts (1856) presently enjoys the honor of being the oldest active Charge in continuous existence.</p>\n	<p>During the 1860&#8217;s new Charges, at, among other institutions, Lafayette and Rochester (1867), Hamilton (1868), and Dartmouth (1869), continued to be chartered at a pace that kept slightly ahead of attrition caused by Charges going inactive. The Civil War, however, severely weakened most Charges as men left for military service; many of the earliest Charges went inactive during this period, and expansion in the South ceased for a century.</p>\n	<p>Only after 1870 did Theta Delta Chi begin to acquire its present configuration. Westward expansion had traditionally been opposed by a large segment of the Fraternity, which worried that supervision and solidarity would suffer if Theta Delta Chi were to stray far from the East. The rise of the large state universities in the West, particularly in the Big Ten, eventually overcame that resistance and the Universities of Michigan, Minnesota, and Wisconsin welcomed Theta Delta Chi between 1889 and 1895. Further Midwest expansion included Illinois (1908) and Iowa State 1919). Berkeley (1900), Stanford (1903), the University of Washington (1913) and UCLA (1929) brought Theta Delta Chi in strength to the Pacific coast.</p>\n	<p>Expansion in the East during the 1870&#8217;s, 1880&#8217;s and 1890&#8217;s brought Charges to Cornell, Boston University, Wabash, CCNY, Columbia, Lehigh, Amherst, Yale, MIT, Williams, and George Washington. Pennsylvania (1915) was the last Eastern Charge to become active before World War I, although 1904 and 1910 saw the reactivation of the Southern Charges, Epsilon and Nu.</p>\n	<p>Theta Delta Chi became an International Fraternity with charterings at McGill (1901) and Toronto (1912).</p>\n	<p>The Great Depression and the Second World War saw a number of Charges go inactive and brought a halt to expansion. At its Centennial Convention in 1947, Theta Delta Chi stood at 28 Charges, a number that would begin to increase only in the 1950&#8217;s.</p>\n\n ','','\n\n ','','TDC','',0,'',0,4,1,1,'about','','','theta-delta-chi','3','','','','','','','','','','98df88fda4647b1e68c670fabf9329b2','2006-03-17');
