INSERT INTO textpattern VALUES (8,'2006-03-17 08:22:00','presbrey','2006-04-01 23:12:37','bolevos','Emanuel Borja','','AKA \"Undersecretary of Staff\"\r\nCourse 1e, Environmental Engineering\r\nMIT Year:  2009\r\nHometown: Saipan, Northern Marianna\r\n\r\nEmanuel joins us from a tropical island in the middle of the Pacific Ocean. One of the most trustworthy people in the house, Emanuel always gives a helping hand and is very responsible. He\'s also on the hunt for some tasty meat.\r\n<center><<img src=\"/~tdc/images/20.jpg\" width=\"350\"></center>','	<p>AKA &#8220;Undersecretary of Staff&#8221;<br />\nCourse 1e, Environmental Engineering<br />\nMIT Year:  2009<br />\nHometown: Saipan, Northern Marianna</p>\n	<p>Emanuel joins us from a tropical island in the middle of the Pacific Ocean. One of the most trustworthy people in the house, Emanuel always gives a helping hand and is very responsible. He&#8217;s also on the hunt for some tasty meat.<br />\n<center><<img src=\"/~tdc/images/20.jpg\" width=\"350\"></center></p>\n\n ','','\n\n ','','actives','2009',0,'',0,4,1,1,'brothers','','','manny-borja','04','eborja','2009','4','','','','','','','69e3f75ccd515784564002b4be13061b','2006-03-17');
INSERT INTO textpattern VALUES (9,'2006-03-17 08:23:00','presbrey','2006-03-18 22:00:14','bolevos','LeVon Thomas','','AKA \"Ugga Bugga\"\r\nCourse 2, Mech Engineering\r\nMIT year: 2009\r\nHometown: Window Rock, AZ\r\n\r\nI come from many lands far away over the mountains.  I come from the dominant tribe from the southwest.  I am Navajo.  I come from a rural area in northern Arizona.  I like to work on cars, trucks and anything with wheels.  I am a part of the MIT Motorsports team, the AISES chapter here at MIT and Terrascope.\r\n<center><img src=\"/~tdc/images/10.jpg\" width=\"300\"></center>','	<p>AKA &#8220;Ugga Bugga&#8221;<br />\nCourse 2, Mech Engineering<br />\nMIT year: 2009<br />\nHometown: Window Rock, AZ</p>\n	<p>I come from many lands far away over the mountains.  I come from the dominant tribe from the southwest.  I am Navajo.  I come from a rural area in northern Arizona.  I like to work on cars, trucks and anything with wheels.  I am a part of the MIT Motorsports team, the AISES chapter here at MIT and Terrascope.<br />\n<center><img src=\"/~tdc/images/10.jpg\" width=\"300\"></center></p>\n\n ','','\n\n ','','actives','2009',0,'',0,4,1,1,'brothers','','','levon-thomas','05','','2009','5','','','','','','','24d25bbde69f0c28fafefd09dc263589','2006-03-17');
INSERT INTO textpattern VALUES (10,'2006-03-17 08:23:00','presbrey','2006-04-01 23:04:33','bolevos','Sam Phillips','','AKA \"I can\'t believe my name is Little Suzy the Whale Rider\"\r\nCourse 16, Aeronautical and Astronautical Engineering\r\nMIT Year: 2009\r\nHometown: East Bridgewater, MA\r\n\r\nA true down to earth MAsshole, Sam will down a drink faster than Bush inflating the national debt. Sam loves to rock and can be seen grinding his axe around the house. When asked how dirty he is, Sam says he puts the naugthy in aeronaughtycal engineering.\r\n<center><img src=\"/~tdc/images/19.gif\" width=\"280\"></center>','	<p>AKA &#8220;I can&#8217;t believe my name is Little Suzy the Whale Rider&#8221;<br />\nCourse 16, Aeronautical and Astronautical Engineering<br />\nMIT Year: 2009<br />\nHometown: East Bridgewater, MA</p>\n	<p>A true down to earth MAsshole, Sam will down a drink faster than Bush inflating the national debt. Sam loves to rock and can be seen grinding his axe around the house. When asked how dirty he is, Sam says he puts the naugthy in aeronaughtycal engineering.<br />\n<center><img src=\"/~tdc/images/19.gif\" width=\"280\"></center></p>\n\n ','','\n\n ','','actives','2009',0,'',0,4,1,1,'brothers','','','sam-phillips','06','','2009','6','','','','','','','31152a9c8af43ff8f4f428ba2748a193','2006-03-17');
INSERT INTO textpattern VALUES (11,'2006-03-17 08:24:00','presbrey','2006-04-01 22:50:02','bolevos','Manny Soto','','AKA \"Food Stamp\"\r\nCourse 15, Management\r\nMIT Year: 2008\r\nHometown: Ponce, Puerto Rico\r\n\r\nManny is neither in the closet nor out of the closet. Supermeng enjoys playing Battlefield 2 and XBOX and loves to pppaaarrrtttyyy. The current treasurer of TDC, Manny is very good with money; my money, your money, it all ends up in his wallet somehow and Manny will be the first to tell you that as long as your wallet is the thickest thing in your pants, you\'re in!\r\n\r\n<center><img src=\"/~tdc/images/16.jpg\" width=\"250\"></center>','	<p>AKA &#8220;Food Stamp&#8221;<br />\nCourse 15, Management<br />\nMIT Year: 2008<br />\nHometown: Ponce, Puerto Rico</p>\n	<p>Manny is neither in the closet nor out of the closet. Supermeng enjoys playing Battlefield 2 and XBOX and loves to pppaaarrrtttyyy. The current treasurer of TDC, Manny is very good with money; my money, your money, it all ends up in his wallet somehow and Manny will be the first to tell you that as long as your wallet is the thickest thing in your pants, you&#8217;re in!</p>\n	<p><center><img src=\"/~tdc/images/16.jpg\" width=\"250\"></center></p>\n\n ','','\n\n ','','actives','2009',0,'',0,4,1,1,'brothers','','','manny-soto','08','','2009','8','','','','','','','c38897adba52d4ab53f59855727e06ae','2006-03-17');
INSERT INTO textpattern VALUES (12,'2006-03-17 08:36:00','presbrey','2006-04-12 04:31:03','presbrey','Live at TDC!','','Our 5 story, *waterfront mansion* located on MIT campus offers the flexibility of living in Boston, the beauty of being on the Charles River, and the convenience of MIT\'s free facilities and transportation nearby.  Besides it\'s great location, it\'s *clean*, the brothers are *fun*, and the physical plant is *amazing*:\r\n\r\nWe\'re equipped with a massive pub, a TV room with game consoles, a pool room, a grand piano, foosball tables, and amazing roof decks on every floor.  We\'ve also got a back yard where we\'ll be having regular barbecues and a parking lot.  The rooms are also furbished.\r\n\r\nIf you\'re looking for somewhere you can *live and party*, then TDC’s for you.  We\'re looking for boarders that want to have a *good time* and won\'t mind hanging out with the brothers on a regular basis.  We will be throwing parties, BBQs, having beach trips, and organizing other social events throughout the summer.\r\n\r\nWe\'ve got doubles, triples, quads, and even a few singles available -- all with amazing views.  Price varies by room size.  Come check us out!\r\n\r\n_Email tdc-summer@mit.edu for more information or call 305-297-1642 and ask for Chris._','	<p>Our 5 story, <strong>waterfront mansion</strong> located on MIT campus offers the flexibility of living in Boston, the beauty of being on the Charles River, and the convenience of MIT&#8217;s free facilities and transportation nearby.  Besides it&#8217;s great location, it&#8217;s <strong>clean</strong>, the brothers are <strong>fun</strong>, and the physical plant is <strong>amazing</strong>:</p>\n	<p>We&#8217;re equipped with a massive pub, a TV room with game consoles, a pool room, a grand piano, foosball tables, and amazing roof decks on every floor.  We&#8217;ve also got a back yard where we&#8217;ll be having regular barbecues and a parking lot.  The rooms are also furbished.</p>\n	<p>If you&#8217;re looking for somewhere you can <strong>live and party</strong>, then TDC’s for you.  We&#8217;re looking for boarders that want to have a <strong>good time</strong> and won&#8217;t mind hanging out with the brothers on a regular basis.  We will be throwing parties, BBQs, having beach trips, and organizing other social events throughout the summer.</p>\n	<p>We&#8217;ve got doubles, triples, quads, and even a few singles available&#8212;all with amazing views.  Price varies by room size.  Come check us out!</p>\n	<p><em>Email tdc-summer@mit.edu for more information or call 305-297-1642 and ask for Chris.</em></p>\n\n ','','\n\n ','','TDC','',0,'',0,4,1,1,'summer','','','live-at-tdc','','','','','','','','','','','8ab5acaa1f17bf14a5a9a30c8f3e3a9d','2006-03-17');
INSERT INTO textpattern VALUES (14,'2006-03-17 09:49:00','presbrey','2006-04-12 08:41:15','presbrey','Brothers of TDC','','The brothers of TDC are diverse in interest, origin, and opinion. All personalities are present in our fraternity and our open-minded atmosphere allows each of us to cultivate our own lives without fear of discrimination.\r\n\r\nSelect a class from the left to meet the brothers of TDC or check out the random bro shown below.\r\n\r\n<hr><br>\r\n\r\nh3. Random Bro:\r\n\r\n<br />\r\n<txp:php>\r\n$query = \"SELECT Title, Body_html FROM textpattern t where Category1 = \'actives\' AND Status=4 order by rand() limit 1\";\r\n$r = mysql_query($query);\r\n$r = mysql_fetch_row($r);\r\n$name = array_shift($r);\r\n$body = array_shift($r);\r\nprint($name);\r\nprint($body);\r\n</txp:php>','	<p>The brothers of TDC are diverse in interest, origin, and opinion. All personalities are present in our fraternity and our open-minded atmosphere allows each of us to cultivate our own lives without fear of discrimination.</p>\n	<p>Select a class from the left to meet the brothers of TDC or check out the random bro shown below.</p>\n	<p><hr><br />\n</p>\n	<h3>Random Bro:</h3>\n<br />\n\n<txp:php>\n$query = \"SELECT Title, Body_html FROM textpattern t where Category1 = \'actives\' AND Status=4 order by rand() limit 1\";\n$r = mysql_query($query);\n$r = mysql_fetch_row($r);\n$name = array_shift($r);\n$body = array_shift($r);\nprint($name);\nprint($body);\n</txp:php>\n\n ','','\n\n ','','TDC','',0,'',0,5,1,1,'brothers','','','brothers-of-tdc','','','','','','','','','','','6f21a829ccbd1073c152857428c7de1b','2006-03-17');
