INSERT INTO textpattern VALUES (16,'2006-03-17 10:03:00','presbrey','2006-03-19 09:38:06','bolevos','Brock Forrest','','AKA \"Pancho of the Burrito People\"\r\nCourse 1, Environmental Engineering\r\nMIT Year: 2008\r\nHometown: Naples, FL\r\n\r\nI\'m a Latino from south FL. It\'s needless to say then that food, family, and music have been a big part of my life. Right now, I\'m studying Environmental Engineering at MIT. After school, I hope to travel the world a little bit. Running a large corporation and getting into politics are just a few of my career ambitions. For the most part, I can honestly say that I am a laid back person. In all of my life experiences I try to learn something new. My ultimate goal in living is to leave this world a better place than that of which I came into.\r\n<center><img src=\"/~tdc/images/11.jpg\"></center> ','	<p>AKA &#8220;Pancho of the Burrito People&#8221;<br />\nCourse 1, Environmental Engineering<br />\nMIT Year: 2008<br />\nHometown: Naples, FL</p>\n	<p>I&#8217;m a Latino from south FL. It&#8217;s needless to say then that food, family, and music have been a big part of my life. Right now, I&#8217;m studying Environmental Engineering at MIT. After school, I hope to travel the world a little bit. Running a large corporation and getting into politics are just a few of my career ambitions. For the most part, I can honestly say that I am a laid back person. In all of my life experiences I try to learn something new. My ultimate goal in living is to leave this world a better place than that of which I came into.<br />\n<center><img src=\"/~tdc/images/11.jpg\"></center> </p>\n\n ','','\n\n ','','actives','2008',0,'',0,4,1,1,'brothers','','','brock-forrest','02','','2008','2','','','','','','','9668a8893b54f7a7439b99f932b80f27','2006-03-17');
