INSERT INTO textpattern VALUES (18,'2006-03-16 10:03:00','presbrey','2006-03-20 08:20:31','bolevos','Adlai Grayson','','AKA \"Chief Of Staff\"\r\nCourse 7, Biology\r\nMIT Year: 2008\r\nHometown: Miami, FL\r\n\r\nAdlai Grayson is the token black guy with strong homosexual tendencies - he grabs male crotches and asses for the fun of hearing the squeal. It\'s actually a sign of acceptance - if Adlai ever interacts with you in that manner, it\'s because you were worth the effort. Adlai, being black and gay, stereotypically loves to dance: he does Bhangra, he does Ghidda, he does any guy from Egypt, he does salsa, he does hiphop, he does Marylin Monroe on liplock. Ok so yeah he has issues with rhyming.  Adlai has a heart for people that know how to smile or for people that try once in a while. He\'s also the boy on campus that wears bandanas. Find more out about me by using your imagination.\r\n<center><img src=\"/~tdc/images/15.jpg\" width=\"300\"></center>','	<p>AKA &#8220;Chief Of Staff&#8221;<br />\nCourse 7, Biology<br />\nMIT Year: 2008<br />\nHometown: Miami, FL</p>\n	<p>Adlai Grayson is the token black guy with strong homosexual tendencies &#8211; he grabs male crotches and asses for the fun of hearing the squeal. It&#8217;s actually a sign of acceptance &#8211; if Adlai ever interacts with you in that manner, it&#8217;s because you were worth the effort. Adlai, being black and gay, stereotypically loves to dance: he does Bhangra, he does Ghidda, he does any guy from Egypt, he does salsa, he does hiphop, he does Marylin Monroe on liplock. Ok so yeah he has issues with rhyming.  Adlai has a heart for people that know how to smile or for people that try once in a while. He&#8217;s also the boy on campus that wears bandanas. Find more out about me by using your imagination.<br />\n<center><img src=\"/~tdc/images/15.jpg\" width=\"300\"></center></p>\n\n ','','\n\n ','','actives','2008',0,'',0,4,1,1,'brothers','','','adlai-grayson','04','','2008','4','','','','','',''