INSERT INTO textpattern VALUES (19,'2006-03-17 10:04:00','presbrey','2006-04-02 17:35:00','bolevos','Manuel Rivas','','AKA \"El Nicoya\"\r\nCourse 18, Mathematics\r\nMIT Year: 2008\r\nHometown: Managua, Nicaragua ---> Miami, FL\r\n\r\nStanding at 5\'10\" with a gleam in his eye and a grin on his face, Manuel is the modern Don Juan Tenorio. Manuel wants to unravel the secrets of the human genome using a catalog of patterns (if you catch my drift).  Other than that, Manuel thinks about what can be done with only open source software and data that is available to the whole world as it motivates future planning for the development of his beautiful country, Nicaragua. Manuel loves women. Manuel really loves women. He also plays soccer and basketball. \r\n\r\n\r\n<center><img src=\"/~tdc/images/26.jpg\" width=\"350\"></center>','	<p>AKA &#8220;El Nicoya&#8221;<br />\nCourse 18, Mathematics<br />\nMIT Year: 2008<br />\nHometown: Managua, Nicaragua&#8212;-> Miami, FL</p>\n	<p>Standing at 5&#8217;10&#8221; with a gleam in his eye and a grin on his face, Manuel is the modern Don Juan Tenorio. Manuel wants to unravel the secrets of the human genome using a catalog of patterns (if you catch my drift).  Other than that, Manuel thinks about what can be done with only open source software and data that is available to the whole world as it motivates future planning for the development of his beautiful country, Nicaragua. Manuel loves women. Manuel really loves women. He also plays soccer and basketball. </p>\n	<p><center><img src=\"/~tdc/images/26.jpg\" width=\"350\"></center></p>\n\n ','','\n\n ','','actives','2008',0,'',0,4,1,1,'brothers','','','manuel-rivas','05','','2008','5','','','','','','','763d7c8fe0e124f955c321cd8b5b9b4f','2006-03-17');
