INSERT INTO textpattern VALUES (22,'2006-03-17 10:07:00','presbrey','2006-04-12 09:30:08','presbrey','Joe Presbrey','','AKA \"It\'s Tricky (Tricky) Tricky (Trrrrrricky)\"\r\n\r\nCourse 6\r\n\r\nHometown: Fort Myers, FL\r\n\r\nJoe is very often discovered -having forgotten to shave- trying to grow a half decent beard.  He enjoys developing and securing distributed computing architectures, working on startups, doing both together, and balancing the work with his student career leaving just enough time to search the globe for his destiny and maybe a soulmate or two for good measure.\r\n\r\nFinally selling \"Sconex\":http://www.sconex.com in March of 2006 to Alloy, Inc., he\'s an exhausted guy and relishes any vacation afforded him.\r\n\r\n!/images/joe.jpg!','	<p>AKA &#8220;It&#8217;s Tricky (Tricky) Tricky (Trrrrrricky)&#8221;</p>\n	<p>Course 6</p>\n	<p>Hometown: Fort Myers, FL</p>\n	<p>Joe is very often discovered <del>having forgotten to shave</del> trying to grow a half decent beard.  He enjoys developing and securing distributed computing architectures, working on startups, doing both together, and balancing the work with his student career leaving just enough time to search the globe for his destiny and maybe a soulmate or two for good measure.</p>\n	<p>Finally selling <a href=\"http://www.sconex.com\">Sconex</a> in March of 2006 to Alloy, Inc., he&#8217;s an exhausted guy and relishes any vacation afforded him.</p>\n	<p><img src=\"/images/joe.jpg\" alt=\"\" /></p>\n\n ','','\n\n ','','actives','2007',0,'',0,4,1,1,'brothers','','','joe-presbrey','03','','2007','3','','','','','','','69338e7a7ba12f3d3bd20682c3ec3e26','2006-03-17');
INSERT INTO textpattern VALUES (23,'2006-03-17 10:07:00','presbrey','2006-03-19 09:37:39','bolevos','Ross Fu','','AKA \"Fupa\" \r\nDouble Major in Chemistry and Mathematics\r\nMIT Year: 2007\r\nHometown: San Diego, CA\r\n\r\nI was born in China. I was an accident. I go to MIT and study hard to prove I shouldn\'t have been aborted.  I like puppies, and I hate mean things.\r\n<center><img src=\"/~tdc/images/12.jpg\"></center>','	<p>AKA &#8220;Fupa&#8221; <br />\nDouble Major in Chemistry and Mathematics<br />\nMIT Year: 2007<br />\nHometown: San Diego, CA</p>\n	<p>I was born in China. I was an accident. I go to MIT and study hard to prove I shouldn&#8217;t have been aborted.  I like puppies, and I hate mean things.<br />\n<center><img src=\"/~tdc/images/12.jpg\"></center></p>\n\n ','','\n\n ','','actives','2007',0,'',0,4,1,1,'brothers','','','ross-fu','04','','2007','4','','','','','','','d482045543b215700ee67e2404d42c62','2006-03-17');
INSERT INTO textpattern VALUES (24,'2006-03-17 10:08:00','presbrey','2006-04-12 08:31:14','presbrey','Adam Taylor','','AKA \"Superman\"\r\n\r\nAdam was last seen flying faster than a speeding bullet towards the Epsilon charge after facing his not cool arch nemesis with the help of his trusty companion, Sim, and his train.  Defeated, he is now on retreat until next winter.','	<p>AKA &#8220;Superman&#8221;</p>\n	<p>Adam was last seen flying faster than a speeding bullet towards the Epsilon charge after facing his not cool arch nemesis with the help of his trusty companion, Sim, and his train.  Defeated, he is now on retreat until next winter.</p>\n\n ','','\n\n ','','actives','2006',0,'',0,4,1,1,'brothers','','','adam-taylor','01','','2006','01','','','','','','','55604d661d2b05642349f2dc12b53f3d','2006-03-17');
INSERT INTO textpattern VALUES (25,'2006-03-17 10:09:00','presbrey','2006-03-18 18:02:24','bolevos','Amir Hirsch','','AKA \"The Token Jew\"\r\nDouble Major in Course 6 and Course 18.  Coming back for MEng 2007.\r\nMIT Year: 2006\r\nHometown: Fairfield, CT\r\n\r\nNo set of words is sufficient to express identity.  Amir has been known to play a wide variety of musical instruments including an electric saxophone, piano and the pillow. Amir\'s goals in life include colonization of the moon, transference of human consciousness to robotics, and the eradication of eradication.  When the countdown reaches zero and the rocket is about to lift-off, so much can go wrong in that moment.  But so much can go right... and that\'s why we set ourselves into this course in the first place.\r\n<center><img src=\"/~tdc/images/7.jpg\"></center>','	<p>AKA &#8220;The Token Jew&#8221;<br />\nDouble Major in Course 6 and Course 18.  Coming back for MEng 2007.<br />\nMIT Year: 2006<br />\nHometown: Fairfield, CT</p>\n	<p>No set of words is sufficient to express identity.  Amir has been known to play a wide variety of musical instruments including an electric saxophone, piano and the pillow. Amir&#8217;s goals in life include colonization of the moon, transference of human consciousness to robotics, and the eradication of eradication.  When the countdown reaches zero and the rocket is about to lift-off, so much can go wrong in that moment.  But so much can go right&#8230; and that&#8217;s why we set ourselves into this course in the first place.<br />\n<center><img src=\"/~tdc/images/7.jpg\"></center></p>\n\n ','','\n\n ','','actives','2006',0,'',0,4,1,1,'brothers','','','amir-hirsch','02','','2006','02','','','','','','','56adda858b4b108d58419afcf4757a48','2006-03-17');
INSERT INTO textpattern VALUES (26,'2006-03-18 10:09:00','presbrey','2006-03-19 20:23:43','bolevos','Dan Arlow','','AKA \"His Name Is Robert Paulson\"\r\nCourse 18, Mathematics\r\nMIT Year: 2006\r\nHometown: Marshall, MI\r\n\r\nDan plans to cure diabetes before he graduates using only his laptop, g++, python, an avocado, an icepick, and his snorkel. Trust me bro, he\'s cured chronic diseases with less...\r\n<center><img src=\"/~tdc/images/13.jpg\"></center>','	<p>AKA &#8220;His Name Is Robert Paulson&#8221;<br />\nCourse 18, Mathematics<br />\nMIT Year: 2006<br />\nHometown: Marshall, MI</p>\n	<p>Dan plans to cure diabetes before he graduates using only his laptop, g++, python, an avocado, an icepick, and his snorkel. Trust me bro, he&#8217;s cured chronic diseases with less&#8230;<br />\n<center><img src=\"/~tdc/images/13.jpg\"></center></p>\n\n ','','\n\n ','','actives','2006',0,'',0,4,1,1,'brothers','','','dan-arlow','06','','2006','06','','','','','','','06c358be9a33d6260032d89eccd5487e','2006-03-17');
