INSERT INTO textpattern VALUES (35,'2006-01-01 02:07:00','presbrey','2006-04-12 09:14:22','presbrey','Rush and Pledging','','Men at MIT can join Theta Delta Chi during fall rush each year. Rush is a time when all of the fraternities open up to prospective members, usually incoming freshmen and sophomores, to encourage them to get to know and make friends with the brothers, and to find a house that is the \"right fit\" for each individual. Rush is a really fun time for both brothers and rushees, and its also a good time to get a feel for what MIT Frats are all about.\r\n\r\nDuring rush, TDC gives out bids (invitations to join the brotherhood) to prospective brothers. Those who accept begin a period of pledging that involves education in the history and traditions of Theta Delta Chi, community service and service to the MIT community, and time spent becoming lifelong friends with current brothers, alumni, and fellow pledge class members. Pledging does not mean or involve hazing.\r\n\r\nIf you are interested in joining TDC, send us an e-mail at *contact-tdc@mit.edu* or come to one of our events listed on the calendar. Put all your expectations aside and come out to make new friends, have a great time, and make personal connections that will change your entire life!','	<p>Men at MIT can join Theta Delta Chi during fall rush each year. Rush is a time when all of the fraternities open up to prospective members, usually incoming freshmen and sophomores, to encourage them to get to know and make friends with the brothers, and to find a house that is the &#8220;right fit&#8221; for each individual. Rush is a really fun time for both brothers and rushees, and its also a good time to get a feel for what MIT Frats are all about.</p>\n	<p>During rush, TDC gives out bids (invitations to join the brotherhood) to prospective brothers. Those who accept begin a period of pledging that involves education in the history and traditions of Theta Delta Chi, community service and service to the MIT community, and time spent becoming lifelong friends with current brothers, alumni, and fellow pledge class members. Pledging does not mean or involve hazing.</p>\n	<p>If you are interested in joining TDC, send us an e-mail at <strong>contact-tdc@mit.edu</strong> or come to one of our events listed on the calendar. Put all your expectations aside and come out to make new friends, have a great time, and make personal connections that will change your entire life!</p>\n\n ','','\n\n ','','TDC','',0,'',0,4,1,1,'rush','','','rush-and-pledging','','','','','','','','','','','194ed1e44d5f5a59c703f014b01aff92','2006-04-07');
INSERT INTO textpattern VALUES (37,'2006-04-10 21:40:00','akuma','2006-04-12 08:05:37','presbrey','Campus Preview Weekend','','CPW 2006 was awesome.  We met a lot of really cool prefrosh and  had a ton of great events.  It was particularly cool when we went party hopping Friday and Saturday nights and had trails of 50+ (literally) people following us around.   If you came by the house, drop us an email and let us know if you had a good time at *tdc-social-chair@mit.edu*.  If you didn\'t, make sure you come by next time you\'re in town!','	<p>CPW 2006 was awesome.  We met a lot of really cool prefrosh and  had a ton of great events.  It was particularly cool when we went party hopping Friday and Saturday nights and had trails of 50+ (literally) people following us around.   If you came by the house, drop us an email and let us know if you had a good time at <strong>tdc-social-chair@mit.edu</strong>.  If you didn&#8217;t, make sure you come by next time you&#8217;re in town!</p>\n\n ','CPW 2006 recap with local visionary, Chris Rodriguez.','	<p>CPW 2006 recap with local visionary, Chris Rodriguez.</p>\n\n ','','CPW','',0,'',0,4,1,1,'news','','CPW\r\nrush\r\nprefrosh','cpw-2006','','akuma@mit.edu','2004','1','15','','','','','','dcdbd60da8af8ec04b4aa42b1a6c8272','2006-04-10');
