INSERT INTO textpattern VALUES (53,'2006-04-05 01:00:00','presbrey','2006-04-12 08:25:05','presbrey','CPW 2006 Schedule','','*THURSDAY, APRIL 6, 2006*\r\n\r\n10:00am – 4:00pm\r\nGetting Classy w/ TDC:\r\n1.011? 3.091? 5.08? 6.042? 15.812? 18.03?  Don\'t know what these classes are?  Yeah, neither do we, but come find out with us. Come join us and see what MIT students do during a regular weekday. \r\n\r\n6:15pm – 7:30 pm\r\nDinner @ TDC:\r\nYou\'re invited to a nightly tradition:  Dinner with the Brothers.  Enjoy food prepared by our in-house chef, and debate a variety of topics, from Communist Cuba to FOX. \r\n\r\n10:55pm – 12:55am\r\nGaming @ TDC:\r\nHigh stakes chutes and ladders anyone?  Or what about a game of strip Boggle?  Do it. \r\n\r\n11:55pm – 2:00am\r\nLate Night Munchies @ TDC:\r\nTake part in some late night snacks while we watch Family Guy on one of our roof decks and playing video games in the TV room.  Stay ‘til late and watch the sun rise over the Boston skyline on our rooftop. Hey, real MIT students never go to sleep. \r\n\r\n*FRIDAY, APRIL 7, 2006*\r\n\r\n10:00am – 4:00pm\r\nGetting Classy w/ TDC:\r\n1.011? 3.091? 5.08? 6.042? 15.812? 18.03?  Don\'t know what these classes are?  Yeah, neither do we, but come find out with us. Come join us and see what MIT students do during a regular weekday. \r\n\r\n4:55pm – 7:55pm\r\nBBQ w/ Jonny vs. the Ninjas @ TDC:\r\nFood and live music?  What’s not to like?  Hang out with us as we flip burgers to the tunes of the band Jonny vs. the Ninjas.  Haven’t heard of them?  Check em out at jonnyvstheninjas.com and check us out, we’re right next to Baker House. \r\n\r\n10:00pm – 2:00 am\r\nParty Hopping:\r\nGoing to different parties around the Boston/Cambridge area. \r\n\r\n*SATURDAY, APRIL 8, 2006*\r\n\r\n11:55am – 12:55pm\r\n\r\n& 2:25pm – 3:25pm\r\nBBQ @ TDC:\r\nSink your teeth into some long dogs and hot buns at our barbeque. \r\n\r\n3:25pm – 5:25pm\r\nBoston Tours w/ TDC:\r\nFace your destiny, start enjoying Boston by actually getting to know it. \r\n\r\n7:25pm – 9:55pm\r\nPre-game @ TDC:\r\nPrepare for a night out at MIT parties here: root beer floats, smoothies, and shakes with DJ Tinker and his grandiloquent traxxx... \r\n\r\n10:00pm – 2:00 am\r\nParty Hopping:\r\nGoing to different parties around the Boston/Cambridge area.','	<p><strong>THURSDAY, APRIL 6, 2006</strong></p>\n	<p>10:00am – 4:00pm<br />\nGetting Classy w/ TDC:<br />\n1.011? 3.091? 5.08? 6.042? 15.812? 18.03?  Don&#8217;t know what these classes are?  Yeah, neither do we, but come find out with us. Come join us and see what MIT students do during a regular weekday. </p>\n	<p>6:15pm – 7:30 pm<br />\nDinner @ TDC:<br />\nYou&#8217;re invited to a nightly tradition:  Dinner with the Brothers.  Enjoy food prepared by our in-house chef, and debate a variety of topics, from Communist Cuba to FOX. </p>\n	<p>10:55pm – 12:55am<br />\nGaming @ TDC:<br />\nHigh stakes chutes and ladders anyone?  Or what about a game of strip Boggle?  Do it. </p>\n	<p>11:55pm – 2:00am<br />\nLate Night Munchies @ TDC:<br />\nTake part in some late night snacks while we watch Family Guy on one of our roof decks and playing video games in the TV room.  Stay ‘til late and watch the sun rise over the Boston skyline on our rooftop. Hey, real MIT students never go to sleep. </p>\n	<p><strong>FRIDAY, APRIL 7, 2006</strong></p>\n	<p>10:00am – 4:00pm<br />\nGetting Classy w/ TDC:<br />\n1.011? 3.091? 5.08? 6.042? 15.812? 18.03?  Don&#8217;t know what these classes are?  Yeah, neither do we, but come find out with us. Come join us and see what MIT students do during a regular weekday. </p>\n	<p>4:55pm – 7:55pm<br />\nBBQ w/ Jonny vs. the Ninjas @ TDC:<br />\nFood and live music?  What’s not to like?  Hang out with us as we flip burgers to the tunes of the band Jonny vs. the Ninjas.  Haven’t heard of them?  Check em out at jonnyvstheninjas.com and check us out, we’re right next to Baker House. </p>\n	<p>10:00pm – 2:00 am<br />\nParty Hopping:<br />\nGoing to different parties around the Boston/Cambridge area. </p>\n	<p><strong>SATURDAY, APRIL 8, 2006</strong></p>\n	<p>11:55am – 12:55pm</p>\n	<p>&#38; 2:25pm – 3:25pm<br />\nBBQ @ TDC:<br />\nSink your teeth into some long dogs and hot buns at our barbeque. </p>\n	<p>3:25pm – 5:25pm<br />\nBoston Tours w/ TDC:<br />\nFace your destiny, start enjoying Boston by actually getting to know it. </p>\n	<p>7:25pm – 9:55pm<br />\nPre-game @ TDC:<br />\nPrepare for a night out at MIT parties here: root beer floats, smoothies, and shakes with DJ Tinker and his grandiloquent traxxx&#8230; </p>\n	<p>10:00pm – 2:00 am<br />\nParty Hopping:<br />\nGoing to different parties around the Boston/Cambridge area.</p>\n\n ','','\n\n ','','CPW','',0,'',0,4,1,1,'news','','','cpw-2006-schedule','','','','','','','','','','','f3622884c4e1251177c617b8e62f4e0f','2006-04-12');
INSERT INTO textpattern VALUES (54,'2006-03-12 08:14:00','presbrey','2006-04-12 09:25:28','presbrey','Find TDC','','!/images/googlemap.jpg!\r\n\r\nbq. Theta Delta Chi\r\n\r\nbq. 372 Memorial Drive\r\n\r\nbq. Cambridge, MA 02139\r\n\r\nTDC is south-west of the Kendall T stop by about 15 minutes and 5 minutes from the #1 Bus that stops at 77 Mass Ave.  From the airport, take the silver-line to the red-line and get off at Kendall/MIT.','	<p><img src=\"/images/googlemap.jpg\" alt=\"\" /></p>\n	<blockquote>\n		<p>Theta Delta Chi</p>\n	</blockquote>\n	<blockquote>\n		<p>372 Memorial Drive</p>\n	</blockquote>\n	<blockquote>\n		<p>Cambridge, MA 02139</p>\n	</blockquote>\n	<p>TDC is south-west of the Kendall T stop by about 15 minutes and 5 minutes from the #1 Bus that stops at 77 Mass Ave.  From the airport, take the silver-line to the red-line and get off at Kendall/MIT.</p>\n\n ','','\n\n ','','TDC','',0,'',0,4,1,1,'contact','','','directions-to-tdc','','','','','','','','','','','12fb7ea80d1e9ef17502f896df978346','2006-04-12');
