INSERT INTO txp_plugin VALUES ('chh_if_data',0,'Coke Harrington','http://www.cokesque.com/','0.10','Show a block of text only if enclosed Txp tags produce some output.','	<h2>chh_if_data</h2>\n\n	<p>This tag is used to determine whether some contained Txp tags output any data, allowing the conditional output of extra markup, like a header or a \"no articles found\" message.</p>\n\n<pre>\n&lt;txp:chh_if_data&gt;\n    &lt;h3&gt;Here\'s an article list&lt;/h3&gt;\n    &lt;txp:article_custom category=\"Nogo\" /&gt;\n&lt;txp:else /&gt;\n    &lt;p&gt;article_custom had nothing to say.&lt;/p&gt;\n&lt;/txp:chh_if_data&gt;</pre>\n<pre>\n&lt;txp:chh_if_data&gt;\n    Static text will NEVER be shown.\n    Drop a Txp tag in here!<br />\n&lt;/txp:chh_if_data&gt;<br />\n</pre>\n\n	<p>If the enclosed chunk of text contains several Txp tags, <code>chh_if_data</code> will evaluate to true when <em>any</em> of the tags returns data.</p>\n\n	<p>\"Data,\" in this case, mean any output at all, including whitespace.</p>\n\n\n ','\nfunction chh_if_data ($atts, $thing=\'\') {\n    $atts = lAtts(array(\'debug\' => 0), $atts);\n\n    $f = \'/<txp:(\\S+)\\b(.*)(?:(?<!br )(\\/))?\'.chr(62).\'(?(3)|(.+)<\\/txp:\\1>)/sU\';\n    $iftext = EvalElse($thing, true);\n    $thresh = 1 + strlen(preg_replace($f, \'\', $iftext));\n\n    $parsed = parse($iftext);\n    $parsed_len = strlen($parsed);\n\n    $empty = \'Data\';\n    if (strlen($parsed) < $thresh) { #or !preg_match(\'/\\S/\', $parsed)) {\n        $parsed = parse(EvalElse($thing, false));\n        $empty = \'No Data\';\n    }\n    return $atts[\'debug\']\n           ? \"<!-- $empty -- Threshhold: $thresh Length: $parsed_len -->\" . $parsed\n           : $parsed;\n}\n\n// Deprecated due to poor naming\nfunction chh_unless_empty ($atts, $thing=\'\') {\n    return chh_if_data($atts, $thing);\n}\nfunction chh_if_not_empty ($atts, $thing=\'\') {\n    return chh_if_data($atts, $thing);\n}\n','\nfunction chh_if_data ($atts, $thing=\'\') {\n    $atts = lAtts(array(\'debug\' => 0), $atts);\n\n    $f = \'/<txp:(\\S+)\\b(.*)(?:(?<!br )(\\/))?\'.chr(62).\'(?(3)|(.+)<\\/txp:\\1>)/sU\';\n    $iftext = EvalElse($thing, true);\n    $thresh = 1 + strlen(preg_replace($f, \'\', $iftext));\n\n    $parsed = parse($iftext);\n    $parsed_len = strlen($parsed);\n\n    $empty = \'Data\';\n    if (strlen($parsed) < $thresh) { #or !preg_match(\'/\\S/\', $parsed)) {\n        $parsed = parse(EvalElse($thing, false));\n        $empty = \'No Data\';\n    }\n    return $atts[\'debug\']\n           ? \"<!-- $empty -- Threshhold: $thresh Length: $parsed_len -->\" . $parsed\n           : $parsed;\n}\n\n// Deprecated due to poor naming\nfunction chh_unless_empty ($atts, $thing=\'\') {\n    return chh_if_data($atts, $thing);\n}\nfunction chh_if_not_empty ($atts, $thing=\'\') {\n    return chh_if_data($atts, $thing);\n}\n','967a43e8eecce18e74b790ee6204c956',0);
INSERT INTO txp_plugin VALUES ('rss_unlimited_categories',0,'Rob Sable','http://www.wilshireone.com/','0.1','Enable unlimited categories (tags) per article.','\n	<h1>Unlimited Article Categories in Textpattern</h1>\n\n	<p>The <a href=\"http://www.wilshireone.com/textpattern-plugins/rss-unlimited-categories\">rss_unlimited_categories</a> plugin enables you to assign an unlimited number of categories to an article so that you&#8217;re not limited to the default number allowed by Textpattern (2).</p>\n\n	<p>In addition, the plugin enables recognition of /section/category URLs when you use either /section/title or /section/ID/title URLs.</p>\n\n	<p>The plugin will add a multiple select list to your article -> write tab to enable the selection of unlimited categories.  It also includes several public side tags to display the categories and list articles by category.</p>\n\n	<p><hr/></p>\n\n	<h2>Installation and Setup</h2>\n\n	<ol>\n	<li>Simply install and enable the plugin.  The plugin will automatically install a new table that relates articles to categories.</li>\n		<li>Navigate to the article -> write tab and you&#8217;ll find a new multiple select list above the standard Textpattern category selection.</li>\n		<li>For existing sites, you can copy your current article/category assignments to the new category table structure using the following SQL statements:</li>\n	</ol>\n\n<code><pre>INSERT INTO textpattern_category (article_id, category_id) SELECT t.id, c.id FROM textpattern t LEFT JOIN txp_category c on t.category1 = c.name where c.type = \'article\' and t.category1 != \'\';</pre></code>\n\n<code><pre>INSERT INTO textpattern_category (article_id, category_id) SELECT t.id, c.id FROM textpattern t LEFT JOIN txp_category c on t.category2 = c.name where c.type = \'article\' and t.category2 != \'\';</pre></code>\n\n	<p><hr/></p>\n\n	<h2>Public Site Tags</h2>\n\n	<p>The collection of public site tags include:</p>\n\n	<p><strong>rss_unlimited_categories_filedunder</strong> &#8211; Lists all categories assigned to the current article.<br />\n<strong>rss_unlimited_categories_cloud</strong> &#8211; Displays a weighted list of all categories as a <a href=\"http://en.wikipedia.org/wiki/Tag_cloud\">tag cloud</a>.<br />\n<strong>rss_unlimited_categories_list</strong> &#8211; Displays a list of all categories with the number of posts in each.<br />\n<strong>rss_unlimited_categories_article_list</strong> &#8211;  Lists articles by category.  This is a replacement for the standard Textpattern article list tags.</p>\n\n	<p>All of the tags use the new category table created by this plugin instead of the standard Textpattern category 1 and 2 fields.</p>\n\n	<p><hr/></p>\n\n	<h3>rss_unlimited_categories_filedunder</h3>\n\n	<p>Lists all categories assigned to the current article.</p>\n\n	<p><strong>limit</strong><br />\nThe maximum number of categories returned.<br />\nDefault:  &#8220;999&#8221;<br />\nExample: limit=&#8221;5&#8221;</p>\n\n	<p><strong>linktosection</strong><br />\nThe maximum number of live search results returned.<br />\nDefault:  &#8220;article&#8221;<br />\nExample: linktosection=&#8221;10&#8221;</p>\n\n	<p><strong>listwraptag</strong><br />\nThe HTML tag that wraps the label and category list.<br />\nDefault:  &#8220;&#8221;<br />\nExample: listwraptag=&#8221;div&#8221;</p>\n\n	<p><strong>wraptag</strong><br />\nThe HTML tag that wraps the category list.<br />\nDefault:  &#8220;&#8221;<br />\nExample: wraptag=&#8221;ul&#8221;</p>\n\n	<p><strong>class</strong><br />\nThe class attribute on the wraptag.<br />\nDefault:  &#8220;&#8221;<br />\nExample: class=&#8221;catlist&#8221;</p>\n\n	<p><strong>break</strong><br />\nHTML/text that wraps/separates each element in the list.<br />\nDefault:  &#8221;, &#8221;<br />\nExample: break=&#8221;li&#8221;</p>\n\n	<p><strong>breakclass</strong><br />\nThe maximum number of live search results returned.<br />\nDefault:  &#8220;&#8221;<br />\nExample: breakclass=&#8221;catelement&#8221;</p>\n\n	<p><strong>label</strong><br />\nA label that appears before the list.<br />\nDefault:  &#8220;&#8221;<br />\nExample: label=&#8221;File under: &#8221;</p>\n\n	<p><strong>labeltag</strong><br />\nThe HTML tag that wraps the label.<br />\nDefault:  &#8220;&#8221;<br />\nExample: labeltag=&#8221;h4&#8221;</p>\n\n	<p><hr/></p>\n\n	<h3>rss_unlimited_categories_cloud</h3>\n\n	<p>Displays a weighted list of all categories as a &#8220;cloud&#8221;.</p>\n\n	<p><strong>limit</strong><br />\nThe maximum number of categories returned.<br />\nDefault:  &#8220;999&#8221;<br />\nExample: limit=&#8221;5&#8221;</p>\n\n	<p><strong>parent</strong><br />\nThe maximum number of live search results returned.<br />\nDefault:  &#8220;&#8221;<br />\nExample: parent=&#8221;mycategory&#8221;</p>\n\n	<p><strong>linktosection</strong><br />\nThe maximum number of live search results returned.<br />\nDefault:  &#8220;article&#8221;<br />\nExample: linktosection=&#8221;archive&#8221;</p>\n\n	<p><strong>cloudwraptag</strong><br />\nThe HTML tag that wraps the label and category list.<br />\nDefault:  &#8220;&#8221;<br />\nExample: cloudwraptag=&#8221;div&#8221;</p>\n\n	<p><strong>wraptag</strong><br />\nThe HTML tag that wraps the category list.<br />\nDefault:  &#8220;p&#8221;<br />\nExample: wraptag=&#8221;ul&#8221;</p>\n\n	<p><strong>class</strong><br />\nThe class attribute on the wraptag.<br />\nDefault:  &#8220;&#8221;<br />\nExample: class=&#8221;catlist&#8221;</p>\n\n	<p><strong>break</strong><br />\nHTML/text that wraps/separates each element in the list.<br />\nDefault:  &#8221;, &#8221;<br />\nExample: break=&#8221;li&#8221;</p>\n\n	<p><strong>breakclass</strong><br />\nThe maximum number of live search results returned.<br />\nDefault:  &#8220;&#8221;<br />\nExample: breakclass=&#8221;catelement&#8221;</p>\n\n	<p><strong>label</strong><br />\nA label that appears before the list.<br />\nDefault:  &#8220;&#8221;<br />\nExample: label=&#8221;File under: &#8221;</p>\n\n	<p><strong>labeltag</strong><br />\nThe HTML tag that wraps the label.<br />\nDefault:  &#8220;&#8221;<br />\nExample: labeltag=&#8221;h4&#8221;</p>\n\n	<p><hr/></p>\n\n	<h3>rss_unlimited_categories_list</h3>\n\n	<p>Displays a list of all categories with the number of posts in each.</p>\n\n	<p><strong>limit</strong><br />\nThe maximum number of categories returned.<br />\nDefault:  &#8220;999&#8221;<br />\nExample: limit=&#8221;5&#8221;</p>\n\n	<p><strong>parent</strong><br />\nThe maximum number of live search results returned.<br />\nDefault:  &#8220;&#8221;<br />\nExample: parent=&#8221;mycategory&#8221;</p>\n\n	<p><strong>linktosection</strong><br />\nThe section used for category links.<br />\nDefault:  &#8220;article&#8221;<br />\nExample: linktosection=&#8221;archive&#8221;</p>\n\n	<p><strong>showcount</strong><br />\nDisplays the number of posts in each category.<br />\nDefault:  &#8220;1&#8221;<br />\nExample: showcount=&#8221;0&#8221;</p>\n\n	<p><strong>listwraptag</strong><br />\nThe HTML tag that wraps the label and category list.<br />\nDefault:  &#8220;&#8221;<br />\nExample: listwraptag=&#8221;div&#8221;</p>\n\n	<p><strong>wraptag</strong><br />\nThe HTML tag that wraps the category list.<br />\nDefault:  &#8220;ul&#8221;<br />\nExample: wraptag=&#8221;p&#8221;</p>\n\n	<p><strong>class</strong><br />\nThe class attribute on the wraptag.<br />\nDefault:  &#8220;&#8221;<br />\nExample: class=&#8221;catlist&#8221;</p>\n\n	<p><strong>break</strong><br />\nHTML/text that wraps/separates each element in the list.<br />\nDefault:  &#8220;li&#8221;<br />\nExample: break=&#8221;, &#8221;</p>\n\n	<p><strong>breakclass</strong><br />\nThe maximum number of live search results returned.<br />\nDefault:  &#8220;&#8221;<br />\nExample: breakclass=&#8221;catelement&#8221;</p>\n\n	<p><strong>label</strong><br />\nA label that appears before the list.<br />\nDefault:  &#8220;&#8221;<br />\nExample: label=&#8221;File under: &#8221;</p>\n\n	<p><strong>labeltag</strong><br />\nThe HTML tag that wraps the label.<br />\nDefault:  &#8220;&#8221;<br />\nExample: labeltag=&#8221;h4&#8221;</p>\n\n	<p><hr/></p>\n\n	<h3>rss_unlimited_categories_article_list</h3>\n\n	<p>Lists articles by category.  This is a replacement for the standard Textpattern article list tags that uses the unlimited category tables instead of the standard Textpattern category 1 and 2 fields.</p>\n\n	<p><strong>limit</strong><br />\nThe maximum number of categories returned.<br />\nDefault:  &#8220;999&#8221;<br />\nExample: limit=&#8221;5&#8221;</p>\n\n	<p><strong>section</strong><br />\nThe maximum number of categories returned.<br />\nDefault:  &#8220;&#8221;<br />\nExample: section=&#8221;blog&#8221;</p>\n\n	<p><strong>category</strong><br />\nThe maximum number of categories returned.<br />\nDefault:  &#8221;$c&#8221; (global category)<br />\nExample: category=&#8221;5&#8221;</p>\n\n	<p><strong>form</strong><br />\nThe article form used in the article list.<br />\nDefault:  &#8220;default&#8221;<br />\nExample: form=&#8221;myform&#8221;</p>\n\n	<p><strong>offset</strong><br />\nExcludes x number of articles from the beginning of the article listing.<br />\nDefault:  &#8220;0&#8221;<br />\nExample: offset=&#8221;1&#8221;</p>\n\n\n\n\n ','\nif (@txpinterface == \'admin\') {\n\n	$q = \"SHOW TABLES LIKE \'\".PFX.\"textpattern_category\'\";\n	$tcheck = getRows($q);\n	if (!$tcheck) {\n		$qc = \"CREATE TABLE `\".PFX.\"textpattern_category` (`article_id` int(11) NOT NULL default \'0\', `category_id` int(6) NOT NULL default \'0\', PRIMARY KEY  (`article_id`,`category_id`)) TYPE=MyISAM; \";\n		safe_query($qc);\n	}\n\n	register_callback(\'rss_admin_catlist_save\', \'article\', \'post\');\n	register_callback(\'rss_admin_catlist_save\', \'article\', \'edit\');\n	register_callback(\'rss_admin_catlist\', \'article\');\n\n	register_callback(\'rss_admin_catlist_delete\', \'list\', \'list_multi_edit\');\n	register_callback(\'rss_admin_articlelist\', \'list\');\n\n	if (gps(\'event\') == \"article\" and gps(\'step\') == \"save\") {\n\n			safe_delete(\"textpattern_category\",\"article_id=$ID\");\n			foreach(gps(\'Cats\') as $val ){\n				safe_insert(\"textpattern_category\",\n					\"category_id = \'$val\',\n					article_id=\'$ID\'\"\n				);\n			}\n\n	}\n}\n\nregister_callback(\'rss_multi_url\',\'pretext\');\n\nfunction rss_multi_url() {\n	global $attach_titles_to_permalinks,$permlink_mode;\n\n	$subpath = preg_quote(preg_replace(\"/http:\\/\\/.*(\\/.*)/Ui\",\"$1\",hu),\"/\");\n	$req = preg_replace(\"/^$subpath/i\",\"/\",serverSet(\'REQUEST_URI\'));\n	extract(chopUrl($req));\n\n	if ($permlink_mode == \"section_id_title\" || $permlink_mode = \"section_title\") {\n\n		if (empty($u2)) {\n			$out[\'s\'] = (ckEx(\'section\',$u1)) ? $u1 : \'\';\n			$is_404 = empty($out[\'s\']);\n		}\n		else {\n\n			if (isset($u2)) {\n				$rs = lookupByTitleSection($u2,$u1);\n				$out[\'id\'] = @$rs[\'ID\'];\n				$out[\'s\'] = @$rs[\'Section\'];\n			}\n\n			if (empty($out[\'id\']) && isset($u3)) {\n				$rs = lookupByTitleSection($u3,$u1);\n				if (empty($rs[\'ID\'])) {\n					$out[\'pg\'] = $u3;\n				} else {\n					$out[\'id\'] = @$rs[\'ID\'];\n					$out[\'s\'] = @$rs[\'Section\'];\n					$out[\'c\'] = (ckEx(\'category\',$u2)) ? $u2 : \'\';\n				}\n			}\n\n			if (empty($out[\'id\'])) {\n				$out[\'c\'] = (ckEx(\'category\',$u2)) ? $u2 : \'\';\n				$out[\'s\'] = (ckEx(\'section\',$u1)) ? $u1 : \'\';\n			} else {\n				$is_404 = (empty($out[\'s\']) or empty($out[\'id\']));\n			}\n		}\n	}\n\n}\n\n	//-------------------------------------------------------------\n\n	function rss_unlimited_categories_filedunder($atts) {\n			global $thisarticle;\n			extract(lAtts(array(\n				\'limit\'     => 999,\n				\'linktosection\' => \'article\',\n				\'listwraptag\'  => \'\',\n				\'break\'    => \', \',\n				\'wraptag\'  => \'\',\n				\'label\'    => \'\',\n				\'labeltag\' => \'\',\n				\'class\'       => \'\',\n				\'breakclass\'  => \'\'\n			),$atts));\n\n			$cats = array();\n			$rsc = getRows(\"SELECT c.title, c.name FROM \".PFX.\"textpattern_category as tc LEFT JOIN  \".PFX.\"txp_category as c ON tc.category_id = c.id WHERE article_id=\".$thisarticle[\'thisid\']);\n			if ($rsc) {\n				foreach ($rsc as $a=>$b) {\n					$path = hu.urlencode($linktosection).\"/\".strtolower($b[\'name\']);\n					$cats[]=tag(htmlspecialchars($b[\'title\']),\'a\',\' href=\"\'.$path.\'\" title=\"\'.htmlspecialchars($b[\'title\']).\'\"\');\n				}\n			}\n			return doTag(doLabel($label, $labeltag).doWrap($cats, $wraptag, $break, $class, $breakclass), $listwraptag).n;\n		}\n\n	//-------------------------------------------------------------\n\n	function rss_unlimited_categories_list($atts) {\n			extract(lAtts(array(\n				\'limit\'     => 999,\n				\'parent\' => \'\',\n				\'showcount\' => 1,\n				\'linktosection\' => \'article\',\n				\'listwraptag\'  => \'\',\n				\'break\'    => \'li\',\n				\'wraptag\'  => \'ul\',\n				\'label\'    => \'\',\n				\'labeltag\' => \'\',\n				\'class\'       => \'\',\n				\'breakclass\'  => \'\'\n			),$atts));\n\n			$prnt = ($parent) ? \" WHERE parent = \'$parent\' \" : \"\";\n			$rsc = getRows(\"SELECT distinct c.id, c.name, c.title FROM \".PFX.\"textpattern_category as tc LEFT JOIN  \".PFX.\"txp_category as c ON tc.category_id = c.id \".$prnt.\"ORDER BY c.name\");\n\n			if ($rsc) {\n				$row = array();\n				foreach ($rsc as $a=>$b) {\n						$aq= \"SELECT *, unix_timestamp(Posted) as uPosted FROM \".PFX.\"textpattern as t LEFT JOIN \".PFX.\"textpattern_category as c ON t.ID = c.article_id WHERE c.category_id = \'\".$b[\'id\'].\"\' and t.Status = 4 and t.Posted <=now() ORDER BY t.title\";//\"\n						$rsa = getRows($aq);\n						if ($rsa) {\n							$path = hu.$linktosection.\"/\".strtolower($b[\'name\']);\n							$count = ($showcount) ? \" (\".count($rsa).\") \" : \"\";\n							$row[]=tag(htmlspecialchars($b[\'title\'].$count),\'a\',\' href=\"\'.$path.\'\" title=\"\'.htmlspecialchars($b[\'title\']).\'\"\');\n						}\n				}\n        return doTag(doLabel($label, $labeltag).doWrap($row, $wraptag, $break, $class, $breakclass), $listwraptag).n;\n			}\n			return \'\';\n		}\n\n	//-------------------------------------------------------------\n\n	// Cloud calculations from Ran Aroussi\'\'s txp_tags plugin\n	function rss_unlimited_categories_cloud($atts) {\n			extract(lAtts(array(\n				\'limit\'     => 999,\n				\'parent\' => \'\',\n				\'linktosection\' => \'article\',\n				\'cloudwraptag\'  => \'div\',\n				\'break\'    => \', \',\n				\'wraptag\'  => \'p\',\n				\'label\'    => \'\',\n				\'labeltag\' => \'\',\n				\'class\'       => \'\',\n				\'breakclass\'  => \'\'\n			),$atts));\n\n			$prnt = ($parent) ? \" WHERE parent = \'$parent\' \" : \"\";\n			$rsc = getRows(\"SELECT distinct c.id, c.name, c.title FROM \".PFX.\"textpattern_category as tc LEFT JOIN  \".PFX.\"txp_category as c ON tc.category_id = c.id \".$prnt.\"ORDER BY c.name\");\n\n			if ($rsc) {\n\n				$rst = getRows(\"SELECT * FROM \".PFX.\"textpattern_category\");\n				$all = count($rst);\n\n				$allcats=\"\";\n				foreach($rst as $a) {\n					$allcats.=  $a[\'category_id\'].\" \";\n				}\n				$catarr = explode(\" \", $allcats);\n				$catcounts = array_count_values($catarr);\n				$max = max($catcounts);\n				$min = min($catcounts);\n				$x = 200; $y = 100; // 200%, 100%\n				$stepvalue = ($max - $min) / ($x - $y);\n\n				$row = array();\n				foreach ($rsc as $a=>$b) {\n						$aq= \"SELECT * FROM \".PFX.\"textpattern as t LEFT JOIN \".PFX.\"textpattern_category as c ON t.ID = c.article_id WHERE c.category_id = \'\".$b[\'id\'].\"\' and t.Status = 4 and t.Posted <=now()\";//\"\n						$rsa = getRows($aq);\n						if ($rsa) {\n							$num = count($rsa);\n							$size = (($num / $all) * 100) + 100;\n							$weight = $y + round(($num-$min) / $stepvalue);\n							$style = ($weight > $y) ? \' style=\"font-size:\'. $weight . \'%;\"\' : \'\';\n\n							$path = hu.$linktosection.\"/\".strtolower($b[\'name\']);\n							$row[]=tag(htmlspecialchars($b[\'title\']),\'a\',\' href=