-------------\n\n	function rss_unlimited_categories_article_list($atts) {\n			global $c;\n			extract(lAtts(array(\n				\'section\' => \'\',\n				\'category\' => $c,\n				\'form\' => \'default\',\n				\'limit\'     => 999,\n				\'offset\'    => 0\n			),$atts));\n\n		foreach (explode(\',\', $section) as $section) {\n			$sctsql[] = \" (section = \'\" . doSlash($section) . \"\') \";\n		}\n		$sections = \' AND (\' . join(\' OR \', $sctsql) . \') \';\n\n		foreach (explode(\',\', $category) as $category) {\n			if ($category) $catsql[] = \" cat.name = \'\" . urldecode($category) . \"\' \";\n		}\n		$categories= isset($catsql) ? \' (\' . join(\' OR \', $catsql) . \') \' : \"\";\n\n		$q = \"SELECT DISTINCT t.ID FROM \".PFX.\"textpattern as t LEFT JOIN \".PFX.\"textpattern_category as tc ON t.ID = tc.article_id LEFT JOIN \".PFX.\"txp_category as cat ON cat.id = tc.category_id WHERE\".$sections.\" \".$categories;\n		$rsc = getRows($q);\n\n		if ($rsc) {\n			foreach ($rsc as $a) {\n				extract($a);\n				$artsql[] = \" ID = \'\" . $ID . \"\' \";\n			}\n			$articles= isset($artsql) ? \' (\' . join(\' OR \', $artsql) . \') \' : \"\";\n\n			$total = safe_count(\'textpattern\',\"1=1 AND \" . $articles) - $offset;\n			$numPages = ceil($total/$limit);\n			$pg = (!$pg) ? 1 : $pg;\n			$pgoffset = $offset + (($pg - 1) * $limit).\', \';\n			// send paging info to txp:newer and txp:older\n			$pageout[\'pg\']       = $pg;\n			$pageout[\'numPages\'] = $numPages;\n			$pageout[\'s\']        = $s;\n			$pageout[\'c\']        = $c;\n			$pageout[\'total\']    = $total;\n\n			$GLOBALS[\'thispage\'] = $pageout;\n\n			$rs = safe_rows_start(\"*, unix_timestamp(Posted) as uPosted\", \"textpattern\", \"1=1 AND \" . $articles . \" \" .$pgoffset);\n\n			if ($rs) {\n				$articles = array();\n				while($a = nextRow($rs)) {\n					populateArticleData($a);\n					// define the article form\n					$article = fetch_form($form);\n\n					$articles[] = parse($article);\n					unset($GLOBALS[\'thisarticle\']);\n					unset($GLOBALS[\'theseatts\']);//Required?\n				}\n\n				return join(\'\',$articles);\n			}\n		}\n	}\n\n	//-------------------------------------------------------------\n\nfunction rss_admin_catlist($event, $step) {\n	extract(gpsa(array(\'view\',\'from_view\',\'step\')));\n	if (!$view) $view = \"text\";\n\n	$ID = rss_getID();\n	$rsc = safe_rows(\"category_id\", \"textpattern_category\", \"article_id=\".$ID);\n\n	$rs = getTree(\"root\",\'article\');\n	$mtsi = \"\";\n	if ($rs) {\n		$mtsi = rss_multiTreeSelectInput(\'Cats\',$rs,$rsc);\n	}\n\n	$catsel = ($view==\'text\') ?	graf(gTxt(\'categorize\'). \' [\'.eLink(\'category\',\'\',\'\',\'\',gTxt(\'edit\')).\']\'.br.$mtsi) :	\'\';\n	$js = <<<EOF\n\n<script language=\"javascript\" type=\"text/javascript\">\n<!--\n\nvar side = document.getElementById(\'articleside\');\nvar ps = side.getElementsByTagName(\'p\');\n\nvar p = document.createElement(\'p\');\np.innerHTML = \'$catsel\';\nps[1].appendChild(p);\n\n// -->\n</script>\n<noscript>\n<p></p>\n</noscript>\n\nEOF;\n\necho $js;\n\n}\n\n	//-------------------------------------------------------------\n\nfunction rss_getID() {\n	if(!empty($GLOBALS[\'ID\'])) { // newly-saved article\n		$ID = intval($GLOBALS[\'ID\']);\n		$step = \'edit\';\n	} else {\n		$ID = gps(\'ID\');\n	}\n	return $ID;\n}\n\n	//-------------------------------------------------------------\n\nfunction rss_admin_catlist_save($event, $step) {\n	$ID = rss_getID();\n	if (ps(\'Cats\')) {\n		$incats = ps(\'Cats\');\n		safe_delete(\"textpattern_category\",\"article_id=\'$ID\'\");\n		if (!empty($incats)) {\n			foreach($incats as $val ){\n				safe_insert(\"textpattern_category\",\n					\"category_id = \'$val\',\n					article_id=\'$ID\'\"\n				);\n			}\n		}\n	}\n}\n\n	//-------------------------------------------------------------\n\nfunction rss_admin_catlist_delete($event, $step) {\n	$deleted = event_multi_edit(\'textpattern_category\',\'article_id\');\n}\n\n	//-------------------------------------------------------------\n\n	function rss_multiTreeSelectInput($selectname=\"\", $array=\"\", $value=\"\")\n	{\n		$out[] = \'<select name=\"\'.$selectname.\'[]\" class=\"list\" size=\"5\" multiple>\';\n		foreach ($array as $a) {\n			extract($a);\n			if ($name==\'root\') continue;\n\n			$selected=\'\';\n			foreach ($value as $a=>$b) {\n				if ($id == $b[\'category_id\']) {\n					$selected = \' selected=\"selected\"\';\n					continue;\n				}\n			}\n\n			$name = htmlspecialchars($name);\n			$sp = ($level > 0) ? str_repeat(sp.sp,$level-1) : \'\';\n			$out[] = t.\'<option value=\"\'.$id.\'\"\'.$selected.\'>\'.$sp.$title.\'</option>\';\n		}\n		$out[] = \'</select>\';\n		return join(\'\',$out);\n}\n\n\n','c989b671e15bf6e2586573864cc19dd3',1);
INSERT INTO txp_plugin VALUES ('rss_admin_show_adv_opts',1,'Rob Sable','http://www.wilshireone.com/','0.1','Automatically expand article advanced options.','\n	<h1>Show Advanced Options</h1>\n\n	<p>This plugin will automatically expand the advanced options on the content -> write tab.</p>\n\n\n\n ','\nif (@txpinterface == \'admin\') {\n  // \'rss_show_adv_opts\' will be called to handle the \'article\' event\n  register_callback(\"rss_show_adv_opts\", \"article\");\n}\n\nfunction rss_show_adv_opts($event, $step) {\necho <<< EOF\n<script language=\"JavaScript\" type=\"text/javascript\">\n<!--\nfunction addLoadEvent(func) {\n  var oldonload = window.onload;\n  if (typeof window.onload != \'function\') {\n    window.onload = func;\n  } else {\n    window.onload = function() {\n      oldonload();\n      func();\n    }\n  }\n}\n\naddLoadEvent(function() {\n  toggleDisplay(\'advanced\');\n});\n-->\n</script>\nEOF;\n}','\nif (@txpinterface == \'admin\') {\n  // \'rss_show_adv_opts\' will be called to handle the \'article\' event\n  register_callback(\"rss_show_adv_opts\", \"article\");\n}\n\nfunction rss_show_adv_opts($event, $step) {\necho <<< EOF\n<script language=\"JavaScript\" type=\"text/javascript\">\n<!--\nfunction addLoadEvent(func) {\n  var oldonload = window.onload;\n  if (typeof window.onload != \'function\') {\n    window.onload = func;\n  } else {\n    window.onload = function() {\n      oldonload();\n      func();\n    }\n  }\n}\n\naddLoadEvent(function() {\n  toggleDisplay(\'advanced\');\n});\n-->\n</script>\nEOF;\n}','07b0c19640957e9f9e66fa71ea9e8e17',1);
INSERT INTO txp_plugin VALUES ('rss_live_search',0,'Rob Sable','http://www.wilshireone.com/','0.5','Live search.','\n	<h1>Textpattern Live Search</h1>\n\n	<p>This plugin is based on work done by:</p>\n\n	<ul>\n	<li>Markus Kniebes&#8217; <a href=\"http://kniebes.net/docs/textpattern/livesearch\">LiveSearch Extension for Textpattern</a></li>\n		<li><a href=\"http://blog4.bitflux.ch/wiki/LiveSearch\">BitFlux LiveSearch Solution</a></li>\n	</ul>\n\n	<h2>How to Use This Plugin</h2>\n\n	<ol>\n	<li>Install and activate the plugin of course.</li>\n		<li>Add a call to <code>&lt;txp:rss_live_search_js /&gt;</code> in the <code>&lt;head&gt;</code> section of your page.</li>\n		<li>Add a call to <code>&lt;txp:rss_live_search /&gt;</code> wherever you want the search form to appear.  Add any of the optional attributes below.</li>\n		<li>Include the <a href=\"#searchstyle\">styles below</a> in your stylesheet.  Feel free to modify the styles as you see fit.</li>\n	</ol>\n\n	<h2>Attributes</h2>\n\n	<p><strong>max</strong><br />\nThe maximum number of live search results returned.<br />\nDefault:  &#8220;20&#8221;<br />\nExample: max=&#8221;10&#8221;</p>\n\n	<p><strong>label</strong><br />\nThe label that appears next to the search input.<br />\nDefault:  &#8220;LiveSearch: &#8221;<br />\nExample: label=&#8221;Type To Search: &#8221;</p>\n\n	<p><strong>inputvalue</strong><br />\nThe text that appears in the search input field by default.<br />\nDefault:  &#8220;&#8221;<br />\nExample: inputvalue=&#8221;search the archives&#8221;</p>\n\n	<p><strong>inputsize</strong><br />\nThe size of the search input field.<br />\nDefault:  &#8220;20&#8221;<br />\nExample: inputsize=&#8221;30&#8221;</p>\n\n	<p><strong>showbutton</strong><br />\nDetermines whether a submit button appears on the live search form.<br />\nDefault:  &#8220;0&#8221;<br />\nExample: showbutton=&#8221;1&#8221;</p>\n\n	<p><strong>buttonval</strong><br />\nThe text that appears on the search form submit button.<br />\nDefault:  &#8220;Submit&#8221;<br />\nExample: buttonval=&#8221;Go!&#8221;</p>\n\n	<p><strong>searchto</strong><br />\nBy default the search form action will be your site home URL.  If you want to post your form to a subdirectory, indicate so here.  In the example below, the search would be posted to http://yoursite.com/search/?q=search+terms<br />\nDefault:  &#8220;&#8221;<br />\nExample: searchto=&#8221;search&#8221;</p>\n\n	<p><strong>autocompleteoff</strong><br />\nAdds autocmplete=&#8221;off&#8221; to the search input field.  <strong>NOTE:</strong> This will not validate against the XHTML spec.<br />\nDefault:  &#8220;0&#8221;<br />\nExample: autocompleteoff=&#8221;1&#8221;</p>\n\n	<p><strong>form</strong><br />\nThe article form used to display search results.  Each search result will be rendered using the form and place inside a div as below.<br />\n<code>&lt;div class=\"LSRow\"&gt;</code>FORM CONTENT<code>&lt;/div&gt;</code><br />\nDefault:  &#8220;&#8221;<br />\nExample: form=&#8221;live_search_article&#8221;</p>\n\n	<p><strong>showsection</strong><br />\nThe article section will be displayed in a span following the article title.<br />\nDefault:  &#8220;0&#8221;<br />\nExample: showsection=&#8221;1&#8221;</p>\n\n	<p><strong>showdate</strong><br />\nThe article post date will be displayed in a span following the article title (or date if applicable).<br />\nDefault:  &#8220;0&#8221;<br />\nExample: showdate=&#8221;1&#8221;</p>\n\n	<p><strong>excerpts</strong><br />\nDetermines whether search results excerpts below article titles as on a normal Textpattern search.<br />\nDefault:  &#8220;0&#8221;<br />\nExample: excerpts=&#8221;1&#8221;</p>\n\n	<p><strong>notfound</strong><br />\nThe message displayed when no search results are found.<br />\nDefault:  &#8220;No Results Found.&#8221;<br />\nExample: notfound=&#8221;Nothing to see here.&#8221;</p>\n\n	<h2 id=\"searchstyle\">Example Styles</h2>\n\n<code>\n	<p>#LSResult  { position: absolute; background-color: #fff; width: 350px; }</p>\n	<p>#LSShadow { padding: 5px; }</p>\n	<p>#LSRes { background-color: #fff; }<br />\n.LSRow { padding: 0 5px; }</p>\n	<p>#LSHighlight  { background-color: #aaa; }</p>\n	<p>#LSHeader { padding: 2px 2px 8px; }<br />\n.lsDate { display: block; color: #555; }<br />\n</code></p>\n\n\n\n ','\n/*\nrss_live_search plugin for Textpattern\n    <URL: http://www.wilshireone.com/textpattern-plugins/rss-live-search>\nbased on LiveSearch Extension for Textpattern, Markus Kniebes\n		<URL: mailto:mk@kniebes.net>\nbased on BitFlux LiveSearch Solution\n		<URL: http://blog4.bitflux.ch/wiki/LiveSearch>\n*/\n\nfunction rss_live_search_js() {\n	return \'<script type=\"text/javascript\" src=\"\'.hu.\'?file=livesearch\"></script>\';\n}\n\nfunction rss_live_search($atts) {\n\n  extract(lAtts(array(\n    \'max\'        => 20,\n    \'excerpts\' => \'0\',\n    \'label\' => \'LiveSearch: \',\n    \'notfound\' => \'No Results Found.\',\n    \'searchto\' => \'\',\n    \'autocompleteoff\' => \'0\',\n    \'showsection\' => \'0\',\n    \'showdate\' => \'0\',\n    \'form\' => \'\',\n    \'inputvalue\' => \'\',\n    \'inputsize\' => \'20\',\n    \'showbutton\' => \'0\',\n    \'buttonval\' => \'Submit\'\n  ),$atts));\n\n	if (trim(gps(\'ls\')) != \"\") {\n		global $prefs;\n		extract($prefs);\n		$q = gps(\'ls\');\n\n		$s_filter = \"\";\n		$rs = safe_column(\"name\", \"txp_section\", \"searchable != \'1\'\");\n		if ($rs) {\n			foreach($rs as $name) $filters[] = \"and Section != \'$name\'\";\n			$s_filter =  join(\' \',$filters);\n		}\n\n		ob_start();\n		header( \"Content-Type: text/xml\" );\n		print \'<?xml version=\\\'1.0\\\' encoding=\\\'utf-8\\\'  ?>\';\n\n		$where = \"(Title rlike \'$q\' or Body rlike \'$q\') $s_filter and Status = 4 and Posted <=now() order by score desc limit $max\";\n\n		$rs = safe_rows(\"*, unix_timestamp(Posted) as uPosted, match (Title,Body) against (\'$q\') as score\", \"textpattern\", $where);\n		$result_rows = count($rs);\n\n		if ($form) {\n			if ($rs) {\n				$o = array();\n				$o[] = \'<div id=\"LSRes\">\';\n				foreach($rs as $a) {\n					extract($a);\n					populateArticleData($a);\n					$article = fetch(\'Form\', \'txp_form\', \'name\', $form);\n					$o[] = \'<div class=\"LSRow\">\'.parse($article).\'</div>\';\n					unset($GLOBALS[\'thisarticle\']);\n				}\n				$o[] = \'</div>\';\n			} else {\n			$o[] = $notfound;\n			}\n			print (is_array($o)) ? implode( \"\", $o ) : \'\';\n			exit;\n		}\n\n		if( $rs ) {\n				$o = array();\n				$o[] = \'<div id=\"LSRes\">\';\n				foreach($rs as $a) {\n						extract($a);\n						populateArticleData($a);\n						$hurl = permlinkurl($a);\n\n						if( $excerpts ) {\n								$result = preg_replace(\"/>\\s*</\",\"> <\",$Body_html);\n								preg_match_all(\"/\\s.{0,50}\".$q.\".{0,50}\\s/i\",$result,$concat);\n								$concat = implode(\" ... \",$concat[0]);\n								$concat = strip_tags($concat);\n								$concat = preg_replace(\'/^[^>]+>/U\',\"\",$concat);\n								$concat = preg_replace(\"/($q)/i\",\"<strong>$1</strong>\",$concat);\n								$result_excerpt = ($concat) ? \"... \".$concat.\" ...\" : \'\';\n								$Title = \'<strong>\'.$Title.\'</strong>\';\n						}\n						$sd = ($showsection) ? \'<span class=\"lsSection\">\'.$Section.\'</span>\' : \'\';\n						$sd.= ($showdate) ? \'<span class=\"lsDate\">\'.strftime($archive_dateformat,$uPosted).\'</span>\' : \'\';\n						$o[] = \'<div class=\"LSRow\"><a href=\"\'.$hurl.\'\">\'.$Title.\'</a>\'.$sd.\'</div>\';\n						if( $excerpts ) {\n								$o[] = \'<br />\';\n								$o[] = $result_excerpt;\n						}\n				}\n				$o[] = \'</div>\';\n		} else {\n			$o[] = $notfound;\n		}\n		print (is_array($o)) ? implode( \"\", $o ) : \'\';\n		exit;\n	}\n\n	$ac = ($autocompleteoff) ? \'autocomplete=\"off\" \' : \'\';\n\n	if ($inputvalue != \"\") {\n		$input = \'\n		<input id=\"livesearch\" name=\"q\" value=\"\'.$inputvalue.\'\" onkeypress=\"liveSearchStart()\"\n		size=\"\'.$inputsize.\'\" onblur=\"if (this.value == \\\'\\\') {this.value = \\\'\'.$inputvalue.\'\\\';}\"\n		onfocus=\"if (this.value == \\\'\'.$inputvalue.\'\\\') {this.value = \\\'\\\';}\" \'.$ac.\' />\';\n	} else {\n		$input = \'<input id=\"livesearch\" name=\"q\" onkeypress=\"liveSearchStart()\" size=\"\'.$inputsize.\'\" \'.$ac.\' />\';\n	}\n\n	$sbtn = ($showbutton) ? \'<input type=\"submit\" id=\"livesearchsubmit\" value=\"\'.$buttonval.\'\" />\' : \'\';\n\n	return \'<form id=\"searchform\" method=\"get\" action=\"\'.hu.$searchto.\'\" onsubmit=\"return liveSearchSubmit()\">\n					<fieldset>\n					<label>\'.$label.$input.\'</label>\'.$sbtn.\'<br/>\n					</fieldset>\n					<div id=\"LSResult\" style=\"display: none;\"><div id=\"LSShadow\"></div></div>\n				</form>\';\n}\n\nif (gps(\'file\') == \'livesearch\') {\nglobal $pfr;\necho <<<EOF\n/*\n// +----------------------------------------------------------------------+\n// | Copyright (c) 2004 Bitflux GmbH                                      |\n// +----------------------------------------------------------------------+\n// | Licensed under the Apache License, Version 2.0 (the \"License\");      |\n// | you may not use this file except in compliance with the License.     |\n// | You may obtain a copy of the License at                              |\n// | http://www.apache.org/licenses/LICENSE-2.0                           |\n// | Unless required by applicable law or agreed to in writing, software  |\n// | distributed under the License is distributed on an \"AS IS\" BASIS,    |\n// | WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or      |\n// | implied. See the License for the specific language governing         |\n// | permissions and limitations under the License.                       |\n// +----------------------------------------------------------------------+\n// | Author: Bitflux GmbH <devel@bitflux.ch>                              |\n// +----------------------------------------------------------------------+\n*/\nvar liveSearchReq = false;\nvar t = null;\nvar liveSearchLast = \"\";\nvar isIE = false;\n// on !IE we only have to initialize it once\nif (window.XMLHttpRequest) {\n	liveSearchReq = new XMLHttpRequest();\n	newMastheadReq = new XMLHttpRequest();\n}\nfunction liveSearchInit() {\n\n	// Turns off autocomplete on the input element\n	var searchInput = document.getElementById(\'livesearch\');\n	if( searchInput == null ) return;\n	searchInput.setAttribute(\'autocomplete\', \'off\');\n\n	if (navigator.userAgent.indexOf(\"Safari\") > 0) {\n		document.getElementById(\'livesearch\').addEventListener(\"keydown\",liveSearchKeyPress,false);\n	} else if (navigator.product == \"Gecko\") {\n		document.getElementById(\'livesearch\').addEventListener(\"keypress\",liveSearchKeyPress,false);\n	} else {\n		document.getElementById(\'livesearch\').attachEvent(\'onkeydown\',liveSearchKeyPress);\n		isIE = true;\n	}\n}\nfunction liveSearchKeyPress(event) {\n	if (event.keyCode == 40 )\n	//KEY DOWN\n	{\n		highlight = document.getElementById(\"LSHighlight\");\n		if (!highlight) {\n			try {\n			highlight = document.getElementById(\"LSRes\").firstChild;\n			} catch (exception) { }\n		} else {\n			highlight.removeAttribute(\"id\");\n			highlight = highlight.nextSibling;\n		}\n		if (highlight) {\n			highlight.setAttribute(\"id\",\"LSHighlight\");\n		}\n		if (!isIE) { event.preventDefault(); }\n	}\n	//KEY UP\n	else if (event.keyCode == 38 ) {\n		highlight = document.getElementById(\"LSHighlight\");\n		if (!highlight) {\n			try {\n			highlight = document.getElementById(\"LSRes\").lastChild;\n			} catch (exception) {}\n		}\n		else {\n			highlight.removeAttribute(\"id\");\n			highlight = highlight.previousSibling;\n		}\n		if (highlight) {\n				highlight.setAttribute(\"id\",\"LSHighlight\");\n		}\n		if (!isIE) { event.preventDefault(); }\n	}\n	//ESC\n	else if (event.keyCode == 27) {\n		highlight = document.getElementById(\"LSHighlight\");\n		if (highlight) {\n			highlight.removeAttribute(\"id\");\n		}\n		document.getElementById(\"LSResult\").style.display = \"none\";\n		document.forms.searchform.q.value = \'\';\n	}\n	//ENTER\n	else if (event.keyCode == 13) {\n		liveSearchSubmit();\n	}\n\n}\nfunction closeLiveSearch() {\n	highlight = document.getElementById(\"LSHighlight\");\n	if (highlight) {\n		highlight.removeAttribute(\"id\");\n	}\n	document.getElementById(\"LSResult\").style.display = \"none\";\n	document.forms.searchform.q.value = \'\';\n}\nfunction liveSearchStart() {\n	if (t) { window.clearTimeout(t); }\n	t = window.setTimeout(\"liveSearchDoSearch()\",200);\n}\nfunction liveSearchDoSearch() {\n	if (liveSearchLast != document.forms.searchform.q.value) {\n	if (liveSearchReq && liveSearchReq.readyState < 4) {\n		liveSearchReq.abort();\n	}\n	if ( searchTrimAll(document.forms.searchform.q.value) == \"\") {\n		document.getElementById(\"LSResult\").style.display = \"none\";\n		highlight = document.getElementById(\"LSHighlight\");\n		if (highlight) {\n			highlight.removeAttribute(\"id\");\n		}\n		return false;\n	}\n	if (window.XMLHttpRequest) {\n	// branch for IE/Windows ActiveX version\n	} else if (window.ActiveXObject) {\n		liveSearchReq = new ActiveXObject(\"Microsoft.XMLHTTP\");\n	}\n	liveSearchReq.onreadystatechange= liveSearchProcessReqChange;\n	liveSearchReq.open(\"GET\", \"\nEOF;\n\necho $pfr;\n\necho <<<EOF\n?ls=\" + document.forms.searchform.q.value);\n	liveSearchLast = document.forms.searchform.q.value;\n	liveSearchReq.send(null);\n	}\n}\nfunction liveSearchProcessReqChange() {\n	if (liveSearchReq.readyState == 4) {\n		var res = document.getElementById(\"LSResult\");\n		res.style.display = \"block\";\n		res.firstChild.innerHTML = \'<div id=\"LSHeader\"><div style=\"float:left;\">use arrow keys &amp; enter</div><div style=\"float:right;\"><a href=\"javascript://\" title=\"Close results\" onclick=\"closeLiveSearch()\">close (esc)</a></div><br /></div>\'+liveSearchReq.responseText;//;\n	}\n}\nfunction liveSearchSubmit() {\n	var highlight = document.getElementById(\"LSHighlight\");\n	if (highlight && highlight.firstChild) {\n		window.location = highlight.firstChild.getAttribute(\"href\");\n		return false;\n	} else {\n		var searchInput = document.getElementById(\'searchform\');\n	  searchInput.submit();\n		return false;\n	}\n}\n\nfunction liveSearchByContext(thelink,theText) {\nvar searchTerm = theText;\n	if (liveSearchLast != searchTerm) {\n	if (liveSearchReq && liveSearchReq.readyState < 4) {\n		liveSearchReq.abort();\n	}\n\n	if (window.XMLHttpRequest) {\n	// branch for IE/Windows ActiveX version\n	} else if (window.ActiveXObject) {\n		liveSearchReq = new ActiveXObject(\"Microsoft.XMLHTTP\");\n	}\n	liveSearchReq.onreadystatechange=function() {\n	if (liveSearchReq.readyState == 4) {\n		var newDiv = document.createElement(\'div\');\n		newDiv.id = \'liveLinkRes\';\n		newDiv.style.display = \'none\';\n		newDiv.innerHTML = \'<div id=\"liveLinkHead\"><div style=\"float:left;\">&nbsp;</div><div style=\"float:right;\"><a href=\"javascript://\" title=\"Close results\" onclick=\"closeLiveLink()\">[x]</a></div><br /></div>\'+liveSearchReq.responseText;//;\n		newDiv.style.display = \'block\';\n\n		myRes=document.getElementById(theText+\"-livelink\");\n		myRes.appendChild(newDiv);\n		myBlank=document.createTextNode(\"\");\n		myRes.insertBefore(myBlank,newDiv);\n	}\n }\n	liveSearchReq.open(\"GET\", \"\nEOF;\n\necho $pfr;\n\necho <<<EOF\n?ls=\" + searchTerm);\n	liveSearchLast = searchTerm;\n	liveSearchReq.send(null);\n	} else {\n		closeLiveLink();\n	}\n}\n\nfunction searchTrimAll(sString) {\n	while (sString.substring(0,1) == \' \') {\n		sString = sString.substring(1, sString.length);\n	}\n	while (sString.substring(sString.length-1, sString.length) == \' \') {\n		sString = sString.substring(0,sString.length-1);\n	}\n	return sString;\n}\n\nfunction closeLiveLink() {\n	liveSearchLast = \"\";\n	highlight = document.getElementById(\"LSHighlight\");\n	if (highlight) {\n		highlight.removeAttribute(\"id\");\n	}\n	document.getElementById(\"liveLinkRes\").style.display = \"none\";\n}\n\nfunction addLoadEvent(func) {\n  var oldonload = window.onload;\n  if (typeof window.onload != \'function\') {\n    window.onload = func;\n  } else {\n    window.onload = function() {\n      oldonload();\n      func();\n    }\n  }\n}\n\naddLoadEvent(function() {\n  liveSearchInit();\n});\nEOF;\nexit;\n}\n\nfunction rss_livelink($atts, $thing) {\n	return tag(tag($thing,\'a\',\' href=\"javascript://\" onclick=\"liveSearchByContext(this,\\\'\'.$thing.\'\\\');return false;\" title=\"LiveLink Search\"\'), \'span\', \' id=\"\'.$thing.\'-livelink\"\');\n}\n\n//<span id=\"Mint-livelink\"><a href=\"javascript://\" onclick=\"liveSearchByContext(this,\'Mint\');return false;\">Mint</a></span>\n','\n/*\nrss_live_search plugin for Textpattern\n    <URL: http://www.wilshireone.com/textpattern-plugins/rss-live-search>\nbased on LiveSearch Extension for Textpattern, Markus Kniebes\n		<URL: mailto:mk@kniebes.net>\nbased on BitFlux LiveSearch Solution\n		<URL: http://blog4.bitflux.ch/wiki/LiveSearch>\n*/\n\nfunction rss_live_search_js() {\n	return \'<script type=\"text/javascript\" src=\"\'.hu.\'?file=livesearch\"></script>\';\n}\n\nfunction rss_live_search($atts) {\n\n  extract(lAtts(array(\n    \'max\'        => 20,\n    \'excerpts\' => \'0\',\n    \'label\' => \'LiveSearch: \',\n    \'notfound\' => \'No Results Found.\',\n    \'searchto\' => \'\',\n    \'autocompleteoff\' => \'0\',\n    \'showsection\' => \'0\',\n    \'showdate\' => \'0\',\n    \'form\' => \'\',\n    \'inputvalue\' => \'\',\n    \'inputsize\' => \'20\',\n    \'showbutton\' => \'0\',\n    \'buttonval\' => \'Submit\'\n  ),$atts));\n\n	if (trim(gps(\'ls\')) != \"\") {\n		global $prefs;\n		extract($prefs);\n		$q = gps(\'ls\');\n\n		$s_filter = \"\";\n		$rs = safe_column(\"name\", \"txp_section\", \"searchable != \'1\'\");\n		if ($rs) {\n			foreach($rs as $name) $filters[] = \"and Section != \'$name\'\";\n			$s_filter =  join(\' \',$filters);\n		}\n\n		ob_start();\n		header( \"Content-Type: text/xml\" );\n		print \'<?xml version=\\\'1.0\\\' encoding=\\\'utf-8\\\'  ?>\';\n\n		$where = \"(Title rlike \'$q\' or Body rlike \'$q\') $s_filter and Status = 4 and Posted <=now() order by score desc limit $max\";\n\n		$rs = safe_rows(\"*, unix_timestamp(Posted) as uPosted, match (Title,Body) against (\'$q\') as score\", \"textpattern\", $where);\n		$result_rows = count($rs);\n\n		if ($form) {\n			if ($rs) {\n				$o = array();\n				$o[] = \'<div id=\"LSRes\">\';\n				foreach($rs as $a) {\n					extract($a);\n					populateArticleData($a);\n					$article = fetch(\'Form\', \'txp_form\', \'name\', $form);\n					$o[] = \'<div class=\"LSRow\">\'.parse($article).\'</div>\';\n					unset($GLOBALS[\'thisarticle\']);\n				}\n				$o[] = \'</div>\';\n			} else {\n			$o[] = $notfound;\n			}\n			print (is_array($o)) ? implode( \"\", $o ) : \'\';\n			exit;\n		}\n\n		if( $rs ) {\n				$o = array();\n				$o[] = \'<div id=\"LSRes\">\';\n				foreach($rs as $a) {\n						extract($a);\n						populateArticleData($a);\n						$hurl = permlinkurl($a);\n\n						if( $excerpts ) {\n								$result = preg_replace(\"/>\\s*</\",\"> <\",$Body_html);\n								preg_match_all(\"/\\s.{0,50}\".$q.\".{0,50}\\s/i\",$result,$concat);\n								$concat = implode(\" ... \",$concat[0]);\n								$concat = strip_tags($concat);\n								$concat = preg_replace(\'/^[^>]+>/U\',\"\",$concat);\n								$concat = preg_replace(\"/($q)/i\",\"<strong>$1</strong>\",$concat);\n								$result_excerpt = ($concat) ? \"... \".$concat.\" ...\" : \'\';\n								$Title = \'<strong>\'.$Title.\'</strong>\';\n						}\n						$sd = ($showsection) ? \'<span class=\"lsSection\">\'.$Section.\'</span>\' : \'\';\n						$sd.= ($showdate) ? \'<span class=\"lsDate\">\'.strftime($archive_dateformat,$uPosted).\'</span>\' : \'\';\n						$o[] = \'<div class=\"LSRow\"><a href=\"\'.$hurl.\'\">\'.$Title.\'</a>\'.$sd.\'</div>\';\n						if( $excerpts ) {\n								$o[] = \'<br />\';\n								$o[] = $result_excerpt;\n						}\n				}\n				$o[] = \'</div>\';\n		} else {\n			$o[] = $notfound;\n		}\n		print (is_array($o)) ? implode( \"\", $o ) : \'\';\n		exit;\n	}\n\n	$ac = ($autocompleteoff) ? \'autocomplete=\"off\" \' : \'\';\n\n	if ($inputvalue != \"\") {\n		$input = \'\n		<input id=\"livesearch\" name=\"q\" value=\"\'.$inputvalue.\'\" onkeypress=\"liveSearchStart()\"\n		size=\"\'.$inputsize.\'\" onblur=\"if (this.value == \\\'\\\') {this.value = \\\'\'.$inputvalue.\'\\\';}\"\n		onfocus=\"if (this.value == \\\'\'.$inputvalue.\'\\\') {this.value = \\\'\\\';}\" \'.$ac.\' />\';\n	} else {\n		$input = \'<input id=\"livesearch\" name=\"q\" onkeypress=\"liveSearchStart()\" size=\"\'.$inputsize.\'\" \'.$ac.\' />\';\n	}\n\n	$sbtn = ($showbutton) ? \'<input type=\"submit\" id=\"livesearchsubmit\" value=\"\'.$buttonval.\'\" />\' : \'\';\n\n	return \'<form id=\"searchform\" method=\"get\" action=\"\'.hu.$searchto.\'\" onsubmit=\"return liveSearchSubmit()\">\n					<fieldset>\n					<label>\'.$label.$input.\'</label>\'.$sbtn.\'<br/>\n					</fieldset>\n					<div id=\"LSResult\" style=\"display: none;\"><div id=\"LSShadow\"></div></div>\n				</form>\';\n}\n\nif (gps(\'file\') == \'livesearch\') {\nglobal $pfr;\necho <<<EOF\n/*\n// +----------------------------------------------------------------------+\n// | Copyright (c) 2004 Bitflux GmbH                                      |\n// +----------------------------------------------------------------------+\n// | Licensed under the Apache License, Version 2.0 (the \"License\");      |\n// | you may not use this file except in compliance with the License.     |\n// | You may obtain a copy of the License at                              |\n// | http://www.apache.org/licenses/LICENSE-2.0                           |\n// | Unless required by applicable law or agreed to in writing, software  |\n// | distributed under the License is distributed on an \"AS IS\" BASIS,    |\n// | WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or      |\n// | implied. See the License for the specific language governing         |\n// | permissions and limitations under the License.                       |\n// +----------------------------------------------------------------------+\n// | Author: Bitflux GmbH <devel@bitflux.ch>                              |\n// +----------------------------------------------------------------------+\n*/\nvar liveSearchReq = false;\nvar t = null;\nvar liveSearchLast = \"\";\nvar isIE = false;\n// on !IE we only have to initialize it once\nif (window.XMLHttpRequest) {\n	liveSearchReq = new XMLHttpRequest();\n	newMastheadReq = new XMLHttpRequest();\n}\nfunction liveSearchInit() {\n\n	// Turns off autocomplete on the input element\n	var searchInput = document.getElementById(\'livesearch\');\n	if( searchInput == null ) return;\n	searchInput.setAttribute(\'autocomplete\', \'off\');\n\n	if (navigator.userAgent.indexOf(\"Safari\") > 0) {\n		document.getElementById(\'livesearch\').addEventListener(\"keydown\",liveSearchKeyPress,false);\n	} else if (navigator.product == \"Gecko\") {\n		document.getElementById(\'livesearch\').addEventListener(\"keypress\",liveSearchKeyPress,false);\n	} else {\n		document.getElementById(\'livesearch\').attachEvent(\'onkeydown\',liveSearchKeyPress);\n		isIE = true;\n	}\n}\nfunction liveSearchKeyPress(event) {\n	if (event.keyCode == 40 )\n	//KEY DOWN\n	{\n		highlight = document.getElementById(\"LSHighlight\");\n		if (!highlight) {\n			try {\n			highlight = document.getElementById(\"LSRes\").firstChild;\n			} catch (exception) { }\n		} else {\n			highlight.removeAttribute(\"id\");\n			highlight = highlight.nextSibling;\n		}\n		if (highlight) {\n			highlight.setAttribute(\"id\",\"LSHighlight\");\n		}\n		if (!isIE) { event.preventDefault(); }\n	}\n	//KEY UP\n	else if (event.keyCode == 38 ) {\n		highlight = document.getElementById(\"LSHighlight\");\n		if (!highlight) {\n			try {\n			highlight = document.getElementById(\"LSRes\").lastChild;\n			} catch (exception) {}\n		}\n		else {\n			highlight.removeAttribute(\"id\");\n			highlight = highlight.previousSibling;\n		}\n		if (highlight) {\n				highlight.setAttribute(\"id\",\"LSHighlight\");\n		}\n		if (!isIE) { event.preventDefault(); }\n	}\n	//ESC\n	else if (event.keyCode == 27) {\n		highlight = document.getElementById(\"LSHighlight\");\n		if (highlight) {\n			highlight.removeAttribute(\"id\");\n		}\n		document.getElementById(\"LSResult\").style.display = \"none\";\n		document.forms.searchform.q.value = \'\';\n	}\n	//ENTER\n	else if (event.keyCode == 13) {\n		liveSearchSubmit();\n	}\n\n}\nfunction closeLiveSearch() {\n	highlight = document.getElementById(\"LSHighlight\");\n	if (highlight) {\n		highlight.removeAttribute(\"id\");\n	}\n	document.getElementById(\"LSResult\").style.display = \"none\";\n	document.forms.searchform.q.value = \'\';\n}\nfunction liveSearchStart() {\n	if (t) { window.clearTimeout(t); }\n	t = window.setTimeout(\"liveSearchDoSearch()\",200);\n}\nfunction liveSearchDoSearch() {\n	if (liveSearchLast != document.forms.searchform.q.value) {\n	if (liveSearchReq && liveSearchReq.readyState < 4) {\n		liveSearchReq.abort();\n	}\n	if ( searchTrimAll(document.forms.searchform.q.value) == \"\") {\n		document.getElementById(\"LSResult\").style.display = \"none\";\n		highlight = document.getElementById(\"LSHighlight\");\n		if (highlight) {\n			highlight.removeAttribute(\"id\");\n		}\n		return false;\n	}\n	if (window.XMLHttpRequest) {\n	// branch for IE/Windows ActiveX version\n	} else if (window.ActiveXObject) {\n		liveSearchReq = new ActiveXObject(\"Microsoft.XMLHTTP\");\n	}\n	liveSearchReq.onreadystatechange= liveSearchProcessReqChange;\n	liveSearchReq.open(\"GET\", \"\nEOF;\n\necho $pfr;\n\necho <<<EOF\n?ls=\" + document.forms.searchform.q.value);\n	liveSearchLast = document.forms.searchform.q.value;\n	liveSearchReq.send(null);\n	}\n}\nfunction liveSearchProcessReqChange() {\n	if (liveSearchReq.readyState == 4) {\n		var res = document.getElementById(\"LSResult\");\n		res.style.display = \"block\";\n		res.firstChild.innerHTML = \'<div id=\"LSHeader\"><div style=\"float:left;\">use arrow keys &amp; enter</div><div style=\"float:right;\"><a href=\"javascript://\" title=\"Close results\" onclick=\"closeLiveSearch()\">close (esc)</a></div><br /></div>\'+liveSearchReq.responseText;//;\n	}\n}\nfunction liveSearchSubmit() {\n	var highlight = document.getElementById(\"LSHighlight\");\n	if (highlight && highlight.firstChild) {\n		window.location = highlight.firstChild.getAttribute(\"href\");\n		return false;\n	} else {\n		var searchInput = document.getElementById(\'searchform\');\n	  searchInput.submit();\n		return false;\n	}\n}\n\nfunction liveSearchByContext(thelink,theText) {\nvar searchTerm = theText;\n	if (liveSearchLast != searchTerm) {\n	if (liveSearchReq && liveSearchReq.readyState < 4) {\n		liveSearchReq.abort();\n	}\n\n	if (window.XMLHttpRequest) {\n	// branch for IE/Windows ActiveX version\n	} else if (window.ActiveXObject) {\n		liveSearchReq = new ActiveXObject(\"Microsoft.XMLHTTP\");\n	}\n	liveSearchReq.onreadystatechange=function() {\n	if (liveSearchReq.readyState == 4) {\n		var newDiv = document.createElement(\'div\');\n		newDiv.id = \'liveLinkRes\';\n		newDiv.style.display = \'none\';\n		newDiv.innerHTML = \'<div id=\"liveLinkHead\"><div style=\"float:left;\">&nbsp;</div><div style=\"float:right;\"><a href=\"javascript://\" title=\"Close results\" onclick=\"closeLiveLink()\">[x]</a></div><br /></div>\'+liveSearchReq.responseText;//;\n		newDiv.style.display = \'block\';\n\n		myRes=document.getElementById(theText+\"-livelink\");\n		myRes.appendChild(newDiv);\n		myBlank=document.createTextNode(\"\");\n		myRes.insertBefore(myBlank,newDiv);\n	}\n }\n	liveSearchReq.open(\"GET\", \"\nEOF;\n\necho $pfr;\n\necho <<<EOF\n?ls=\" + searchTerm);\n	liveSearchLast = searchTerm;\n	liveSearchReq.send(null);\n	} else {\n		closeLiveLink();\n	}\n}\n\nfunction searchTrimAll(sString) {\n	while (sString.substring(0,1) == \' \') {\n		sString = sString.substring(1, sString.length);\n	}\n	while (sString.substring(sString.length-1, sString.length) == \' \') {\n		sString = sString.substring(0,sString.length-1);\n	}\n	return sString;\n}\n\nfunction closeLiveLink() {\n	liveSearchLast = \"\";\n	highlight = document.getElementById(\"LSHighlight\");\n	if (highlight) {\n		highlight.removeAttribute(\"id\");\n	}\n	document.getElementById(\"liveLinkRes\").style.display = \"none\";\n}\n\nfunction addLoadEvent(func) {\n  var oldonload = window.onload;\n  if (typeof window.onload != \'function\') {\n    window.onload = func;\n  } else {\n    window.onload = function() {\n      oldonload();\n      func();\n    }\n  }\n}\n\naddLoadEvent(function() {\n  liveSearchInit();\n});\nEOF;\nexit;\n}\n\nfunction rss_livelink($atts, $thing) {\n	return tag(tag($thing,\'a\',\' href=\"javascript://\" onclick=\"liveSearchByContext(this,\\\'\'.$thing.\'\\\');return false;\" title=\"LiveLink Search\"\'), \'span\', \' id=\"\'.$thing.\'-livelink\"\');\n}\n\n//<span id=\"Mint-livelink\"><a href=\"javascript://\" onclick=\"liveSearchByContext(this,\'Mint\');return false;\">Mint</a></span>\n','f516252be69d94939bdf90df9cd8948e',0);
INSERT INTO txp_plugin VALUES ('ajw_comment_alt',0,'Andrew Waer','http://compooter.org/','0.3','Alternates output based on even- or odd-numbered comments','\n	<h1>Summary</h1>\n\n	<p><strong>Requires 1.0RC3 (<em>rev 180+</em>)</strong></p>\n\n	<p>Alternates output based on even- or odd-numbered comments.   Intended usage is from within default comment form.</p>\n\n	<h2>Attributes</h2>\n\n	<h3>even  (<em>optional</em>)</h3>\n\n	<p>You may optionally use some other text to be output in the case of even.</p>\n\n	<h3>odd (<em>optional</em>)</h3>\n\n	<p>You may optionally use some other text to be output in the case of odd.</p>\n\n	<h2>Examples</h2>\n\n	<p>Ideally, this is meant to be used in your default comment form.  While it is possible to use this plugin with the default <code>&lt;ol&gt;</code> formatting of comments, you&#8217;ll be able to do much more fun things if you switch off numbered list formatting in <em>admin->preferences</em>.</p>\n\n	<h3>Ex. 1</h3>\n\n	<p style=\"padding: 10px; border: 1px solid #999; background: #eee; display: block; margin: 10px 0 0 0; text-indent: 0; text-align: left; color: #600;width:600px;\"><code>&lt;div class=\"&lt;txp:ajw_comment_alt /&gt;\"&gt;</code> <br />\n &nbsp;&nbsp; <code>...other comment form stuff...</code> <br />\n <code>&lt;/div&gt;</code></p>\n\n	<p style=\"padding: 10px; border: 1px solid #999; background: #eee; display: block; margin: 10px 0 0 0; text-indent: 0; text-align: left; color: #600;width:600px;\"><code>&lt;div class=\"odd\"&gt;</code> <br />\n &nbsp;&nbsp; <code>...other comment form stuff...</code> <br />\n <code>&lt;/div&gt;</code></p>\n\n	<h3>Ex. 2</h3>\n\n	<p style=\"padding: 10px; border: 1px solid #999; background: #eee; display: block; margin: 10px 0 0 0; text-indent: 0; text-align: left; color: #600;width:600px;\"><code>&lt;div class=\"&lt;txp:ajw_comment_alt even=\"foo\" odd=\"bar\" /&gt;\"&gt;</code> <br />\n &nbsp;&nbsp; <code>...other comment form stuff...</code> <br />\n <code>&lt;/div&gt;</code></p>\n\n	<p style=\"padding: 10px; border: 1px solid #999; background: #eee; display: block; margin: 10px 0 0 0; text-indent: 0; text-align: left; color: #600;width:600px;\"><code>&lt;div class=\"foo\"&gt;</code> <br />\n &nbsp;&nbsp; <code>...other comment form stuff...</code> <br />\n <code>&lt;/div&gt;</code> <br />\n <code>&lt;div class=\"bar\"&gt;</code> <br />\n &nbsp;&nbsp; <code>...your txp comment tags would go here...</code> <br />\n <code>&lt;/div&gt;</code></p>\n\n\n\n ','function ajw_comment_alt($atts)\r\n{\r\n	global $thiscomment, $ajw_commentalt, $ajw_lastcommentalt;\r\n	if (is_array($atts)) extract($atts);\r\n\r\n	$even = (empty($even)) ? \'even\' : $even;\r\n	$odd  = (empty($odd))  ? \'odd\'  : $odd;\r\n\r\n	$ajw_commentalt = (empty($ajw_commentalt)) ? 0 : $ajw_commentalt;\r\n	$ajw_lastcommentalt = (empty($ajw_lastcommentalt)) ? $thiscomment[\'discussid\'] : $ajw_lastcommentalt;\r\n\r\n	if ($ajw_lastcommentalt!=$thiscomment[\'discussid\'])\r\n		$ajw_commentalt++;\r\n\r\n	$ajw_lastcommentalt = $thiscomment[\'discussid\'];\r\n	return ($ajw_commentalt % 2 == 0) ? $even : $odd;\r\n}\r\n','\nfunction ajw_comment_alt($atts)\n{\n	global $thiscomment, $ajw_commentalt, $ajw_lastcommentalt;\n	if (is_array($atts)) extract($atts);\n\n	$even = (empty($even)) ? \'even\' : $even;\n	$odd  = (empty($odd))  ? \'odd\'  : $odd;\n\n	$ajw_commentalt = (empty($ajw_commentalt)) ? 0 : $ajw_commentalt;\n	$ajw_lastcommentalt = (empty($ajw_lastcommentalt)) ? $thiscomment[\'discussid\'] : $ajw_lastcommentalt;\n\n	if ($ajw_lastcommentalt!=$thiscomment[\'discussid\'])\n		$ajw_commentalt++;\n\n	$ajw_lastcommentalt = $thiscomment[\'discussid\'];\n	return ($ajw_commentalt % 2 == 0) ? $even : $odd;\n}\n','27a785dfe81c7576a13575cb63f4bb7b',0);
INSERT INTO txp_plugin VALUES ('ajw_comment_num',0,'Andrew Waer','http://compooter.org/','0.2','Allows for outputting current comment number','\n	<h1>Summary</h1>\n\n	<p>Allows for outputting current comment number.  Intended usage is from within default comment form.</p>\n\n	<h2>Requires:</h2>\n\n	<ul>\n	<li>1.0RC3 (rev 180 or greater)</li>\n		<li><strong>If you are using Textpattern 1.0RC3 rev142 thru rev179</strong>, you will need to perform a one-line edit of <code>/textpattern/publish/comment.php</code>, as outlined in <a href=\"http://forum.textpattern.com/viewtopic.php?id=6893#44347\">this Textpattern Forum thread</a> (<em>allows for plugin parsing in comments</em>)</li>\n	</ul>\n\n	<h2>Examples</h2>\n\n	<p>Ideally, this is meant to be used in your default comment form.  While it is possible to use this plugin with the default <code>&lt;ol&gt;</code> formatting of comments, you&#8217;ll be able to do much more fun things if you switch off numbered list formatting in <em>admin->preferences</em>.</p>\n\n	<p style=\"padding: 10px; border: 1px solid #999; background: #eee; display: block; margin: 10px 0 0 0; text-indent: 0; text-align: left; color: #600;width:600px;\"><code>&lt;div id=\"comment-&lt;txp:ajw_comment_num /&gt;\"&gt;</code> <br />\n <code>&lt;span class=\"comment-num\"&gt;&lt;txp:ajw_comment_num /&gt;&lt;/span&gt;</code> <br />\n&nbsp;&nbsp;... <code>other comment form stuff</code> ...<br />\n <code>&lt;/div&gt;</code></p>\n\n	<p>Result:</p>\n\n	<p style=\"padding: 10px; border: 1px solid #999; background: #eee; display: block; margin: 10px 0 0 0; text-indent: 0; text-align: left; color: #600;width:600px;\"><code>&lt;div id=\"comment-1\"&gt;</code> <br />\n <code>&lt;span class=\"comment-num\"&gt;1&lt;/span&gt;</code> <br />\n&nbsp;&nbsp;... <code>other comment form stuff</code> ...<br />\n <code>&lt;/div&gt;</code></p>\n\n\n\n\n ','\nfunction ajw_comment_num($atts)\n{\n	global $thiscomment, $ajw_commentnum, $ajw_lastcommentid;\n\n	$ajw_commentnum = (empty($ajw_commentnum)) ? 1 : $ajw_commentnum;\n	$ajw_lastcommentid = (empty($ajw_lastcommentid)) ? $thiscomment[\'discussid\'] : $ajw_lastcommentid;\n\n	if ($ajw_lastcommentid!=$thiscomment[\'discussid\'])\n		$ajw_commentnum++;\n\n	$ajw_lastcommentid = $thiscomment[\'discussid\'];\n	return $ajw_commentnum;\n}\n','\nfunction ajw_comment_num($atts)\n{\n	global $thiscomment, $ajw_commentnum, $ajw_lastcommentid;\n\n	$ajw_commentnum = (empty($ajw_commentnum)) ? 1 : $ajw_commentnum;\n	$ajw_lastcommentid = (empty($ajw_lastcommentid)) ? $thiscomment[\'discussid\'] : $ajw_lastcommentid;\n\n	if ($ajw_lastcommentid!=$thiscomment[\'discussid\'])\n		$ajw_commentnum++;\n\n	$ajw_lastcommentid = $thiscomment[\'discussid\'];\n	return $ajw_commentnum;\n}\n','007f8ac21acdf3403e9db4bd4c51d3e3',0);
INSERT INTO txp_plugin VALUES ('ajw_if_comment_owner',0,'Andrew Waer','http://compooter.org/','0.3','Allows checking one or multiple comment field values to \"verify\" an indentity','\n	<h1>Summary</h1>\n\n	<p>Conditional output based on comparing the name of the commenter with either a) the real name of article author or b) with a user-specified name (or comma-separated list of names).   Intended usage is from within default comment form.</p>\n\n	<h2>Requires:</h2>\n\n	<ol>\n	<li>1.0RC3 (rev 180 or greater)</li>\n		<li><strong>If you are using Textpattern 1.0RC3 rev142 thru rev179</strong>, you will need to perform a one-line edit of <code>/textpattern/publish/comment.php</code>, as outlined in <a href=\"http://forum.textpattern.com/viewtopic.php?id=6893#44347\">this Textpattern Forum thread</a> (<em>allows for plugin parsing in comments</em>)</li>\n	</ol>\n\n	<h2>Attributes</h2>\n\n	<h3>strict</h3>\n\n	<blockquote>\n		<p>Setting this value to \"1\" will allow for more strict checking of name/email/web combinations.  If strict mode is enabled, one item of each specified comment attribute must match.</p>\n	</blockquote>\n\n	<h3>name</h3>\n\n	<ul>\n	<li><code>name=\"Mr. T\"</code></li>\n		<li><code>name=\"Dean Allen, Mr. T\"</code></li>\n	</ul>\n\n	<h3>email</h3>\n\n	<ul>\n	<li><code>email=\"nobody@example.com\"</code></li>\n		<li><code>email=\"nobody@example.com,somebody@example.com\"</code></li>\n	</ul>\n\n	<h3>web</h3>\n\n	<ul>\n	<li><code>web=\"example.com\"</code></li>\n		<li><code>web=\"example.com,example.net\"</code></li>\n	</ul>\n\n	<h3><code>&lt;else /&gt;</code></h3>\n\n	<ul>\n	<li>(<em>optional</em>) Anything output below this point will be output in the event of a false/negative check</li>\n	</ul>\n\n	<h2>Examples</h2>\n\n	<p>Ideally, this is meant to be used in your default comment form.  While it is possible to use this plugin with the default <code>&lt;ol&gt;</code>  formatting of comments, you&#8217;ll be able to do much more fun things if you switch off numbered list formatting in <em>admin->preferences</em>.</p>\n\n <span style=\"line-height:18px;\">\n\n	<ul>\n	<li><code>name=\"foo\"</code>\n	<ul>\n	<li>Anyone named &#8220;foo&#8221;</li>\n	</ul>\n	</li>\n		<li><code>name=\"foo,bar\" email=\"foo@domain.com\"</code>\n	<ul>\n	<li>(foo OR bar) OR (foo@domain.com)</li>\n	</ul>\n	</li>\n		<li><code>name=\"foo,bar\" email=\"foo@domain.com\" strict=\"1\"</code>\n	<ul>\n	<li>(foo OR bar) AND (foo@domain.com)</li>\n	</ul>\n	</li>\n		<li><code>name=\"foo\" email=\"foo@domain.com\" web=\"domain.com\" strict=\"1\"</code>\n	<ul>\n	<li>(foo) AND (foo@domain.com) AND (domain.com)</li>\n	</ul>\n	</li>\n		<li><code>name=\"foo,bar\" email=\"foo@domain.com\" web=\"domain.com\" strict=\"1\"</code>\n	<ul>\n	<li>(foo OR bar) AND (foo@domain.com) AND (domain.com)</li>\n	</ul></li>\n	</ul>\n\n </span>\n\n	<p>This tag is intended to be used as an &#8220;enclosure&#8221; tag, meaning it should enclose text that will be conditionally displayed based on the rules you set.  For example:</p>\n\n	<p style=\"padding: 10px; border: 1px solid #999; background: #eee; display: block; margin: 10px 0 0 0; text-indent: 0; text-align: left; color: #600;width:600px;\"><code>&lt;txp:ajw_if_comment_owner name=\"foo,bar\"&gt;owner&lt;/txp:if_comment_owner&gt;</code></p>\n\n	<p style=\"padding: 10px; border: 1px solid #999; background: #eee; display: block; margin: 10px 0 0 0; text-indent: 0; text-align: left; color: #600;width:600px;\"><code>&lt;txp:ajw_if_comment_owner name=\"tom,jack,sue\"&gt;friends&lt;/txp:if_comment_owner&gt;</code></p>\n\n	<p>Though you may not nest multiple <code>ajw_if_comment_owner</code> tags, you <em>may</em> specify an <code>&lt;else /&gt;</code> clause.  For example:</p>\n\n	<p style=\"padding: 10px; border: 1px solid #999; background: #eee; display: block; margin: 10px 0 0 0; text-indent: 0; text-align: left; color: #600;width:600px;\"><code>&lt;txp:ajw_if_comment_owner name=\"foo,bar\"&gt;</code> <br />\n  YES! <br />\n <code>&lt;else /&gt;</code> <br />\n  NO! <br />\n <code>&lt;/txp:if_comment_owner&gt;</code></p>\n\n\n\n\n ','\nfunction ajw_if_comment_owner($atts,$thing=\'\')\n{\n	global $thiscomment,$thisarticle;\n\n	extract(lAtts(array(\n		\'name\'   => \'\',\n		\'email\'  => \'\',\n		\'web\'    => \'\',\n		\'strict\' => \'\'\n	),$atts));\n\n	// grab else clause if it exists\n	$patrn = \'/<else\\b\\s*\\/\\s*>/s\';\n	$parts = preg_split($patrn,$thing);\n\n	$is_owner = array(\n		\'name\'	=> false,\n		\'email\'	=> false,\n		\'web\'	=> false\n	);\n\n	$checklist = array();\n\n	if ($name) {\n		$name = explode(\',\',$name);\n		$checklist[] = \'name\';\n		foreach($name as $n) {\n			$is_owner[\'name\'] = (strtolower($thiscomment[\'name\'])==strtolower($n))\n				? true\n				: $is_owner[\'name\'];\n		}\n	}\n	if ($email) {\n		$email = explode(\',\',$email);\n		$checklist[] = \'email\';\n		foreach($email as $e) {\n			$is_owner[\'email\'] = (strtolower($thiscomment[\'email\'])==strtolower($e))\n				? true\n				: $is_owner[\'email\'];\n		}\n	}\n	if ($web) {\n		$web = explode(\',\',$web);\n		$checklist[] = \'web\';\n		foreach($web as $w) {\n			$cruft = array(\'http://\',\'www.\');\n			$is_owner[\'web\'] = (str_replace($cruft,\'\',strtolower($thiscomment[\'web\']))==str_replace($cruft,\'\',strtolower($w)))\n				? true\n				: $is_owner[\'web\'];\n			$is_owner[\'web\'].str_replace($cruft,\'\',strtolower($thiscomment[\'web\'])).sp.str_replace($cruft,\'\',strtolower($w));\n		}\n	}\n	if ($strict) {\n		foreach($checklist as $item) {\n			if (($is_owner[\"$item\"]===false)) // parse else clause or nothing at all\n				return (isset($parts[1])) ? parse($parts[1]) : false;\n		}\n		// parse only first clause if else clause exists\n		return (isset($parts[1])) ? parse($parts[0]) : parse($thing);\n	} else {\n		// parse either all, nothing, or if/else clause\n		return (in_array(true,$is_owner))\n			? ((isset($parts[1])) ? parse($parts[0]) : parse($thing))\n			: ((isset($parts[1])) ? parse($parts[1]) : false);\n	}\n\n}\n','\nfunction ajw_if_comment_owner($atts,$thing=\'\')\n{\n	global $thiscomment,$thisarticle;\n\n	extract(lAtts(array(\n		\'name\'   => \'\',\n		\'email\'  => \'\',\n		\'web\'    => \'\',\n		\'strict\' => \'\'\n	),$atts));\n\n	// grab else clause if it exists\n	$patrn = \'/<else\\b\\s*\\/\\s*>/s\';\n	$parts = preg_split($patrn,$thing);\n\n	$is_owner = array(\n		\'name\'	=> false,\n		\'email\'	=> false,\n		\'web\'	=> false\n	);\n\n	$checklist = array();\n\n	if ($name) {\n		$name = explode(\',\',$name);\n		$checklist[] = \'name\';\n		foreach($name as $n) {\n			$is_owner[\'name\'] = (strtolower($thiscomment[\'name\'])==strtolower($n))\n				? true\n				: $is_owner[\'name\'];\n		}\n	}\n	if ($email) {\n		$email = explode(\',\',$email);\n		$checklist[] = \'email\';\n		foreach($email as $e) {\n			$is_owner[\'email\'] = (strtolower($thiscomment[\'email\'])==strtolower($e))\n				? true\n				: $is_owner[\'email\'];\n		}\n	}\n	if ($web) {\n		$web = explode(\',\',$web);\n		$checklist[] = \'web\';\n		foreach($web as $w) {\n			$cruft = array(\'http://\',\'www.\');\n			$is_owner[\'web\'] = (str_replace($cruft,\'\',strtolower($thiscomment[\'web\']))==str_replace($cruft,\'\',strtolower($w)))\n				? true\n				: $is_owner[\'web\'];\n			$is_owner[\'web\'].str_replace($cruft,\'\',strtolower($thiscomment[\'web\'])).sp.str_replace($cruft,\'\',strtolower($w));\n		}\n	}\n	if ($strict) {\n		foreach($checklist as $item) {\n			if (($is_owner[\"$item\"]===false)) // parse else clause or nothing at all\n				return (isset($parts[1])) ? parse($parts[1]) : false;\n		}\n		// parse only first clause if else clause exists\n		return (isset($parts[1])) ? parse($parts[0]) : parse($thing);\n	} else {\n		// parse either all, nothing, or if/else clause\n		return (in_array(true,$is_owner))\n			? ((isset($parts[1])) ? parse($parts[0]) : parse($thing))\n			: ((isset($parts[1])) ? parse($parts[1]) : false);\n	}\n\n}\n','4075ca370e67f9d3a183571310000c84',0);
INSERT INTO txp_plugin VALUES ('glx_gravatar',0,'der GrauMeister','http://grauhirn.org/patterntext/glx_gravatar','2006.1','Implementation of gravatar-images.','	<p><style type=\"text/css\">.gho{background-color:#222;color:#ccc;font-family:Verdana,sans-serif;font-size:0.8em;position:relative;margin:15px auto;padding:10px;text-align:left;width:740px;}.gho p{padding:5px;background-color:#282828;border:1px solid #515551;}.gho a:link,.gho a:visited{color:#aa0303;text-decoration:none;}.gho a:hover,.gho a:active{color:#aa0303;text-decoration:underline;}</style><div class=\"gho\"><p>This is a Textpattern-plugin by <a href=\"http://grauhirn.org/\">&#3626;&#3637;&#3648;&#3607;&#3634;&#3626;&#3617;&#3629;&#3591;.&#3629;&#3591;&#3588;&#3660;&#3585;&#3619;</a>. If you find a bug or think the documentation could be a little bit more in depth or understandable, <a href=\"http://grauhirn.org/contact/\">please do not hesitate to contact the author</a>.</p></div></p>\n\n	<h2>glx_gravatar</h2>\n\n	<p>Outputs a gravatar in comments. Developed by <a href=\"http://johan.galaxen.net/\">Johan Nilsson</a> and maintained by <a href=\"http://grauhirn.org/\">der GrauMeister</a>.</p>\n\n	<p>More info about Gravatars at <a href=\"http://www.gravatar.com/\">http://www.gravatar.com/</a></p>\n\n	<h3>attributes</h3>\n\n	<h4>disable</h4>\n\n	<p>Set this to 0 for disabling gravatar-images. This is a convenient workaround if gravatar.com is unavailable again and the process of trying to fetch the images slowing your pages down. You dont need to delete the glx_gravatar-tag. default is of course 1.</p>\n\n	<h4>default</h4>\n\n	<p>If the user dont have a Gravatar you can specify an image that will be displayed instead. If not given no image will be returned, when there is no gravatar-account for the given emailadress. You have to specify the full path to the image, if it is saved under your current txp-installation.</p>\n\n	<h4>size</h4>\n\n	<p>Size of the Gravatar. Possible values are 0 til 80 and 80 is default.</p>\n\n	<h4>rating</h4>\n\n	<p>Can be G, PG, R or X. More info about the rating at <a href=\"http://www.gravatar.com/rating.php\">Gravatar.com</a>. If not given no rating will be applied.</p>\n\n	<h4>border</h4>\n\n	<p>When this attribute is given, an border of 1px will be applied to the picture. This attribute can contain the hex-code of the color (three or six characters). Please note, that this border will be included in the actual image and will be substracted of the resulting size (??? how to explain <em>this</em>?). If you give size 40 your image will be 38pixel wide and the border around it will have 1pixel.</p>\n\n	<h4>class</h4>\n\n	<p>Class to assign to the img tag. If not given no class will be applied.</p>\n\n	<h4>alt</h4>\n\n	<p>The image alt text. Default is empty.</p>\n\n	<h3>the imagecache</h3>\n\n	<p>Starting with Version 4.0.1.1 an imagecache will be used to save bandwidth and (in a future version) help in times with serverproblems at the gravatarsite. per default images will be saved for 60 minutes in the file-directory, where an filecachefolder will be established. This folder will be used of some of my plugins, so if you use more of them, be careful and change this settings in all plugins or no plugin ;)</p>\n\n	<h4>usecache</h4>\n\n	<p>Set this to 0 to disable the cache. default is enabled.</p>\n\n	<h4>cachepath</h4>\n\n	<p>The name of the cachefolder. This folder will be located in the global filesfolder of txp, so you need to give here only the name of the subfolder. The global filefolder needs to be writable by the webserver and php. Default is &#8220;filecache&#8221;. This folder can be deleted without any problems, the plugin will reestablish it if it dont find it.</p>\n\n	<h4>cachetime</h4>\n\n	<p>How many minutes the images should be cached? Default is 60 minutes.</p>\n\n	<h4>usecurl</h4>\n\n	<p>The plugin uses the curl-module of PHP which is a faster way of retrieving the file. If you experience errors you can set this option to zero, so the &#8220;normal&#8221; filegetfunctions will be used.</p>\n\n	<h4>timeout</h4>\n\n	<p>How long should the plugin try to get the image from the gravatar-server? Default is 5 seconds. if the gravatar-server is down this will stop the long loading time for your pages.</p>\n\n	<h3>Example</h3>\n\n<pre><code>&lt;txp:glx_gravatar /&gt;\n&lt;txp:glx_gravatar size=\"60\" default=\"http://www.example.com/images/gravatar.png\" class=\"gravatar\" /&gt;</code></pre>\n\n	<h3>Changelog</h3>\n\n	<p>2005-12-24 v.2006.1</p>\n	<ul>\n		<li>re-release (revised for Textpattern 4.0.3)</li>\n		<li>new documentation</li>\n	</ul>\n\n	<p><strong>4.0.1.3</strong> 2005-10-25</p>\n	<ul>\n		<li>fetch the gravatar via PHPs curl-module</li>\n	</ul>\n\n	<p><strong>4.0.1.2</strong> 2005-10-22</p>\n	<ul>\n		<li>ability to disable the cache</li>\n	</ul>\n\n	<p><strong>4.0.1.1</strong> 2005-10-22</p>\n	<ul>\n		<li>caching of the gravatar-images</li>\n		<li>defaultimage is not send to the server</li>\n	</ul>\n\n	<p><strong>4.0.1</strong> 2005-10-17</p>\n	<ul>\n		<li>alt-attribut is given-back empty if the attribut is not given</li>\n		<li>codereview</li>\n	</ul>\n\n	<p><del><strong>0.2</strong> 2005-03-17 <a href=\"http://compooter.org/\">Andrew</a> has made some great improvements to this plugin.</del> T<br />\nhis optimizations turned out to be some extreme performancekillers &#8211; we advice to update to version 4.0.</p>\n	<ul class=\"changelog\">\n		<li>All querystrings are empty by default</li>\n		<li>The default image is never sent to the Gravatar service</li>\n		<li>If a user dont have a Gravatar then it returns the default image, or nothing at all (In 0.1 the Gravatar service returned a 1&#215;1 px image)</li>\n	</ul>\n\n	<p><strong>0.1</strong> 2005-03-10</p>\n	<ul class=\"changelog\">\n		<li>First release</li>\n	</ul>\n\n	<p>Note! This plugin requires Textpattern 4.0 or greater</p>\n\n	<p><div class=\"gho\"><p>plugin compiled at: Thu, 02 Feb 2006 06:09:23 +0100 | current version at <a href=\"http://grauhirn.org/patterntext/glx_gravatar\">http://grauhirn.org/patterntext/glx_gravatar</a></p></div></p>\n\n\n ','\nfunction glx_gravatar($atts) {\n	global $thiscomment, $file_base_path;\n	if (isset($atts[\'disable\']) && $atts[\'disable\'] == 0){\n	    return;\n	};\n	$cachetime = (!empty($atts[\'cachetime\']))\n	   ? $atts[\'cachetime\'] * 60\n	   : 60 * 60;\n	$cachepath = (!empty($atts[\'cachepath\']))\n	   ? $atts[\'cachepath\']\n	   : \'filecache\';\n	$usecurl   = (isset($atts[\'usecurl\']) && $atts[\'usecurl\'] == 0)\n	   ? 0\n	   : 1;\n	$usecache  = (isset($atts[\'usecache\']) && $atts[\'usecache\'] == 0)\n	   ? 0\n	   : 1;\n	if ($usecache == 1){\n	   $cache = new ghoFilecache($file_base_path.\'/\'.$cachepath, $cachetime);\n	};\n	$url = \'http://www.gravatar.com/avatar.php?gravatar_id=\';\n	$url .= md5($thiscomment[\'email\']);\n	if (!empty($atts[\'rating\'])){\n	    $url .= \'&amp;rating=\'.$atts[\'rating\'];\n	};\n	if (!empty($atts[\'size\'])){\n	    $url .= \'&amp;size=\'.$atts[\'size\'];\n	};\n	if (!empty($atts[\'border\'])){\n	    $url .= \'&amp;border=\'.$atts[\'border\'];\n	};\n	if ($usecache == 1) {\n    	if ($cache->check_cache($url) != \"HIT\" && $usecurl == 1){\n            $ch = curl_init($url);\n            curl_setopt($ch, CURLOPT_RETURNTRANSFER, true);\n            $timeout = (isset($atts[\'timeout\']))\n                ? $atts[\'timeout\']\n                : 5;\n            curl_setopt($ch, CURLOPT_CONNECTTIMEOUT, $timeout);\n            curl_setopt($ch, CURLOPT_HEADER, 0);\n            $content = curl_exec($ch);\n            $cache->set($url, $content);\n    	} elseif ($cache->check_cache($url) != \"HIT\"){\n            $content = file_get_contents($url);\n            $cache->set($url, $content);\n        };\n        list($iw, $ih, $it, $ia) = getimagesize($url);\n    	if ($iw > 1 && $cache->check_cache($url) == \"HIT\"){\n            $url = hu.\'files/filecache/\'.md5($url);\n    	} elseif (!empty($atts[\'default\'])) {\n    	    $url = $atts[\'default\'];\n    	} else {\n    	    return false;\n        };\n	} elseif (!empty($atts[\'default\'])){\n    	$url .= \'&amp;default=\'.urlencode($atts[\'default\']);\n	};\n	$output = \'<img src=\"\'.$url.\'\"\';\n	if (!empty($atts[\'class\'])){\n	    $output .= \' class=\"\'.$atts[\'class\'].\'\"\';\n	};\n	$alt = (!empty($atts[\'alt\']))\n	   ? $atts[\'alt\']\n	   : \'\';\n	$output .= \' alt=\"\'.$alt.\'\"\';\n	$output .= (!empty($atts[\'size\']))\n	   ? \' height=\"\'.$atts[\'size\'].\'\" width=\"\'.$atts[\'size\'].\'\"\'\n	   : \' height=\"80\" width=\"80\"\';\n	$output .= \' />\';\n	return $output;\n}\nif (!function_exists(\'file_put_contents\')) {\n	define(\'FILE_APPEND\', 1);\n	function file_put_contents($filename, $content, $flags = 0) {\n		if (!($file = fopen($filename, ($flags & FILE_APPEND) ? \'a\' : \'w\'))) {\n			return false;\n		};\n		if (fwrite($file, $content)){\n			fclose($file);\n			return true;\n		};\n		return false;\n	};\n};\nif (!class_exists(\'ghoFilecache\')) {\n    class ghoFilecache {\n    	var $BASE_CACHE;\n    	var $MAX_AGE;\n    	function ghoFilecache($base=_FILE_CACHE_DIR, $age=_FILE_CACHE_AGE) {\n    		$this->BASE_CACHE = $base;\n    		$this->MAX_AGE = $age;\n    		if (!file_exists($this->BASE_CACHE)) {\n    			@mkdir($this->BASE_CACHE, 0777);\n    		};\n    	}\n    	function set($url,$data) {\n    		$cache_file = $this->file_name($url);\n    		if (file_put_contents($cache_file, $data) == true){\n    		    chmod($cache_file, 0777);\n    			return $cache_file;\n    		} else {\n    			return 0;\n    		};\n    	}\n    	function get ($url) {\n    		$cache_file = $this->file_name($url);\n    		if (!file_exists($cache_file)) {\n    			return 0;\n    		};\n    		$fp = @fopen($cache_file, \'r\');\n    		if (!$fp) {\n    			return 0;\n    		};\n    		$data = fread($fp,filesize($cache_file));\n    		return $data;\n    	}\n    	function check_cache($url) {\n    		$filename = $this->file_name($url);\n    		if (file_exists($filename)) {\n    			$mtime = filemtime($filename);\n    			$age = time() - $mtime;\n    			return ($this->MAX_AGE > $age) ? \'HIT\' : \'STALE\';\n    		};\n    		return \'MISS\';\n    	}\n    	function file_name($url){\n    		return join(DIRECTORY_SEPARATOR, array($this->BASE_CACHE, md5($url)));\n    	}\n    }\n}\n','\nfunction glx_gravatar($atts) {\n	global $thiscomment, $file_base_path;\n	if (isset($atts[\'disable\']) && $atts[\'disable\'] == 0){\n	    return;\n	};\n	$cachetime = (!empty($atts[\'cachetime\']))\n	   ? $atts[\'cachetime\'] * 60\n	   : 60 * 60;\n	$cachepath = (!empty($atts[\'cachepath\']))\n	   ? $atts[\'cachepath\']\n	   : \'filecache\';\n	$usecurl   = (isset($atts[\'usecurl\']) && $atts[\'usecurl\'] == 0)\n	   ? 0\n	   : 1;\n	$usecache  = (isset($atts[\'usecache\']) && $atts[\'usecache\'] == 0)\n	   ? 0\n	   : 1;\n	if ($usecache == 1){\n	   $cache = new ghoFilecache($file_base_path.\'/\'.$cachepath, $cachetime);\n	};\n	$url = \'http://www.gravatar.com/avatar.php?gravatar_id=\';\n	$url .= md5($thiscomment[\'email\']);\n	if (!empty($atts[\'rating\'])){\n	    $url .= \'&amp;rating=\'.$atts[\'rating\'];\n	};\n	if (!empty($atts[\'size\'])){\n	    $url .= \'&amp;size=\'.$atts[\'size\'];\n	};\n	if (!empty($atts[\'border\'])){\n	    $url .= \'&amp;border=\'.$atts[\'border\'];\n	};\n	if ($usecache == 1) {\n    	if ($cache->check_cache($url) != \"HIT\" && $usecurl == 1){\n            $ch = curl_init($url);\n            curl_setopt($ch, CURLOPT_RETURNTRANSFER, true);\n            $timeout = (isset($atts[\'timeout\']))\n                ? $atts[\'timeout\']\n                : 5;\n            curl_setopt($ch, CURLOPT_CONNECTTIMEOUT, $timeout);\n            curl_setopt($ch, CURLOPT_HEADER, 0);\n            $content = curl_exec($ch);\n            $cache->set($url, $content);\n    	} elseif ($cache->check_cache($url) != \"HIT\"){\n            $content = file_get_contents($url);\n            $cache->set($url, $content);\n        };\n        list($iw, $ih, $it, $ia) = getimagesize($url);\n    	if ($iw > 1 && $cache->check_cache($url) == \"HIT\"){\n            $url = hu.\'files/filecache/\'.md5($url);\n    	} elseif (!empty($atts[\'default\'])) {\n    	    $url = $atts[\'default\'];\n    	} else {\n    	    return false;\n        };\n	} elseif (!empty($atts[\'default\'])){\n    	$url .= \'&amp;default=\'.urlencode($atts[\'default\']);\n	};\n	$output = \'<img src=\"\'.$url.\'\"\';\n	if (!empty($atts[\'class\'])){\n	    $output .= \' class=\"\'.$atts[\'class\'].\'\"\';\n	};\n	$alt = (!empty($atts[\'alt\']))\n	   ? $atts[\'alt\']\n	   : \'\';\n	$output .= \' alt=\"\'.$alt.\'\"\';\n	$output .= (!empty($atts[\'size\']))\n	   ? \' height=\"\'.$atts[\'size\'].\'\" width=\"\'.$atts[\'size\'].\'\"\'\n	   : \' height=\"80\" width=\"80\"\';\n	$output .= \' />\';\n	return $output;\n}\nif (!function_exists(\'file_put_contents\')) {\n	define(\'FILE_APPEND\', 1);\n	function file_put_contents($filename, $content, $flags = 0) {\n		if (!($file = fopen($filename, ($flags & FILE_APPEND) ? \'a\' : \'w\'))) {\n			return false;\n		};\n		if (fwrite($file, $content)){\n			fclose($file);\n			return true;\n		};\n		return false;\n	};\n};\nif (!class_exists(\'ghoFilecache\')) {\n    class ghoFilecache {\n    	var $BASE_CACHE;\n    	var $MAX_AGE;\n    	function ghoFilecache($base=_FILE_CACHE_DIR, $age=_FILE_CACHE_AGE) {\n    		$this->BASE_CACHE = $base;\n    		$this->MAX_AGE = $age;\n    		if (!file_exists($this->BASE_CACHE)) {\n    			@mkdir($this->BASE_CACHE, 0777);\n    		};\n    	}\n    	function set($url,$data) {\n    		$cache_file = $this->file_name($url);\n    		if (file_put_contents($cache_file, $data) == true){\n    		    chmod($cache_file, 0777);\n    			return $cache_file;\n    		} else {\n    			return 0;\n    		};\n    	}\n    	function get ($url) {\n    		$cache_file = $this->file_name($url);\n    		if (!file_exists($cache_file)) {\n    			return 0;\n    		};\n    		$fp = @fopen($cache_file, \'r\');\n    		if (!$fp) {\n    			return 0;\n    		};\n    		$data = fread($fp,filesize($cache_file));\n    		return $data;\n    	}\n    	function check_cache($url) {\n    		$filename = $this->file_name($url);\n    		if (file_exists($filename)) {\n    			$mtime = filemtime($filename);\n    			$age = time() - $mtime;\n    			return ($this->MAX_AGE > $age) ? \'HIT\' : \'STALE\';\n    		};\n    		return \'MISS\';\n    	}\n    	function file_name($url){\n    		return join(DIRECTORY_SEPARATOR, array($this->BASE_CACHE, md5($url)));\n    	}\n    }\n}\n','ba1b16cb9c1d9bc7e64a4857d17a04fb',0);
INSERT INTO txp_plugin VALUES ('low_discuss',0,'Justin Low','http://justinlow.com/','0.5','An alternative to Textpattern\'s built-in comments functions','\n<h1>Overview</h1>\n\n	<p>A set of plugins to replace the built-in Textpattern functions.</p>\n\n	<h1>Prerequisites</h1>\n\n	<p>You will also need to use another plugin, <strong>low_article</strong> in order to take advantage of this plugin&#8217;s functions. You can download this plugin <a href=\"http://justinlow.com/plugins/release/low_article.txt\">here</a>.</p>\n\n	<h1>Tags</h1>\n	<ul>\n	<li><code>&lt;txp:low_discuss /&gt;</code>&#8212;Displays comments</li>\n		<li><code>&lt;txp:low_discuss_form /&gt;</code>&#8212;Displays input form</li>\n		<li><code>&lt;txp:low_comments_invite /&gt;</code>&#8212;Replaces <code>&lt;txp:comments_invite /&gt;</code></li>\n		<li><code>&lt;txp:low_discuss_validate /&gt;</code>&#8212;Generates the necessary HTML code needed for the Javascript form validator; see notes below</li>\n	</ul>\n\n	<h1>Attributes</h1>\n\n	<h2><code>&lt;txp:low_discuss /&gt;</code></h2>\n	<ul>\n	<li><code>sortby</code>&#8212;Defaults to <code>posted</code>. Defines which field to sort comments by.</li>\n		<li><code>sortdir</code>&#8212;Defaults to <code>asc</code>. Defines which direction comments are sorted in.</li>\n		<li><code>displayform</code>&#8212;Defaults to <code>comments</code>. You can use this attribute to define a custom form.</li>\n	</ul>\n\n	<h2><code>&lt;txp:low_discuss_form /&gt;</code></h2>\n	<ul>\n	<li><code>inputform</code>&#8212;Defaults to &#8217;@comment_form@&#8217;. You can use this attribute to define a custom form.</li>\n	</ul>\n\n	<h1>Notes</h1>\n\n	<h2><code>&lt;txp:low_discuss_validate /&gt;</code></h2>\n\n	<p>In order to use this tag, you will need to download the Javascript file from <a href=\"http://www.javascript-coder.com/html-form/javascript-form-validation.phtml\">JavaScript-Coder.com</a>. I cannot distribute the file with this plugin due to licensing issues. <a href=\"http://www.javascript-coder.com/html-form/javascript_form.zip\">Download the zip file</a>, extract it to a convenient location and upload the file <code>gen_validatorv2.js</code> to your website.</p>\n\n	<p>Next, you will need to paste the following code into your page templates, within the <code>&lt;head&gt;...&lt;/head&gt;</code> tags:</p>\n\n<code>&lt;script language=\"JavaScript\" src=\"/gen_validatorv2.js\" type=\"text/javascript\"&gt;&lt;/script&gt;</code>\n\n	<p>In the above instance, it is assumed that you have placed the file in the root directory of your website.</p>\n\n	<p>Once this is done, you can place the <code>&lt;txp:low_discuss_validate /&gt;</code> tag after the <code>&lt;txp:low_discuss_form /&gt;</code> tag in your template.</p>\n\n	<h1>Sample</h1>\n\n	<p>This is a basic implementation of the plugin functionality.</p>\n\n<code>&lt;txp:if_article_list&gt;</code><br />\n<code>&lt;txp:comments_invite /&gt;</code><br />\n<code>&lt;/txp:if_article_list&gt;</code><br />\n<code> </code><br />\n<code>&lt;txp:if_individual_article&gt;</code><br />\n<code>&lt;txp:low_discuss /&gt;</code><br />\n<code>&lt;txp:low_discuss_form /&gt;</code><br />\n<code>&lt;txp:low_discuss_validate /&gt;</code><br />\n<code>&lt;/txp:if_individual_article&gt;</code>\n\n	<p>Note that without the conditional tags, you would see the comments and form (depending on what you use) even on the article list page.</p>\n\n','\n// ----------------------------------------------------\n// Example public side tags\n\n	// A simple self-closing tag\n	// <txp:zem_hello_world name=\"Bob\" />\n\n	// -------------------------------------------------------------\nfunction low_discuss($atts)\n{\n	global $comments_are_ol, $thisarticle;\n	$ID = $thisarticle[\'thisid\'];\n\n	extract(lAtts(array(\n		\'displayform\'  => \'comments\',\n		\'sortby\'       => \'posted\',\n		\'sortdir\'      => \'asc\',\n	),$atts));\n\n	extract(\n		safe_row(\n			\"Annotate,AnnotateInvite,unix_timestamp(Posted) as uPosted\",\n				\"textpattern\", \"ID=\'$ID\'\"\n		)\n	);\n\n	$darr = low_fetchComments($ID, $sortby, $sortdir);\n\n	//$out = n.\'<h3 id=\"\'.gTxt(\'comment\').\'\">\'.$AnnotateInvite.\'</h3>\'.n;\n\n\n\n	if ($darr) {\n		$out.= ($comments_are_ol) ? \'<ol>\'.n : \'\';\n		$out.= low_formatComments($darr, $displayform);\n		$out.= ($comments_are_ol) ? n.\'</ol>\' : \'\';\n	}\n\n		$wasAnnotated = (!$Annotate) ? getCount(\'txp_discuss\',\"parentid=$ID\") : \'\';\n\n/*		if (!checkCommentsAllowed($ID)) {\n			$out .= graf(gTxt(\"comments_closed\"));\n		} else {\n			$out .= low_commentForm( $ID );\n		}*/\n	return $out;\n\n}\n// -------------------------------------------------------------\nfunction low_fetchComments($id, $sortby, $sortdir)\n{\n	$rs = safe_rows(\n		\"*, unix_timestamp(posted) as time\",\n		\"txp_discuss\", \"parentid=\'$id\' and visible=\'1\' order by \".$sortby.\" \".$sortdir\n	);\n\n	if ($rs) return $rs;\n}\n// -------------------------------------------------------------\nfunction low_formatComments($darr, $displayform)\n{\n	global $prefs,$txpcfg,$comments_disallow_images,$txpac;\n	extract($prefs);\n	$preview = gps(\'preview\');\n	$id = gps(\'id\');\n	$Form = fetch(\'Form\',\'txp_form\',\'name\',$displayform);\n	$out = array();\n\n	foreach($darr as $vars) {\n		$GLOBALS[\'thiscomment\'] = $vars;\n		extract($vars);\n\n		if($comments_dateformat == \"since\") {\n			$comment_time = since($time + tz_offset());\n		} else {\n			$comment_time = safe_strftime($comments_dateformat,$time);\n		}\n\n		$web = str_replace(\"http://\", \"\", $web);\n\n		if ($email && !$web && !$txpac[\'never_display_email\'])\n			$name = \'<a href=\"\'.eE(\'mailto:\'.$email).\'\"\'.(@$txpac[\'comment_nofollow\'] ? \' rel=\"nofollow\"\' : \'\').\'>\'.$name.\'</a>\';\n\n		if ($web)\n			$name = \'<a href=\"http://\'.$web.\'\" title=\"\'.$web.\'\"\'.(@$txpac[\'comment_nofollow\'] ? \' rel=\"nofollow\"\' : \'\').\'>\'.$name.\'</a>\';\n\n		$dlink = permlinkurl_id($parentid).\'#c\'.$discussid;\n\n		$vals = array(\n			\'comment_name\'=>$name,\n			\'message\'=>$message,\n			\'comment_time\'=>$comment_time\n		);\n\n		$temp = $Form;\n		foreach($vals as $a=>$b) {\n			$temp = str_replace(\'<txp:\'.$a.\' />\',$b,$temp);\n		}\n\n		$temp = preg_replace(\'/<(txp:comment_permlink)>(.*)<\\/\\\\1>/U\',\n			\'<a href=\"\'.$dlink.\'\">$2</a>\',$temp);\n		$temp = parse($temp);\n\n		$out[] = ($comments_are_ol)\n		?	n.t.\'<li id=\"c\'.$discussid.\'\">\'.$temp.\'</li>\'\n		:	n.t.\'<div id=\"c\'.$discussid.\'\">\'.$temp.\'</div>\';\n	}\n		return join(n,$out);\n	}\n// -------------------------------------------------------------\nfunction low_discuss_form($atts)\n{\n	global $txpac, $thisarticle;\n	$ID = $thisarticle[\'thisid\'];\n	$id = $ID;\n\n	extract(lAtts(array(\n		\'inputform\'    => \'comment_form\',\n	),$atts));\n\n	$namewarn = \'\';\n	$emailwarn = \'\';\n	$commentwarn = \'\';\n	$name= pcs(\'name\');\n	$email= pcs(\'email\');\n	$web= pcs(\'web\');\n	extract( doStripTags( doDeEnt ( psa( array(\n		\'remember\',\n		\'forget\',\n		\'parentid\',\n		\'preview\',\n		\'message\',\n		\'submit\',\n		\'backpage\'\n	) ) ) ) );\n\n	$parentid = (!$parentid) ? $id : $parentid;\n\n	if ($remember==1) { setCookies($name,$email,$web); }\n	if ($forget==1) { destroyCookies(); }\n\n	$out = \'<form method=\"post\" action=\"\" name=\"discuss_form\">\';\n\n	$form = fetch(\'Form\',\'txp_form\',\'name\',\'comment_form\');\n\n	$textarea = \'<textarea name=\"message\" cols=\"30\" rows=\"12\" tabindex=\"4\">\'.htmlspecialchars($message).\'</textarea>\';\n\n	$comment_submit_button = fInput(\'submit\',\'submit\',gTxt(\'submit\'),\'button\');\n\n	$checkbox = (!empty($_COOKIE[\'txp_name\']))\n	?	checkbox(\'forget\',1,0).\' \'.gTxt(\'forget\')\n	:	checkbox(\'remember\',1,1).\' \'.gTxt(\'remember\');\n\n	$vals = array(\n		\'comment_name_input\'    => $namewarn.input(\'text\',\'name\',  $name, \"25\",\'\',\"1\"),\n		\'comment_email_input\'   => $emailwarn.input(\'text\',\'email\', $email,\"25\",\'\',\"2\"),\n		\'comment_web_input\'     => input(\'text\',\'web\',   $web,  \"25\",\'\',\"3\"),\n		\'comment_message_input\' => $commentwarn.$textarea,\n		\'comment_remember\'      => $checkbox,\n		\'comment_preview\'       => null,\n		\'comment_submit\'        => fInput(\'submit\',\'submit\',gTxt(\'submit\'),\'button\')\n	);\n\n	foreach ($vals as $a=>$b) {\n		$form = str_replace(\'<txp:\'.$a.\' />\',$b,$form);\n	}\n\n	$form = parse($form);\n\n	$nonce = md5( uniqid( rand(), true ) );\n	safe_insert(\"txp_discuss_nonce\", \"issue_time=now(), nonce=\'$nonce\'\");\n\n	$out .= $form;\n	$out .= graf(fInput(\'hidden\',\'parentid\',$parentid));\n	$out .= hInput(\'nonce\',$nonce);\n\n	$out .= graf(fInput(\'hidden\',\'backpage\',serverset(\"REQUEST_URI\")));\n	$out .= \'</form>\';\n\n	if (!checkCommentsAllowed($ID)) {\n		return graf(gTxt(\"comments_closed\"));\n	} else {\n		return $out;\n	}\n}\n// -------------------------------------------------------------\nfunction low_discuss_validate()\n{\n	$s = \'<script language=\"JavaScript\" type=\"text/javascript\">\n  var frmvalidator  = new Validator(\"discuss_form\");\n  frmvalidator.addValidation(\"name\",\"req\",\"Please enter your name\");\n\n  frmvalidator.addValidation(\"email\",\"req\",\"Please enter your email address\");\n  frmvalidator.addValidation(\"email\",\"email\",\"Please enter a valid email address\");\n  frmvalidator.addValidation(\"message\",\"req\",\"Please enter your comment\");\n\n</script>\';\n	return $s;\n}\n// -------------------------------------------------------------\n','\n// ----------------------------------------------------\n// Example public side tags\n\n	// A simple self-closing tag\n	// <txp:zem_hello_world name=\"Bob\" />\n\n	// -------------------------------------------------------------\nfunction low_discuss($atts)\n{\n	global $comments_are_ol, $thisarticle;\n	$ID = $thisarticle[\'thisid\'];\n\n	extract(lAtts(array(\n		\'displayform\'  => \'comments\',\n		\'sortby\'       => \'posted\',\n		\'sortdir\'      => \'asc\',\n	),$atts));\n\n	extract(\n		safe_row(\n			\"Annotate,AnnotateInvite,unix_timestamp(Posted) as uPosted\",\n				\"textpattern\", \"ID=\'$ID\'\"\n		)\n	);\n\n	$darr = low_fetchComments($ID, $sortby, $sortdir);\n\n	//$out = n.\'<h3 id=\"\'.gTxt(\'comment\').\'\">\'.$AnnotateInvite.\'</h3>\'.n;\n\n\n\n	if ($darr) {\n		$out.= ($comments_are_ol) ? \'<ol>\'.n : \'\';\n		$out.= low_formatComments($darr, $displayform);\n		$out.= ($comments_are_ol) ? n.\'</ol>\' : \'\';\n	}\n\n		$wasAnnotated = (!$Annotate) ? getCount(\'txp_discuss\',\"parentid=$ID\") : \'\';\n\n/*		if (!checkCommentsAllowed($ID)) {\n			$out .= graf(gTxt(\"comments_closed\"));\n		} else {\n			$out .= low_commentForm( $ID );\n		}*/\n	return $out;\n\n}\n// -------------------------------------------------------------\nfunction low_fetchComments($id, $sortby, $sortdir)\n{\n	$rs = safe_rows(\n		\"*, unix_timestamp(posted) as time\",\n		\"txp_discuss\", \"parentid=\'$id\' and visible=\'1\' order by \".$sortby.\" \".$sortdir\n	);\n\n	if ($rs) return $rs;\n}\n// -------------------------------------------------------------\nfunction low_formatComments($darr, $displayform)\n{\n	global $prefs,$txpcfg,$comments_disallow_images,$txpac;\n	extract($prefs);\n	$preview = gps(\'preview\');\n	$id = gps(\'id\');\n	$Form = fetch(\'Form\',\'txp_form\',\'name\',$displayform);\n	$out = array();\n\n	foreach($darr as $vars) {\n		$GLOBALS[\'thiscomment\'] = $vars;\n		extract($vars);\n\n		if($comments_dateformat == \"since\") {\n			$comment_time = since($time + tz_offset());\n		} else {\n			$comment_time = safe_strftime($comments_dateformat,$time);\n		}\n\n		$web = str_replace(\"http://\", \"\", $web);\n\n		if ($email && !$web && !$txpac[\'never_display_email\'])\n			$name = \'<a href=\"\'.eE(\'mailto:\'.$email).\'\"\'.(@$txpac[\'comment_nofollow\'] ? \' rel=\"nofollow\"\' : \'\').\'>\'.$name.\'</a>\';\n\n		if ($web)\n			$name = \'<a href=\"http://\'.$web.\'\" title=\"\'.$web.\'\"\'.(@$txpac[\'comment_nofollow\'] ? \' rel=\"nofollow\"\' : \'\').\'>\'.$name.\'</a>\';\n\n		$dlink = permlinkurl_id($parentid).\'#c\'.$discussid;\n\n		$vals = array(\n			\'comment_name\'=>$name,\n			\'message\'=>$message,\n			\'comment_time\'=>$comment_time\n		);\n\n		$temp = $Form;\n		foreach($vals as $a=>$b) {\n			$temp = str_replace(\'<txp:\'.$a.\' />\',$b,$temp);\n		}\n\n		$temp = preg_replace(\'/<(txp:comment_permlink)>(.*)<\\/\\\\1>/U\',\n			\'<a href=\"\'.$dlink.\'\">$2</a>\',$temp);\n		$temp = parse($temp);\n\n		$out[] = ($comments_are_ol)\n		?	n.t.\'<li id=\"c\'.$discussid.\'\">\'.$temp.\'</li>\'\n		:	n.t.\'<div id=\"c\'.$discussid.\'\">\'.$temp.\'</div>\';\n	}\n		return join(n,$out);\n	}\n// -------------------------------------------------------------\nfunction low_discuss_form($atts)\n{\n	global $txpac, $thisarticle;\n	$ID = $thisarticle[\'thisid\'];\n	$id = $ID;\n\n	extract(lAtts(array(\n		\'inputform\'    => \'comment_form\',\n	),$atts));\n\n	$namewarn = \'\';\n	$emailwarn = \'\';\n	$commentwarn = \'\';\n	$name= pcs(\'name\');\n	$email= pcs(\'email\');\n	$web= pcs(\'web\');\n	extract( doStripTags( doDeEnt ( psa( array(\n		\'remember\',\n		\'forget\',\n		\'parentid\',\n		\'preview\',\n		\'message\',\n		\'submit\',\n		\'backpage\'\n	) ) ) ) );\n\n	$parentid = (!$parentid) ? $id : $parentid;\n\n	if ($remember==1) { setCookies($name,$email,$web); }\n	if ($forget==1) { destroyCookies(); }\n\n	$out = \'<form method=\"post\" action=\"\" name=\"discuss_form\">\';\n\n	$form = fetch(\'Form\',\'txp_form\',\'name\',\'comment_form\');\n\n	$textarea = \'<textarea name=\"message\" cols=\"30\" rows=\"12\" tabindex=\"4\">\'.htmlspecialchars($message).\'</textarea>\';\n\n	$comment_submit_button = fInput(\'submit\',\'submit\',gTxt(\'submit\'),\'button\');\n\n	$checkbox = (!empty($_COOKIE[\'txp_name\']))\n	?	checkbox(\'forget\',1,0).\' \'.gTxt(\'forget\')\n	:	checkbox(\'remember\',1,1).\' \'.gTxt(\'remember\');\n\n	$vals = array(\n		\'comment_name_input\'    => $namewarn.input(\'text\',\'name\',  $name, \"25\",\'\',\"1\"),\n		\'comment_email_input\'   => $emailwarn.input(\'text\',\'email\', $email,\"25\",\'\',\"2\"),\n		\'comment_web_input\'     => input(\'text\',\'web\',   $web,  \"25\",\'\',\"3\"),\n		\'comment_message_input\' => $commentwarn.$textarea,\n		\'comment_remember\'      => $checkbox,\n		\'comment_preview\'       => null,\n		\'comment_submit\'        => fInput(\'submit\',\'submit\',gTxt(\'submit\'),\'button\')\n	);\n\n	foreach ($vals as $a=>$b) {\n		$form = str_replace(\'<txp:\'.$a.\' />\',$b,$form);\n	}\n\n	$form = parse($form);\n\n	$nonce = md5( uniqid( rand(), true ) );\n	safe_insert(\"txp_discuss_nonce\", \"issue_time=now(), nonce=\'$nonce\'\");\n\n	$out .= $form;\n	$out .= graf(fInput(\'hidden\',\'parentid\',$parentid));\n	$out .= hInput(\'nonce\',$nonce);\n\n	$out .= graf(fInput(\'hidden\',\'backpage\',serverset(\"REQUEST_URI\")));\n	$out .= \'</form>\';\n\n	if (!checkCommentsAllowed($ID)) {\n		return graf(gTxt(\"comments_closed\"));\n	} else {\n		return $out;\n	}\n}\n// -------------------------------------------------------------\nfunction low_discuss_validate()\n{\n	$s = \'<script language=\"JavaScript\" type=\"text/javascript\">\n  var frmvalidator  = new Validator(\"discuss_form\");\n  frmvalidator.addValidation(\"name\",\"req\",\"Please enter your name\");\n\n  frmvalidator.addValidation(\"email\",\"req\",\"Please enter your email address\");\n  frmvalidator.addValidation(\"email\",\"email\",\"Please enter a valid email address\");\n  frmvalidator.addValidation(\"message\",\"req\",\"Please enter your comment\");\n\n</script>\';\n	return $s;\n}\n// -------------------------------------------------------------\n','1ba4bf6e550c092c16d38e732f7105d4',0);
INSERT INTO txp_plugin VALUES ('ptv_if',0,'Petur Valdimarsson','http://www.bobified.com/','0.3b','A general purpose conditional statement','\n  <p>Basically this is an if/else construct for txp.<br />\n     The aim here was to create a somewhat adaptable set of tags thet can also be used to call other \"if\" plugins. The basic syntax is:\n<pre>\n		&lt;txp:ptv_condition&gt;\n			 if / else if / else\n		&lt;/txp:ptv_condition&gt;</pre></p>\n<p>\n     The comparison can be done with either a comparison of two values or an already existing plugins.\n     Note that the plugins must be installed in beforehand.<br>\n  Currently the tag doesn\'t support nesting, so you cannot include a ptv_condition inside a ptv_condition. I\'ll be looking over this. </p>\n<p>\n	I\'m well aware of what a hack this is so far. It was made for a specific purpose and so far I haven\'t really bothered to add much to it.\n	I did decide to do a release version just to see if anyone thinks I should add more time on this.<br />\n	Additions I will do in any case:\n</p>\n<ul>\n  <li>Proper comparisons with or, and, xor, groupings and so on.</li>\n  <li>Support for a singular boolean test.</li>\n  <li>A way to add shorthands to plugin calls. </li>\n  <li>Nesting. </li>\n</ul>\n<ul style=\"list-style:none;\">\n  <li><hr /></li>\n  <li>\n    <dl>\n	  <dt><strong>Version 0.3b</strong></dt>\n	  <dd>Packaged the plugin properly.<br />Documented added.</dd>\n	</dl>\n  </li>\n  <li><hr /></li>\n</ul>\n<p><h2>PTV if:\n	  </p>\n	</h2>\n	<p>Provides four tags:</p>\n  <ul>\n    <li><code>&lt;txp:ptv_condition&gt;&lt;/txp:ptv_condition&gt;</code></li>\n    <li><code>&lt;txp:ptv_if&gt;&lt;/txp:ptv_if&gt;</code></li>\n    <li><code>&lt;txp:ptv_else_if&gt;&lt;/txp:ptv_else_if&gt;</code></li>\n    <li><code>&lt;txp:ptv_else&gt;&lt;/txp:ptv_else&gt;</code></li>\n</ul>\n  <h2>ptv_condition\n    </p>\n  </h2>\n  <ul>\n    <li><code>&lt;txp:ptv_condition&gt;&lt;/txp:ptv_condition&gt;</code></li>\n  </ul>\n  <p><strong>Description</strong><br />\n  This is the parent tag. Everything inside this tag is expected to be enclosed in one of the other three tags.<br />\n  Everything within this tag <strong>not</strong> enclosed within <em>ptv_if, ptv_else_if or ptv_else</em> tags will be ignored.\n  </p>\n  <p><strong>Attribute(s)</strong></p>\n  <ul>\n    <li><strong>none</strong></li>\n  </ul>\n  <p><strong>Tag content</strong></p>\n  <ul>\n    <li>Conditional statements.</li>\n  </ul>\n  <p>\n  <h2>ptv_if and ptv_else_if</h2>\n  <ul>\n    <li><code>&lt;txp:ptv_if&gt;&lt;/txp:ptv_if&gt;</code></li>\n    <li><code>&lt;txp:ptv_else_if&gt;&lt;/txp:ptv_else_if&gt;</code></li>\n  </ul>\n  <p><strong>Description</strong>\n    A conditional statement. Everything within the tags will be returned, parsed, if the conditions are met.\n	note that there is basically no difference between ptv_if and ptv_else_if. Its mainly a question of readability and habit =)\n  </p>\n  <p><strong>Attribute(s)</strong></p>\n  <p>For comparison:</p>\n  <ul>\n    <li><strong>Comparison group, all or none of the following should be specified.</strong></li>\n    <li><strong>leftarg</strong> - left hand side argument. Can be variable, function or an absolute value</li>\n    <li><strong>condition</strong> - condition. Can be one of the following: lt (&lt;), lte (&lt;=), eq (==), gt (&gt;), gte (&gt;=)</li>\n    <li><strong>rightarg</strong> - right hand side argument. Can be variable, function or an absolute value</li>\n  </ul>\n  <p>For other plugins:</p>\n   <ul>\n    <li><strong>plugin</strong> - name of plugin without the txp: added to the beginning.</li>\n    <li><em>various</em> - Plugin specific attributes.</li>\n  </ul>\n  <p>Tag content</p>\n  <ul>\n    <li>Mixed content.</li>\n  </ul>\n\n  <h2>ptv_else</h2>\n  <ul>\n    <li><code>&lt;txp:ptv_else&gt;&lt;/txp:ptv_else&gt;</code></li>\n  </ul>\n  <p><strong>Description</strong>\n    The \"else\" part of the statement. If not preceded by pt_if the content ot this tag will always be returned.\n	Otherwise the content will be returned if no other condition is met.\n  </p>\n  <p><strong>Attribute(s)</strong></p>\n  <ul>\n    <li><strong>None</strong></li>\n  </ul>\n\n  <p>Tag content</p>\n  <ul>\n    <li>Mixed content.</li>\n  </ul>\n\n  <p>Examples</p>\n  <p>Using a plugin:<br />\n<pre><code>&lt;txp:ptv_condition&gt;<br>  &lt;txp:ptv_if plugin=&quot;mdm_if_category&quot; category=&quot;Alpha&quot;&gt;\n    Content specific to Alpha category\n  &lt;/txp:ptv_if&gt;\n  &lt;txp:ptv_else&gt;\n    Content for everything else\n  &lt;/txp:ptv_if&gt;\n&lt;/txp:ptv_condition&gt;</code></pre></p>\n\n<p>Using comparisons<br />\n<pre><code>&lt;txp:ptv_condition&gt;\n  &lt;txp:ptv_if leftarg=&quot;date(\'H\')&quot; condition=&quot;lt&quot; rightarg=&quot;5&quot;&gt;\n    Content specific to night\n  &lt;/txp:ptv_if&gt;\n  &lt;txp:ptv_else_if leftarg=&quot;date(\'H\')&quot; condition=&quot;lt&quot; rightarg=&quot;10&quot;&gt;\n    Content specific to morning\n  &lt;/txp:ptv_if&gt;\n  &lt;txp:ptv_else_if leftarg=&quot;date(\'H\')&quot; condition=&quot;lt&quot; rightarg=&quot;13&quot;&gt;\n    Content specific to lunch\n  &lt;/txp:ptv_if&gt;\n  &lt;txp:ptv_else&gt;\n    Anything else\n  &lt;/txp:ptv_if&gt;\n&lt;/txp:ptv_condition&gt;</code></pre>\n</p>\n\n  <p><h1>Important note:</h1>\n  As arguments sent to the test function (leftarg condition rightarg) are parsed using eval()\n  this should not be called using user input as user input might contain malicious code which could comprimise your systems security.\n  </p>\n\n','	$cond_array[\'gt\'] = \'>\';\n	$cond_array[\'gte\'] = \'>=\';\n	$cond_array[\'lt\'] = \'<\';\n	$cond_array[\'lte\'] = \'<=\';\n	$cond_array[\'eq\'] = \'==\';\n\nfunction ptv_condition($atts, $thing=\'\') {\n	$f = \'/<txp:(\\S+)\\b(.*)(?:(?<!br )(\\/))?\'.chr(62).\'(?(3)|(.+)<\\/txp:\\1>)/sU\';\n	preg_match_all($f, $thing, $matches, PREG_SET_ORDER);\n	foreach($matches as $match) {\n		$tag = $match[1];\n		$atts = (isset($match[2])) ? splat($match[2]) : \'\';\n		$thing = (isset($match[4])) ? $match[4] : \'\';\n		if (function_exists($tag)) {\n		  $result = $tag($atts,$thing,$match[0]);\n		  if($result) return $result;\n		}\n	}\n	return \'\';\n}\nfunction ptv_if($atts, $thing=\'\') {\n	return ptv_evaluate($atts)?$thing:\'\';\n}\nfunction ptv_else_if($atts, $thing=\'\') {\n	return ptv_evaluate($atts)?$thing:\'\';\n}\nfunction ptv_else($atts, $thing=\'\') {\n	return parse($thing);\n}\nfunction ptv_evaluate($atts) {\n	global $cond_array;\n	if(isset($atts[\'leftarg\']) && isset($atts[\'rightarg\']) && isset($atts[\'condition\'])) {\n		$statement = \'if(\'.$atts[\"leftarg\"].\' \'. $cond_array[$atts[\"condition\"]] .\' \'. $atts[\"rightarg\"].\') return true; else return false;\';\n		return eval($statement);\n	}\n/* On hold. Considering neccesity and argument implementation.\n	if (isset($atts[\'test\'])) {\n		if(*function_exists($atts[\'test\'])) {\n			return (*call_function($atts[\'test\']))?true:false;\n		} else if (isset( *eval( \'$\'.$atts[\'test\'] ) )) { // Correct?\n			return (*eval( \'$\'.$atts[\'test\'] ))?true:false;\n		} else { // Do std test\n			return (*eval($atts[\'test\']))?true:false;\n		}\n	}\n*/\n	if (isset($atts[\'plugin\'])) {\n		$plugin = $atts[\'plugin\'];\n		unset($atts[\'plugin\']);\n		if(!function_exists($plugin)) return false;\n		return $plugin($atts,true)?true:false;\n	}\n	return false;\n}','	$cond_array[\'gt\'] = \'>\';\n	$cond_array[\'gte\'] = \'>=\';\n	$cond_array[\'lt\'] = \'<\';\n	$cond_array[\'lte\'] = \'<=\';\n	$cond_array[\'eq\'] = \'==\';\n\nfunction ptv_condition($atts, $thing=\'\') {\n	$f = \'/<txp:(\\S+)\\b(.*)(?:(?<!br )(\\/))?\'.chr(62).\'(?(3)|(.+)<\\/txp:\\1>)/sU\';\n	preg_match_all($f, $thing, $matches, PREG_SET_ORDER);\n	foreach($matches as $match) {\n		$tag = $match[1];\n		$atts = (isset($match[2])) ? splat($match[2]) : \'\';\n		$thing = (isset($match[4])) ? $match[4] : \'\';\n		if (function_exists($tag)) {\n		  $result = $tag($atts,$thing,$match[0]);\n		  if($result) return $result;\n		}\n	}\n	return \'\';\n}\nfunction ptv_if($atts, $thing=\'\') {\n	return ptv_evaluate($atts)?$thing:\'\';\n}\nfunction ptv_else_if($atts, $thing=\'\') {\n	return ptv_evaluate($atts)?$thing:\'\';\n}\nfunction ptv_else($atts, $thing=\'\') {\n	return parse($thing);\n}\nfunction ptv_evaluate($atts) {\n	global $cond_array;\n	if(isset($atts[\'leftarg\']) && isset($atts[\'rightarg\']) && isset($atts[\'condition\'])) {\n		$statement = \'if(\'.$atts[\"leftarg\"].\' \'. $cond_array[$atts[\"condition\"]] .\' \'. $atts[\"rightarg\"].\') return true; else return false;\';\n		return eval($statement);\n	}\n/* On hold. Considering neccesity and argument implementation.\n	if (isset($atts[\'test\'])) {\n		if(*function_exists($atts[\'test\'])) {\n			return (*call_function($atts[\'test\']))?true:false;\n		} else if (isset( *eval( \'$\'.$atts[\'test\'] ) )) { // Correct?\n			return (*eval( \'$\'.$atts[\'test\'] ))?true:false;\n		} else { // Do std test\n			return (*eval($atts[\'test\']))?true:false;\n		}\n	}\n*/\n	if (isset($atts[\'plugin\'])) {\n		$plugin = $atts[\'plugin\'];\n		unset($atts[\'plugin\']);\n		if(!function_exists($plugin)) return false;\n		return $plugin($atts,true)?true:false;\n	}\n	return false;\n}','01cab1519a0c9a74f8465ca1c41ecd0a',0);
INSERT INTO txp_plugin VALUES ('ran_tags',0,'Ran Aroussi','http://aroussi.com/projects','0.2','Enables tagging in your TXP-powered blog.','\n	<h2>TXP Tags - Help</h2>\n	<p>\n		The installation process is pretty simple.\n		To install TXP_Tags on your blog, follow these simple steps:\n	</p>\n	<ol>\n		<li>\n			In your Textpatten admin, go to <b>admin -> preferences -> advanced preferences</b> and scroll down to <b>custom fields</b> section. \n			Create a custom field named <b>Tags</b> and save your changes.\n		</li>\n		<li>\n			Edit the plugin to let it know which custom field you\'re using. In the third line, you will see this line.<br />\n				<code>$tags_field = \'custom_1\'; // <--- YOUR CUSTOM FIELD!</code><br />\n				Change the <b><code>$tags_field</code></b> variable\'s value to custom_1, custom_2, and so on...\n		</li>\n		<li>\n			Create a new section named &lsquo;<b>tag</b>&rsquo;. I that section\'s page put the following tag:<br />\n			<code>&lt;txp:ran_tags_list_tag /&gt;</code>.<br />\n			This will automatically display either all tags or a list articles tagged with a specific tag, depending on the request.\n		</li>\n		<li>\n			In your forms that displays your articles, put this code:<br />\n			<code>&lt;txp:ran_tags_if_exists&gt;<br />&nbsp; &nbsp; &lt;txp:ran_tags_list_single /&gt;<br />&lt;/txp:ran_tags_if_exists&gt;</code>.<br />\n			This will list the article\'s tags.\n		</li>\n		<li>\n			Last but not least, wherever you want your list of tags to be displays, put this tag:<br />\n			<code>&lt;txp:ran_tags_list_all /&gt;</code>. <br />\n			NOTE: Place this code inside a <code>&lt;DIV&gt;</code>, and specify assign this DIV a the <b>minimum</b> font-size using CSS.\n			The plugin will use this value to calculate the font-size of each tag depending of its weight.\n		</li>\n	</ol>\n	<p>\n		That\'s it!. You\'re done! From now on, whenever you add or edit an article you will see a <b>Tags</b> textbox under \'adcanced options\' on the left-hand side.\n	</p>\n	<p>\n		<img src=\"http://aroussi.com/assets/downloads/tags_shot.png\" alt=\"\" />\n	</p>\n','\n// ---------------------------------------------------------------------\n// CHANGE THIS TO REFLECT YOUR CUSTOM FIELD FOR TAGS\n// ---------------------------------------------------------------------\nfunction ran_tags_field($atts) {\n	$tags_field = \'custom_1\'; // <--- YOUR CUSTOM FIELD!\n	return $tags_field;\n}\n\n// ---------------------------------------------------------------------\nfunction ran_tags_compact($atts) {\n	$i=0;\n	$tags = array(); \n	foreach (array_unique($atts) as $tag) {\n    $tags[$i] = $tag;\n    $i++;\n  }\n	return $tags;\n}\n\n// ---------------------------------------------------------------------\nfunction ran_tags_tag($atts) {\n	global $url_mode;\n	//extract($atts);\n	extract($_GET);\n\n	//extract($_SERVER);\n	//$tag =  ($url_mode==1) ? array_pop(explode(\'tag/\', trim($REQUEST_URI, \'/\'))) : trim($t);\n	$tag = $t;\n	\n	if ($capitalize) { $tag = ucfirst($tag); }\n	return $tag;\n}\n\n// ---------------------------------------------------------------------\nfunction ran_tags_list_tag($atts) {\n\n	extract($_GET);	\n	$tag = isset($t) ? trim($t) : false;\n	\n	if (!$tag) {\n		return \'<p>\' . ran_tags_list_all(0) . \'</p>\';\n	}\n\n	global $path_from_root, $siteurl, $c, $s, $url_mode, $pretext;\n	//extract($atts);\n	extract($pretext);\n	\n	$section = isset($section) ? $section : \"article\";\n	$dateformat = isset($dateformat) ? $dateformat : \"F j, Y\";\n	$subdateformat = isset($sbdateformat) ? $subdateformat : \"d\";\n\n	$tags_field = ran_tags_field(0);\n\n	$rs = safe_rows_start(\"id, title, authorid, unix_timestamp(posted) as posted, section, category1, category2, url_title, $tags_field\", \"textpattern\",\"$tags_field LIKE \'% $tag %\' OR $tags_field LIKE \'$tag %\' OR $tags_field LIKE \'% $tag\' OR $tags_field = \'$tag\' ORDER BY posted DESC\");\n\n	$return_str = \'<p>Listed below are articles tagged with &ldquo;<big>\' . ucfirst($tag) . \'</big>&rdquo;</p>\' . \"\n<dl>\";\n\n	if ($rs) {\n		$prev_month = \'\';\n		while ($a = nextRow($rs)) {\n			extract($a);\n			if ($prev_month != date(\'Ym\',$posted)) {\n				$return_str .= \'<dt>\' . date(\'F Y\',$posted) . \'</dt>\' . \"\n\";\n			}\n			$prev_month = date(\'Ym\',$posted);\n			$permalink = formatPermLink($id,$section);\n			$return_str .= \"<dd><span class=\\\"tagDate\\\">\" . date($subdateformat,$posted) . \": </span><a href=\\\"$permalink\\\">$title</a></dd>\n\";\n		}\n	}\n\n	return $return_str . \"\n</dl>\";\n}\n\n// ---------------------------------------------------------------------\nfunction ran_tags_if_exists($atts, $thing) {\n	global $thisarticle;\n	extract($thisarticle);\n\n	$tags_field = ran_tags_field(0);\n	$id = $thisid;\n\n	$rs = safe_row($tags_field, \"textpattern\", \"ID=\'$id\' AND $tags_field <> \'\'\");\n	$output = \"\";\n	if ($rs) {\n		$output = parse($thing);\n	}\n	return $output;\n}\n\n// ---------------------------------------------------------------------\nfunction ran_tags_list_single($atts) {\n\n	global $url_mode, $thisarticle, $pfr, $siteurl, $path_from_root;\n\n	//extract($atts);\n	extract($_SERVER);\n	extract($thisarticle);\n\n	$tags_field = ran_tags_field(0);\n	$id = $thisid;\n\n	$all_tags = array();\n	$rs = safe_row($tags_field, \"textpattern\", \"ID=\'$id\' AND $tags_field <> \'\'\");\n	$all_tags = explode(\" \", trim(strtolower($rs[$tags_field])));\n	sort($all_tags);\n	$all_tags = ran_tags_compact($all_tags);\n\n	$tags_html = \'\';\n	$url = \'http://\' . $siteurl . $path_from_root . \'tag\';\n	//$url .= ($url_mode==1) ? \'/\' : \'?t=\';\n	$url .= \'?t=\';\n\n	for($i=0; $i<count($all_tags); $i++) {\n		$tag_name = ($capitalize) ? ucfirst($all_tags[$i]) : $all_tags[$i];\n		$tags_html .= \'<a href=\"\' . $url . $all_tags[$i] . \'\">\' . $tag_name .\'</a>\';\n		if($i<count($all_tags)-1) $tags_html .= \", \";\n	}\n	return $tags_html;\n}\n\n// ---------------------------------------------------------------------\nfunction ran_tags_list_all($atts) {\n	global $url_mode, $prf, $siteurl, $path_from_root;\n	//extract($atts);\n	extract($_SERVER);\n	\n	$tags_field = ran_tags_field(0);\n\n	$all_tags = array();\n	$rs = safe_rows(\"$tags_field\", \"textpattern\", \"$tags_field <> \'\'\");\n	foreach ($rs as $row) {\n		$all_tags = array_merge($all_tags, explode(\" \", trim(strtolower($row[$tags_field]))));\n	}\n	sort($all_tags);\n\n	$tags_weight = array_count_values($all_tags);\n	$tags_unique = ran_tags_compact($all_tags);\n	\n	//get weight tags\n	$max = max($tags_weight);\n	$min = min($tags_weight);\n	$x = 200; $y = 100; // 200%, 100%\n	$stepvalue = ($max - $min) / ($x - $y);\n	\n	$tags_html = \'\';\n	$url = \'http://\' . $siteurl . $path_from_root . \'tag\';\n	//$url .= ($url_mode==1) ? \'/\' : \'?t=\';\n	$url .= \'?t=\';\n\n	for($i=0; $i<count($tags_unique); $i++) {\n		$no = $tags_unique[$i];\n		$tag_weight = $y + round(($tags_weight[$no]-$min) / $stepvalue);\n		if ($tag_weight > $y) {\n			$tag_weight = \' style=\"font-size:\'. $tag_weight . \'%;\"\';\n		} else {\n			$tag_weight = \'\';\n		}\n\n		$tag_name = ($capitalize) ? ucfirst($tags_unique[$i]) : $tags_unique[$i];\n		$tags_html .= \'<a href=\"\' . $url . $tags_unique[$i] . \'\"\' . $tag_weight . \'>\' . $tag_name .\'</a>\';\n		if($i<count($tags_unique)-1) $tags_html .= \", \";\n	}\n\n	return $tags_html;\n}\n','\n// ---------------------------------------------------------------------\n// CHANGE THIS TO REFLECT YOUR CUSTOM FIELD FOR TAGS\n// ---------------------------------------------------------------------\nfunction ran_tags_field($atts) {\n	$tags_field = \'custom_1\'; // <--- YOUR CUSTOM FIELD!\n	return $tags_field;\n}\n\n// ---------------------------------------------------------------------\nfunction ran_tags_compact($atts) {\n	$i=0;\n	$tags = array(); \n	foreach (array_unique($atts) as $tag) {\n    $tags[$i] = $tag;\n    $i++;\n  }\n	return $tags;\n}\n\n// ---------------------------------------------------------------------\nfunction ran_tags_tag($atts) {\n	global $url_mode;\n	//extract($atts);\n	extract($_GET);\n\n	//extract($_SERVER);\n	//$tag =  ($url_mode==1) ? array_pop(explode(\'tag/\', trim($REQUEST_URI, \'/\'))) : trim($t);\n	$tag = $t;\n	\n	if ($capitalize) { $tag = ucfirst($tag); }\n	return $tag;\n}\n\n// ---------------------------------------------------------------------\nfunction ran_tags_list_tag($atts) {\n\n	extract($_GET);	\n	$tag = isset($t) ? trim($t) : false;\n	\n	if (!$tag) {\n		return \'<p>\' . ran_tags_list_all(0) . \'</p>\';\n	}\n\n	global $path_from_root, $siteurl, $c, $s, $url_mode, $pretext;\n	//extract($atts);\n	extract($pretext);\n	\n	$section = isset($section) ? $section : \"article\";\n	$dateformat = isset($dateformat) ? $dateformat : \"F j, Y\";\n	$subdateformat = isset($sbdateformat) ? $subdateformat : \"d\";\n\n	$tags_field = ran_tags_field(0);\n\n	$rs = safe_rows_start(\"id, title, authorid, unix_timestamp(posted) as posted, section, category1, category2, url_title, $tags_field\", \"textpattern\",\"$tags_field LIKE \'% $tag %\' OR $tags_field LIKE \'$tag %\' OR $tags_field LIKE \'% $tag\' OR $tags_field = \'$tag\' ORDER BY posted DESC\");\n\n	$return_str = \'<p>Listed below are articles tagged with &ldquo;<big>\' . ucfirst($tag) . \'</big>&rdquo;</p>\' . \"\n<dl>\";\n\n	if ($rs) {\n		$prev_month = \'\';\n		while ($a = nextRow($rs)) {\n			extract($a);\n			if ($prev_month != date(\'Ym\',$posted)) {\n				$return_str .= \'<dt>\' . date(\'F Y\',$posted) . \'</dt>\' . \"\n\";\n			}\n			$prev_month = date(\'Ym\',$posted);\n			$permalink = formatPermLink($id,$section);\n			$return_str .= \"<dd><span class=\\\"tagDate\\\">\" . date($subdateformat,$posted) . \": </span><a href=\\\"$permalink\\\">$title</a></dd>\n\";\n		}\n	}\n\n	return $return_str . \"\n</dl>\";\n}\n\n// ---------------------------------------------------------------------\nfunction ran_tags_if_exists($atts, $thing) {\n	global $thisarticle;\n	extract($thisarticle);\n\n	$tags_field = ran_tags_field(0);\n	$id = $thisid;\n\n	$rs = safe_row($tags_field, \"textpattern\", \"ID=\'$id\' AND $tags_field <> \'\'\");\n	$output = \"\";\n	if ($rs) {\n		$output = parse($thing);\n	}\n	return $output;\n}\n\n// ---------------------------------------------------------------------\nfunction ran_tags_list_single($atts) {\n\n	global $url_mode, $thisarticle, $pfr, $siteurl, $path_from_root;\n\n	//extract($atts);\n	extract($_SERVER);\n	extract($thisarticle);\n\n	$tags_field = ran_tags_field(0);\n	$id = $thisid;\n\n	$all_tags = array();\n	$rs = safe_row($tags_field, \"textpattern\", \"ID=\'$id\' AND $tags_field <> \'\'\");\n	$all_tags = explode(\" \", trim(strtolower($rs[$tags_field])));\n	sort($all_tags);\n	$all_tags = ran_tags_compact($all_tags);\n\n	$tags_html = \'\';\n	$url = \'http://\' . $siteurl . $path_from_root . \'tag\';\n	//$url .= ($url_mode==1) ? \'/\' : \'?t=\';\n	$url .= \'?t=\';\n\n	for($i=0; $i<count($all_tags); $i++) {\n		$tag_name = ($capitalize) ? ucfirst($all_tags[$i]) : $all_tags[$i];\n		$tags_html .= \'<a href=\"\' . $url . $all_tags[$i] . \'\">\' . $tag_name .\'</a>\';\n		if($i<count($all_tags)-1) $tags_html .= \", \";\n	}\n	return $tags_html;\n}\n\n// ---------------------------------------------------------------------\nfunction ran_tags_list_all($atts) {\n	global $url_mode, $prf, $siteurl, $path_from_root;\n	//extract($atts);\n	extract($_SERVER);\n	\n	$tags_field = ran_tags_field(0);\n\n	$all_tags = array();\n	$rs = safe_rows(\"$tags_field\", \"textpattern\", \"$tags_field <> \'\'\");\n	foreach ($rs as $row) {\n		$all_tags = array_merge($all_tags, explode(\" \", trim(strtolower($row[$tags_field]))));\n	}\n	sort($all_tags);\n\n	$tags_weight = array_count_values($all_tags);\n	$tags_unique = ran_tags_compact($all_tags);\n	\n	//get weight tags\n	$max = max($tags_weight);\n	$min = min($tags_weight);\n	$x = 200; $y = 100; // 200%, 100%\n	$stepvalue = ($max - $min) / ($x - $y);\n	\n	$tags_html = \'\';\n	$url = \'http://\' . $siteurl . $path_from_root . \'tag\';\n	//$url .= ($url_mode==1) ? \'/\' : \'?t=\';\n	$url .= \'?t=\';\n\n	for($i=0; $i<count($tags_unique); $i++) {\n		$no = $tags_unique[$i];\n		$tag_weight = $y + round(($tags_weight[$no]-$min) / $stepvalue);\n		if ($tag_weight > $y) {\n			$tag_weight = \' style=\"font-size:\'. $tag_weight . \'%;\"\';\n		} else {\n			$tag_weight = \'\';\n		}\n\n		$tag_name = ($capitalize) ? ucfirst($tags_unique[$i]) : $tags_unique[$i];\n		$tags_html .= \'<a href=\"\' . $url . $tags_unique[$i] . \'\"\' . $tag_weight . \'>\' . $tag_name .\'</a>\';\n		if($i<count($tags_unique)-1) $tags_html .= \", \";\n	}\n\n	return $tags_html;\n}\n','bad5ed90b985b94ed8030049eb3b4039',0);
INSERT INTO txp_plugin VALUES ('rss_suparchive',0,'Rob Sable','http://www.wilshireone.com/','0.16.1','Article listings by date or by category/section<br/>Archive menu by month or year with totals','\n	<p><hr><br />\n<a href=\"http://www.wilshireone.com/textpattern-plugins/rss-suparchive\">Latest Documentation</a><br />\n<hr><br />\nThe <a href=\"#rss_suparchive\">rss_suparchive</a> is used to generate an article listing grouped by date.  The overall structure used for the archive is the XHTML Definition List (<code>&amp;lt;dl&amp;gt;</code>, <code>&amp;lt;dt&amp;gt;</code> and <code>&amp;lt;dd&amp;gt;</code> tags).  Entries will be grouped by date under the <code>&amp;lt;dt&amp;gt;</code> tag.  The plugin supports multiple sections and can output links to the section and categories of a particular article.  The archive can be filtered by day, month or year by generating URLs in the format /yourarchivesection/yyyy/mm/dd or /yourarchivesection/yyyy/mm or /yourarchivesection/yyyy, which is done by using the rss_suparchive_menu tag or the rss_posted plugin.<br />\nThe <a href=\"#rss_suparchive_bycat\">rss_suparchive_bycat</a> is used to generate an article listing grouped by category and optionally by section in the form of an unordered list.  It can also be used to generate related article listings.  The archive can be filtered by day, month or year by generating URLs in the format /yourarchivesection/yyyy/mm/dd or /yourarchivesection/yyyy/mm or /yourarchivesection/yyyy, which is done by using the rss_suparchive_menu tag or the rss_posted plugin.<br />\nThe <a href=\"#rss_suparchive_menu\">rss_suparchive_menu</a> is used to generate an unordered list that displays x number of months and the number os posts per month.  It is used to link to an archive page filtered by month.<br />\n<hr></p>\n\n	<h1 id=\"rss_suparchive\">rss_suparchive</h1>\n\n	<p><strong>section</strong><br />\nAccepts a comma separated list of sections.  NO spaces after commas.<br />\nDefault:  &#8220;article&#8221;<br />\nExample: section=&#8221;sectionOne,sectionTwo&#8221;</p>\n\n	<p><strong>category</strong><br />\nAccepts a comma separated list of categories.  NO spaces after commas.  If currently browsing by category, the global category will be used as the default.<br />\nDefault:  &#8221;$c (global category)&#8221;<br />\nExample: categories=&#8221;catOne,catTwo&#8221;</p>\n\n	<p><strong>author</strong><br />\nAccepts a comma separate list of author ids. NO spaces. Also looks for a query string parameter named &#8220;author&#8221; if no author is set in the tag. (i.e, /?author=rob)<br />\nDefault: &#8220;&#8221;<br />\nExample: author=&#8221;rob,joe,jason&#8221;</p>\n\n	<p><strong>timeframe</strong><br />\nAccepts one of 3 options &#8220;PAST&#8221;, &#8220;FUTURE&#8221; or &#8220;ALL&#8221;.  By default (PAST) will display articles with a posted date before the current date/time.<br />\nSelecting FUTURE will display articles with a posted date after the current date/time.  Selecting ALL will display all articles regardless of posted date.<br />\nDefault:  &#8220;PAST&#8221;<br />\nExample: timeframe=&#8221;FUTURE&#8221;</p>\n\n	<p><strong>form</strong><br />\nUses the form to format the results.  When using a form, section, category, author and limit are the only other properties that can be used.  Paging using the newer and older tags is supported.<br />\nDefault:  &#8220;&#8221;<br />\nExample: form=&#8221;lofi&#8221;</p>\n\n	<p><strong>dateformat</strong><br />\nAccepts <a href=\"http://www.php.net/date\"><acronym title=\"PHP: Hypertext Preprocessor\">PHP</acronym> date format</a>.<br />\nDefault:  &#8220;F j, Y&#8221;<br />\nExample: dateformat=&#8221;j/m/Y&#8221;</p>\n\n	<p><strong>class</strong><br />\nAssigns a <acronym title=\"Cascading Style Sheets\">CSS</acronym> class to the <code>&amp;lt;dl&amp;gt;</code> tag.<br />\nDefault:  &#8220;&#8221;<br />\nExample: class=&#8221;classname&#8221;</p>\n\n	<p><strong>showsection</strong><br />\nDisplays a link to the section the article appears in.<br />\nDefault:  &#8220;0&#8221;<br />\nExample: showsection=&#8221;1&#8221;</p>\n\n	<p><strong>showcats</strong><br />\nDisplays a link to the categories the article appears in.<br />\nDefault:  &#8220;0&#8221;<br />\nExample: showcats=&#8221;1&#8221;</p>\n\n	<p><strong>showauthor</strong><br />\nDisplays a link to the current section filtered by the author of the current article.<br />\nDefault: &#8220;0&#8221;<br />\nExample: showauthor=&#8221;1&#8221;</p>\n\n	<p><strong>showexcerpt</strong><br />\nDisplays the excerpt of the article.<br />\nDefault: &#8220;0&#8221;<br />\nExample: showexcerpt=&#8221;1&#8221;</p>\n\n	<p><strong>secstart</strong><br />\nPlaces the given text before the section link.<br />\nDefault:  &#8220;in&#8221;<br />\nExample: secstart=&#8221;Posted In:&#8221;</p>\n\n	<p><strong>catstart</strong><br />\nPlaces the given text before the category links.<br />\nDefault:  &#8220;under&#8221;<br />\nExample: catstart=&#8221;Under:&#8221;</p>\n\n	<p><strong>catsep</strong><br />\nPlaces the given text in between the category links if there is more than one.<br />\nDefault:  &#8220;and&#8221;<br />\nExample: catsep=&#8221;::&#8221;</p>\n\n	<p><strong>authorsep</strong><br />\nPlaces the given text before the author link.<br />\nDefault: &#8220;by&#8221;<br />\nExample: authorsep=&#8221;posted by&#8221;</p>\n\n	<p><strong>addbreak</strong><br />\nAdds an HTML line break after the article link.<br />\nDefault:  &#8220;0&#8221;<br />\nExample: addbreak=&#8221;1&#8221;</p>\n\n	<p><strong>showsubdate</strong><br />\nDisplays a date preceeding the article title.<br />\nDefault:  &#8220;0&#8221;<br />\nExample: showsubdate=&#8221;1&#8221;</p>\n\n	<p><strong>subdateformat</strong><br />\nAccepts <a href=\"http://www.php.net/date\"><acronym title=\"PHP: Hypertext Preprocessor\">PHP</acronym> date format</a>.<br />\nDefault:  &#8220;d&#8221;<br />\nExample: subdateformat=&#8221;d, Y&#8221;</p>\n\n	<p><strong>subdatesep</strong><br />\nPlaces the given text in between the subdate and the article title.<br />\nDefault:  &#8221;: &#8221;<br />\nExample: subdatesep=&#8221; &#8211; &#8221;</p>\n\n	<p><strong>limit</strong><br />\nLimits the number of articles listed.  When in forms mode, limits the number of articles per page.<br />\nDefault:  &#8220;&#8221;<br />\nExample: limit=&#8221;5&#8221;</p>\n\n	<p><strong>sortby</strong><br />\nDetermines how the result list is sorted.  Sorted by DATE by default based on the timeframe selected. &#8220;RANDOM&#8221; is the only other option.<br />\nDefault:  &#8220;&#8221;<br />\nExample: sortyby=&#8221;RANDOM&#8221;</p>\n\n	<p><strong>offset</strong><br />\nExcludes x number of articles from the beginning of the article listing.<br />\nDefault:  &#8220;&#8221;<br />\nExample: offset=&#8221;1&#8221;</p>\n\n	<p>Some additional conveniences built into the tag include:</p>\n\n	<ul>\n	<li>inclusion of title attributes on the link tags</li>\n		<li>the addition of a class named <em>rssArticle</em> to the article link</li>\n		<li>the addition of a class named <em>rssAlt</em> to every other article link to allow for use of a flip/flop effect</li>\n		<li>the addition of a class named <em>rssAuthor</em> to the author name</li>\n		<li>the addition of a class named <em>rssSubdate</em> to the subdate</li>\n		<li>the addition of a class named <em>rssSection</em> to the section link</li>\n		<li>the addition of a class named <em>rssCat</em> to the category links</li>\n	</ul>\n\n	<p><hr></p>\n\n	<h1 id=\"rss_suparchive_bycat\">rss_suparchive_bycat</h1>\n\n	<p><strong>NOTE:</strong> If a global category is set the listing will be filtered by that category.</p>\n\n	<p><strong>section</strong><br />\nAccepts a comma separated list of sections.  NO spaces after commas.<br />\nDefault:  &#8220;article&#8221;<br />\nExample: section=&#8221;sectionOne,sectionTwo&#8221;</p>\n\n	<p><strong>timeframe</strong><br />\nAccepts one of 3 options &#8220;PAST&#8221;, &#8220;FUTURE&#8221; or &#8220;ALL&#8221;.  By default (PAST) will display articles with a posted date before the current date/time.<br />\nSelecting FUTURE will display articles with a posted date after the current date/time.  Selecting ALL will display all articles regardless of posted date.<br />\nDefault:  &#8220;PAST&#8221;<br />\nExample: timeframe=&#8221;FUTURE&#8221;</p>\n\n	<p><strong>form</strong><br />\nUses the form to format the results. Paging using the newer and older tags is supported.<br />\nDefault:  &#8220;&#8221;<br />\nExample: form=&#8221;lofi&#8221;</p>\n\n	<p><strong>formwraptag</strong><br />\nThis tag will wrap the output of each individual form used in the listing.<br />\nDefault:  &#8220;&#8221;<br />\nExample: formwraptag=&#8221;ul&#8221;</p>\n\n	<p><strong>addbreak</strong><br />\nAdds an HTML line break after the article link.<br />\nDefault:  &#8220;0&#8221;<br />\nExample: addbreak=&#8221;1&#8221;</p>\n\n	<p><strong>showdate</strong><br />\nDisplays a date after the article title.<br />\nDefault:  &#8220;0&#8221;<br />\nExample: showdate=&#8221;1&#8221;</p>\n\n	<p><strong>dateformat</strong><br />\nAccepts <a href=\"http://www.php.net/date\"><acronym title=\"PHP: Hypertext Preprocessor\">PHP</acronym> date format</a>.<br />\nDefault:  F j, Y&#8221;<br />\nExample: dateformat=&#8221;j F Y&#8221;</p>\n\n	<p><strong>datesep</strong><br />\nPlaces the given text in between the date and the article title.<br />\nDefault:  &#8221; &raquo; &#8221;<br />\nExample: datesep=&#8221; &raquo; &#8221;</p>\n\n	<p><strong>showauthor</strong><br />\nDisplays the article authors name after the title (and date if applicable).<br />\nDefault: &#8220;0&#8221;<br />\nExample: showauthor=&#8221;1&#8221;</p>\n\n	<p><strong>authorsep</strong><br />\nPlaces the given text before the author name.<br />\nDefault: &#8220;by&#8221;<br />\nExample: authorsep=&#8221;by &#8221;</p>\n\n	<p><strong>showexcerpt</strong><br />\nDisplays the excerpt of the article.<br />\nDefault: &#8220;0&#8221;<br />\nExample: showexcerpt=&#8221;1&#8221;</p>\n\n	<p><strong>showheader</strong><br />\nDisplays the header label for the article listing.<br />\nDefault: &#8220;0&#8221;<br />\nExample: showheader=&#8221;1&#8221;</p>\n\n	<p><strong>headerlabel</strong><br />\nThe header text.<br />\nDefault: &#8220;Articles By Category:&#8221;<br />\nExample: headerlabel=&#8221;Category Archive&#8221;</p>\n\n	<p><strong>showmenu</strong><br />\nShows an unordered list of categories being listed with built in anchor links.<br />\nDefault: &#8220;0&#8221;<br />\nExample: showmenu=&#8221;1&#8221;</p>\n\n	<p><strong>showcats</strong><br />\nShows category name headers.<br />\nDefault: &#8220;1&#8221;<br />\nExample: showcats=&#8221;0&#8221;</p>\n\n	<p><strong>showcatsonly</strong><br />\nShows category name headers without article links below to be used as a category menu.<br />\nDefault: &#8220;0&#8221;<br />\nExample: showcatsonly=&#8221;1&#8221;</p>\n\n	<p><strong>linktosection</strong><br />\nDenotes the section that the category headers will link to when the URL is built.<br />\nDefault: &#8220;&#8221;<br />\nExample: linktosection=&#8221;archive&#8221;</p>\n\n	<p><strong>showcatcount</strong><br />\nShows the article count within the category next to the category name.<br />\nDefault: &#8220;1&#8221;<br />\nExample: showcatcount=&#8221;0&#8221;</p>\n\n	<p><strong>showsections</strong><br />\nShows the section name headers<br />\nDefault: &#8220;0&#8221;<br />\nExample: showsections=&#8221;1&#8221;</p>\n\n	<p><strong>showsectioncount</strong><br />\nShows the article count within the section next to the section name.<br />\nDefault: &#8220;0&#8221;<br />\nExample: showsectioncount=&#8221;1&#8221;</p>\n\n	<p><strong>showjump</strong><br />\nDisplays a jump back to top link below each category grouping.<br />\nDefault: &#8220;0&#8221;<br />\nExample: showjump=&#8221;1&#8221;</p>\n\n	<p><strong>jumplabel</strong><br />\nThe text of the jump back to top link.<br />\nDefault: &#8221;^ back to top&#8221;<br />\nExample: jumplabel=&#8221;Back To Top&#8221;</p>\n\n	<p><strong>useartcat1</strong><br />\nIf an article id is in the current page scope, the listing will be filtered by Category1 of that article. Can be used for a related articles listing.<br />\nDefault: &#8220;0&#8221;<br />\nExample: useartcat1=&#8221;1&#8221;</p>\n\n	<p><strong>useartcat2</strong><br />\nIf an article id is in the current page scope, the listing will be filtered by Category2 of that article. Can be used for a related articles listing.<br />\nDefault: &#8220;0&#8221;<br />\nExample: useartcat2=&#8221;1&#8221;</p>\n\n	<p><strong>useartcats</strong><br />\nIf an article id is in the current page scope, the listing will be filtered by Category1 or Category2 of that article. Can be used for a related articles listing.<br />\nDefault: &#8220;0&#8221;<br />\nExample: useartcats=&#8221;1&#8221;</p>\n\n	<p><strong>limit</strong><br />\nLimits the number of articles displayed.<br />\nDefault: &#8220;&#8221;<br />\nExample: limit=&#8221;10&#8221;</p>\n\n	<p><hr></p>\n\n	<h1 id=\"rss_suparchive_menu\">rss_suparchive_menu</h1>\n\n	<p><strong>mode</strong><br />\nAccepts one of 2 options &#8220;MONTH&#8221; or &#8220;YEAR&#8221;.  By default (MONTH) will display a list of months and the number of posts in each with a URL of /yourarchive/yyyy/mm.<br />\nSelecting &#8220;YEAR&#8221; will display a list of years and the number of posts in each with a URL of /yourarchive/yyyy.<br />\nDefault:  &#8220;PAST&#8221;<br />\nExample: timeframe=&#8221;FUTURE&#8221;</p>\n\n	<p><strong>section</strong><br />\nAccepts a comma separated list of sections that posts are listed from.  NO spaces after commas.<br />\nDefault:  &#8220;article&#8221;<br />\nExample: section=&#8221;sectionOne,sectionTwo&#8221;</p>\n\n	<p><strong>linktosection</strong><br />\nDenotes the section that the months will link to when the URL is built.<br />\nDefault: &#8221;$s (current global section)&#8221;<br />\nExample: linktosection=&#8221;archive&#8221;</p>\n\n	<p><strong>timeframe</strong><br />\nAccepts one of 3 options &#8220;PAST&#8221;, &#8220;FUTURE&#8221; or &#8220;ALL&#8221;.  By default (PAST) will display articles with a posted date before the current date/time.<br />\nSelecting FUTURE will display articles with a posted date after the current date/time.  Selecting ALL will display all articles regardless of posted date.<br />\nDefault:  &#8220;PAST&#8221;<br />\nExample: timeframe=&#8221;FUTURE&#8221;</p>\n\n	<p><strong>limit</strong><br />\nThe number of months that will be shown in the listing.<br />\nDefault: &#8220;6&#8221;<br />\nExample: limit=&#8221;3&#8221;</p>\n\n	<p><strong>showcount</strong><br />\nShows the number of articles posted in a month next to the name of the month.<br />\nDefault: &#8220;1&#8221;<br />\nExample: showcount=&#8221;0&#8221;</p>\n\n	<p><strong>showheader</strong><br />\nShows an XHTML heading tag (<hn>) above the month list.<br />\nDefault: &#8220;0&#8221;<br />\nExample: showheader=&#8221;1&#8221;</p>\n\n	<p><strong>headerlabel</strong><br />\nThe text that appears within the header tags.<br />\nDefault: &#8220;Monthly Archives&#8221;<br />\nExample: headerlabel=&#8221;Posts By Date&#8221;</p>\n\n	<p><strong>headerlevel</strong><br />\nThe XHTML heading tag level (1,2,3,4,5 or 6).<br />\nDefault: &#8220;2&#8221;<br />\nExample: headerlevel=&#8221;3&#8221;</p>\n\n	<p>Some additional conveniences built into the tag include:</p>\n\n	<ul>\n	<li>the addition of an class named <em>rssMenu</em> to the ul tag</li>\n		<li>the addition of a class named <em>rssMonthCount</em> to the monthly post totals</li>\n	</ul>\n\n	<p><hr></p>\n\n	<p>See Usage Examples At <a href=\"http://www.wilshireone.com/lab\">wilshire | one</a></p>\n\n	<p><hr></p>\n\n\n\n ','\n// rss_suparchive article listing plugin\n// by Rob Sable\n// http://www.wilshireone.com\n// Version 0.1   - 11/02/2004\n// Full revision history at http://www.wilshireone.com/textpattern-plugins/rss-suparchive\n// Version 0.14 -  03/29/2005 - Added form to suparchive_bycat.  Added filtering by day in addition to year and month to rss_suparchive.  Fixed timeframe filter.  Permlink/forms updates.\n// Version 0.15 -  05/01/2005 - Added formwraptag, addbreak, showdate, dateformat, datesep, showexcerpt, showauthor, authorsep and date filtering to suparchive_bycat.  Fixed jump to link on suparchive_bycat. Current article removed from related list using suparchive_bycat.  Fixes for form usage on suparchive_bycat.  Changed rssMenu id to a class.\n// Version 0.16 -  01/03/2005 - Made archive filtering by date compatible with TXP 404 handling.\n// Version 0.16.1 - 01/09/2006 - Fix broken file downloads.  Fix inadvertent date filtering on article pages.\n\nregister_callback(\'rss_suparchive_init\',\'pretext\');\n\nfunction rss_suparchive_init() {\n	global $attach_titles_to_permalinks;\n	$subpath = preg_quote(preg_replace(\"/http:\\/\\/.*(\\/.*)/Ui\",\"$1\",hu),\"/\");\n	$req = preg_replace(\"/^$subpath/i\",\"/\",serverSet(\'REQUEST_URI\'));\n	extract(chopUrl($req));\n\n	$f = safe_field(\'title\',\'txp_section\',\"name=\'\".doSlash($u1).\"\'\");\n	if (!empty($f)) {\n		if ($u2 && is_numeric($u2)) $_POST[\'s\'] = $u1;\n		if (($u3 && !is_numeric($u3)) || (!$attach_titles_to_permalinks && !$u3)) $_POST[\'id\'] = $u2;\n	}\n}\n\nfunction rss_suparchive_menu($atts) {\n  global $s, $pretext;\n  extract($atts);\n  extract($pretext);\n\n  $section = isset($section) ? $section : \"article\";\n  $linktosection = isset($linktosection) ? $linktosection : $s;\n  $timeframe= isset($timeframe) ? $timeframe: \"PAST\";\n  $limit = isset($limit) ? $limit : 6;\n  $showheader = isset($showheader) ? $showheader : \"0\";\n  $headerlabel = isset($headerlabel) ? $headerlabel : \"Monthly Archives\";\n  $headerlevel = isset($headerlevel) ? $headerlevel : \"2\";\n  $showcount = isset($showcount) ? $showcount : \"1\";\n  $countlabel = isset($countlabel) ? $countlabel : \"\";\n  $mode = isset($mode) ? $mode : \"MONTH\";\n\n  foreach (explode(\',\', $section) as $section) {\n    $sctsql[] = \" (section = \'\" . doSlash($section) . \"\') \";\n  }\n  $sections = \' AND (\' . join(\' OR \', $sctsql) . \') \';\n\n  $posted= ($timeframe == \"FUTURE\") ? \" AND Posted >= now() ORDER BY posted asc \" : \" AND posted < now() ORDER BY posted desc \";\n  $posted= isset($posted) ? $posted : \" ORDER BY posted desc \";\n\n  $where = \"status=4 $sections $posted\";\n  $res = safe_rows(\"id, unix_timestamp(posted) as posted\",\"textpattern\", $where);\n\n  if( $res ) {\n    $dateformat = ($mode == \"YEAR\") ? \"%Y\" : \"%B %Y\";\n    $c=-1; $p=0; $lasto=\"\";\n    $lastd = safe_strftime($dateformat,$res[0][\"posted\"]);\n    $output[] = ($showheader) ? \'<h\' .$headerlevel. \'>\' .$headerlabel. \'</h\' .$headerlevel. \'>\'.n : \'\';\n    $output[] = \'<ul class=\"rssMenu\">\'.n;\n    foreach( $res as $a ) {\n        $date = safe_strftime($dateformat,$a[\"posted\"]);\n        $datelink = ($mode == \"YEAR\") ? \"/\".safe_strftime(\'%Y\',$lasto) : \"/\".safe_strftime(\'%Y\',$lasto).\"/\".safe_strftime(\'%m\',$lasto);\n        $c++;\n        $count = ($showcount) ? \' <span class=\"rssMonthCount\">(\'.$c.$countlabel.\')</span>\' : \'\';\n        $output[] = ($lastd != $date && $p <= ($limit-1)) ? \'<li><a href=\"\'.hu.$linktosection.$datelink.\'\">\'.$lastd.$count.\'</a></li>\'.n : \"\";\n        if ($p <= ($limit-1)) {\n          if ($lastd != $date) { $c=0; $p++; };\n          $lastd = $date;\n          $lasto = $a[\"posted\"];\n        }\n    }\n    $datelink = ($mode == \"YEAR\") ? \"/\".safe_strftime(\'%Y\',$lasto) : \"/\".safe_strftime(\'%Y\',$lasto).\"/\".safe_strftime(\'%m\',$lasto);\n    $count = ($showcount) ? \' <span class=\"rssMonthCount\">(\'.($c+1).$countlabel.\')</span>\' : \'\';\n    $output[] = ($p <= ($limit-1)) ? \'<li><a href=\"\'.hu.$linktosection.$datelink.\'\">\'.$lastd.$count.\'</a></li>\'.n : \'\';\n    $output[] = \'</ul>\'.n.n;\n    return  implode( \"\", $output);\n  }\n      return;\n}\n\nfunction rss_suparchive($atts) {\n\nglobal $siteurl, $c, $s, $url_mode, $pretext, $thisarticle;\nextract($atts);\nextract($pretext);\n\n$section = isset($section) ? $section : \"article\";\n\nif (isset($category)) { $category = doSlash($category); }\nelse { $category = isset($nocatfilter) ? \"\" : $c ; }\n$author = isset($author) ? $author : gps(\'author\');\n$dateformat = isset($dateformat) ? $dateformat : \"F j, Y\";\n$showsection = isset($showsection) ? $showsection: \"0\";\n$showcats= isset($showcats) ? $showcats: \"0\";\n$showauthor= isset($showauthor) ? $showauthor: \"0\";\n$showexcerpt= isset($showexcerpt) ? $showexcerpt: \"0\";\n$secstart= isset($secstart) ? $secstart: \"in\";\n$catstart= isset($catstart) ? $catstart: \"under\";\n$catsep= isset($catsep) ? $catsep: \"and\";\n$authorsep= isset($authorsep) ? $authorsep: \"by\";\n$addbreak = isset($addbreak) ? $addbreak : \"0\";\n$showsubdate = isset($showsubdate) ? $showsubdate: \"0\";\n$subdateformat = isset($subdateformat) ? $subdateformat : \"d\";\n$subdatesep= isset($subdatesep) ? $subdatesep : \": \";\n$limit= isset($limit) ? $limit : \"999999999\";\n$form= isset($form) ? $form : \"\";\n$sortby= isset($sortby) ? $sortby : \"\";\n$timeframe= isset($timeframe) ? $timeframe : \"PAST\";\n\nforeach (explode(\',\', $section) as $section) {\n  $sctsql[] = \" (section = \'\" . doSlash($section) . \"\') \";\n}\n$sections = \' AND (\' . join(\' OR \', $sctsql) . \') \';\n\nforeach (explode(\',\', $category) as $category) {\n  if ($category) $catsql[] = \" (category1 = \'\" . urldecode($category) . \"\') OR (category2 = \'\" . urldecode($category) . \"\')  \";\n}\n$categories= isset($catsql) ? \' AND (\' . join(\' OR \', $catsql) . \') \' : \"\";\n\nforeach (explode(\',\', $author) as $author) {\n  if ($author) $authsql[] = \" (authorid = \'\" . $author . \"\') \";\n}\n$authors= isset($authsql) ? \' AND (\' . join(\' OR \', $authsql) . \') \' : \"\";\n\n$offsetsql= isset($offset) ? \'LIMIT \'.$offset.\',9999999999\' : \"\";\n\nswitch ($timeframe) {\n  case \"FUTURE\":\n     $posted = \" AND posted >= now() \";\n     break;\n  case \"PAST\":\n     $posted = \" AND posted < now() \";\n     break;\n  case \"ALL\":\n     $posted = \"\";\n     break;\n  case \"RECENT\":\n    $posted = \" AND posted <= FROM_UNIXTIME(\".$prev_posted.\")\";\n     break;\n  case \"LATER\":\n    $posted = \" AND posted >= FROM_UNIXTIME(\".$next_posted.\")\";\n     break;\n  default:\n    $posted = \"\";\n}\n\n$orderby= ($timeframe == \"FUTURE\") ? \" ORDER BY posted asc \" : \" ORDER BY posted desc \";\n$orderby= ($sortby == \"RANDOM\") ? \" ORDER BY rand() \" : $orderby ;\n\n$subpath = preg_quote(preg_replace(\"/http:\\/\\/.*(\\/.*)/Ui\",\"$1\",hu),\"/\");\n$req = preg_replace(\"/^$subpath/i\",\"/\",serverSet(\'REQUEST_URI\'));\nextract(chopUrl($req));\n\n$showY = ($u2 != \"\") ? $u2.\"-\" : \"\";\n$showM = ($u3 != \"\") ? $u3.\"-\" : \"\";\n$showD = ($u4 != \"\") ? $u4 : \"\";\n\nif ($showY && is_numeric($u2) && !$thisarticle) $posted = \" AND Posted LIKE \'\".$showY.$showM.$showD.\"%\' \";\n\n$where = \"status=4 $sections $categories $authors $posted $orderby $offsetsql\";\n\nif ($form) {\n  // PAGING INFO\n  $total = getCount(\"textpattern\", $where);\n  $numPages = ($total > 0 && $limit) ? ceil($total/$limit) : 1;\n  $pg = (!$pg) ? 1 : $pg;\n  $offset = ($pg - 1) * $limit;\n\n  $pageout[\'pg\']        = $pg;\n  $pageout[\'numPages\']  = $numPages;\n  $pageout[\'s\']         = $s;\n  $pageout[\'c\']         = $c;\n\n  $GLOBALS[\'thispage\'] = $pageout;\n\n  $res = safe_rows(\"*, unix_timestamp(Posted) as uPosted\", \"textpattern\", $where.\" LIMIT \".$offset.\",\".$limit);\n\n  if ($res) {\n    foreach($res as $a) {\n      extract($a);\n      populateArticleData($a);\n      $article = fetch(\'Form\', \'txp_form\', \'name\', $form);\n      $articles[] = parse($article);\n      // FOR PAGING\n      $GLOBALS[\'uPosted\'] = $uPosted;\n      $G