? 1 : $pg;\n				$offset = ($pg - 1) * $limit;\n\n				$pageout[\'pg\']        = $pg;\n				$pageout[\'numPages\']  = $numPages;\n				$pageout[\'s\']         = $s;\n				$pageout[\'c\']         = $c;\n\n				$GLOBALS[\'thispage\'] = $pageout;\n\n				$frmWhere = $scsql.\" LIMIT \".$offset.\",\".$limit;\n				$res = safe_rows(\"*, unix_timestamp(Posted) as uPosted\", \"textpattern\", $frmWhere);\n\n				if ($res) {\n					foreach($res as $b) {\n						extract($b);\n						populateArticleData($b);\n						$article = fetch(\'Form\', \'txp_form\', \'name\', $form);\n						$articles[] = parse($article);\n						// FOR PAGING\n						$GLOBALS[\'uPosted\'] = $uPosted;\n						$GLOBALS[\'limit\'] = $limit;\n						unset($GLOBALS[\'thisarticle\']);\n					}\n				}\n        $out[] = ($formwraptag) ? tag(join(\'\',$articles), $formwraptag) : join(\'\',$articles);\n        unset($articles);\n    }\n\n    if (!$form) {\n			if ($limit) $scsql.= \" LIMIT $limit\";\n			$rs3 = safe_rows(\"*, unix_timestamp(Posted) as uPosted, ID, title, authorid, unix_timestamp(posted) as posted, section, category1, category2, url_title\",\"textpattern\", $scsql);\n			$lasts = \"\";\n		}\n\n    if ($rs3 && !$showcatsonly && !$form) {\n      $out[] = \'<ul>\'.n;\n      foreach($rs3 as $d) {\n        $aid= $d[\"ID\"];\n        $asection= $d[\"section\"];\n\n        $title = ($d[\"url_title\"]) ? $d[\"url_title\"]: stripSpace($d[\"title\"]);\n        $title = ($url_mode) ? $title : \'\';\n        $showtitle = $d[\"title\"];\n        $postdate = date($dateformat,$d[\"posted\"]);\n				$author = $d[\"authorid\"];\n				$excerpt = $d[\"excerpt\"];\n\n				$authres = safe_row(\"realname\",\"txp_users\", \"name=\'$author\'\");\n				$arealname = $authres[\"realname\"];\n\n        $permlink = permlinkurl($d);\n\n        if ($lasts != $asection && $showsections) {\n          $sctcnt = ($showsectioncount) ? \" (\".count($rs3).\")\" : \"\";\n          $out[] = \'<li><div class=\"rssCsec\">in <a href=\"\'.hu.$asection.\'/?c=\'.$catname.\'\" title=\"View articles filed under \'.$catname.\' in \'.$asection.\'\">\'.$asection.\'</a>\'.$sctcnt.\'</div></li>\'.n;\n          $cnt = 1;\n        }\n\n        $out[] = \'<li class=\"rssCart\">\';\n        $out[] = \'<a href=\"\'.$permlink.\'\" title=\"Permanent link to \'.$showtitle.\'\">\'.$showtitle.\'</a>\';\n				$out[] = ($addbreak) ? \"<br/>\" : \"\";\n		    $out[] = ($showauthor) ? $authorsep.$arealname : \"\";\n				$out[] = ($showdate) ? \'<span class=\"rssSubdate\">\'.$datesep.$postdate.\'</span>\' : \'\';\n				$out[] = ($showexcerpt) ? \"<br/>$excerpt\" : \"\";\n\n				$out[] = \'</li>\'.n;\n\n        $cnt++;\n        $lasts = $asection;\n      }\n      $out[] = \'</ul>\'.n;\n      $out[] = ($showjump) ? \'<div class=\"rssJump\"><a href=\"#rssCatArchive\">\'. $jumplabel .\'</a></div>\' : \'\';\n    }\n  }\n	$out[] = ($showcatsonly && !$form) ? \'</ul>\' : \'\';\n	$out[] = (!$form) ? n.\'</div>\'.n.\'</div>\'.n : \'\';\n}\nreturn ($out) ? implode(\'\', $out) : \'\';\n}\n','c44d35a88462e3eea3ae4f470ff897c6',0);
INSERT INTO txp_plugin VALUES ('dru_random_text',1,'Drew McLellan','http://allinthehead.com','0.1','Displays text at random (from database or file)','\n\n	<p>Grabs a random text string from either a database table or a text file.</p>\n	\n	<p><strong>From file:</strong><br />\n	Upload a text file to your site containing the items to be picked from.\n	You can specify your own delimiter, but the default is one item per line \n	(omit the delimited attribute for one-per-line).  \n	Set the source to \"file\" and the path to the full path to your file.\n	</p>\n	<p>\n	    <code><txp:dru_random_text source=\"file\" path=\"/path/to/text/file\" delimiter=\"|\" /></code>\n	</p>\n	\n	<p><strong>From database table:</strong><br />\n	The plugin will pick a named column from a random row in a named table. \n	The table needs to be in the same database that TXP is using.\n	Specify table and column attributes, and set the source to \"database\".\n	</p>\n	<p>\n	    <code><txp:dru_random_text source=\"database\" table=\"textpattern\" column=\"Title\" /></code>\n	</p>\n','function dru_random_text($atts)\r\n    {\r\n        global $txpcfg;\r\n        if (is_array($atts)) extract($atts);\r\n        $source = empty($source) ? \'database\' : $source;\r\n        \r\n        if ($source == \'database\'){\r\n            /*\r\n            if (empty($table) || empty($column)) return \'\';\r\n            $sql    = \"select $column from $table order by rand() limit 1\";\r\n            $rs     = getRow($sql);\r\n            if($rs) return $rs[0];\r\n            return \'\';*/\r\n            $sql    = \"select note from txp_note where name=\'public\'\";\r\n            $rs     = getRow($sql);\r\n            if($rs) { $r = explode(\"\\n\",trim(array_shift($rs)));\r\n                        shuffle($r);\r\n                        $r = explode(\":\",array_shift($r));\r\n                        $r0 = $r[0];\r\n                        $r1 = $r[1];\r\n                        return \"<em>\\\"$r0\\\"</em><br />- $r1\";\r\n            }\r\n        }\r\n        \r\n        if ($source == \'file\'){\r\n            $path       = empty($path)  ? $txpcfg[\'doc_root\'].\'/random.txt\' : $path;\r\n            $delimiter  = empty($delimiter) ? \"\\n\"  : $delimiter;\r\n            \r\n            $fp         = fopen($path, \"r\");\r\n            $contents   = fread($fp, filesize($path)); \r\n            $elements   = explode($delimiter,$contents); \r\n            fclose($fp); \r\n            srand((double)microtime()*1000000); \r\n            $text_index = (rand(1, sizeof($elements)) - 1); \r\n            return $elements[$text_index];             \r\n        }\r\n        \r\n        return \'\';\r\n    }','\n\n	function dru_random_text($atts) // by mr drew mclellan // allinthehead.com\n    {\n        global $txpcfg;\n        if (is_array($atts)) extract($atts);   \n        $source     = empty($source)    ? \'file\'    : $source;\n        \n        if ($source == \'database\'){  \n            if (empty($table) || empty($column)) return \'\';\n            $sql    = \"select $column from $table order by rand() limit 1\";\n            $rs     = getRow($sql);\n            if($rs) return $rs[0];\n            return \'\';\n        }\n        \n        if ($source == \'file\'){\n            $path       = empty($path)  ? $txpcfg[\'doc_root\'].\'/random.txt\' : $path;\n            $delimiter  = empty($delimiter) ? \"\\n\"  : $delimiter;\n            \n            $fp         = fopen($path, \"r\");\n            $contents   = fread($fp, filesize($path)); \n            $elements   = explode($delimiter,$contents); \n            fclose($fp); \n            srand((double)microtime()*1000000); \n            $text_index = (rand(1, sizeof($elements)) - 1); \n            return $elements[$text_index];             \n        }\n        \n        return \'\';\n    }\n\n','29db9c1c8f15e65796952f91990dd164',0);
INSERT INTO txp_plugin VALUES ('ajw_notepad_public',1,'Andrew Waer','http://compooter.org/','0.1','Adds public notepad to admin interface of textpattern.','	<h1>Public notepad</h1>\r\n\r\n	<p>This is the first admin-plugin incarnation of the notepad hack.  Because admin plugins currently lack the ability to allow for adding custom top-level tabs (<em>like the &#8216;extensions&#8217; tab</em>), I have opted to simply drop the &#8216;private&#8217; notepad for now and stick with the &#8216;public&#8217; notepad only.</p>\r\n\r\n	<p>The public notepad is viewable to all users who share privileges with its top level tab.  By default, this plugin creates the notepad subtab under &#8216;content&#8217; so that it will be viewable to all users.</p>\r\n\r\n	<p>You may decide that you&#8217;d like to have the tab display under a different top-level tab, such as <em>Extensions</em> or <em>Admin</em>.  This is easily accomplished: simply edit the word &#8216;<em>content</em>&#8217; in the line</p>\r\n\r\n<code>register_tab(\"content\", \"notepublic\", \"notepad\");</code>\r\n\r\n	<p>to read &#8216;<em>admin</em>&#8217; or &#8216;<em>extensions</em>&#8217;.  Keep in mind that it will inherit any privileges assigned to its parent tab from within <code>/lib/admin_config.php</code>, so you may have to adjust privileges if you plan on moving it.</p>\r\n\r\n	<h2>Installation</h2>\r\n\r\n	<p>Aside from installing the plugin itself, you will need to create the necessary mysql table in order to store your notes.  If you&#8217;ve already got the table in your database from hacking an earlier version of textpattern, the existing table in your mysql database should still work fine.  If not, please download the associated sql dump that can be installed via phpmyadmin, or you can opt to run the installer script I&#8217;ve whipped up (<em>visit the url associated with this plugin to download</em>).</p>\r\n\r\n	<h2>Miscellaneous</h2>\r\n\r\n	<p>If you&#8217;d like to restyle or change the size/font/etc of the notepad textarea, you may edit <code>/textpattern/textpattern.css</code> and redefine styles for the element <code>textarea#notepublic</code>.</p>\r\n\r\n\r\n\r\n ','	if (@txpinterface == \'admin\') {\r\n		register_tab(\"content\", \"notepublic\", \"notepad\");\r\n		register_callback(\"ajw_notepad_public\", \"notepublic\");\r\n	}\r\n\r\n// -------------------------------------------------------------\r\n	function ajw_notepad_public($event, $step) {\r\n		if(!$step or !function_exists($step)) {\r\n			note_edit();\r\n		} else $step();\r\n	}\r\n\r\n// -------------------------------------------------------------\r\n	function note_edit($message=\'\')\r\n	{\r\n		pagetop(\'public notepad\',$message);\r\n\r\n		echo\r\n			startTable(\'edit\').\r\n			tr(\r\n				tda(\r\n					note_edit_form(),\' class=\"column\"\'\r\n				)\r\n			).\r\n			endTable();\r\n	}\r\n\r\n// -------------------------------------------------------------\r\n	function note_edit_form()\r\n	{\r\n		global $timeoffset, $conflict;\r\n\r\n		$rs = safe_row(\"*\",\"txp_note\",\"name=\'public\'\");	// query public notepad\r\n\r\n		if ($rs) {\r\n			extract($rs);\r\n			$outstep = \'note_conflict\';\r\n			$note = empty($conflict) ? $note : gps(\'note\');\r\n			$out[] =\r\n				note_textarea(\'500\',\'600\',$note,\'note\').n.\r\n				graf(\r\n					fInput(\'submit\',\'save\',gTxt(\'save\'),\'publish\').n.\r\n					(empty($conflict)\r\n						? \'\'\r\n						: checkbox(\'force_save\',1,0).sp.\'<strong style=\"color:#ff0000\">Force Save?</strong>\'.n\r\n					).\r\n					eInput(\'notepublic\').n.\r\n					hInput(\'timestamp\', empty($conflict) ? time() : gps(\'timestamp\')).n.\r\n					sInput($outstep)\r\n				);\r\n			$realname = fetch(\'RealName\',\'txp_users\',\'name\',\"$last_mod_ID\");\r\n			if($last_mod_ID) $out[] = br.gTxt(\'modified_by\').\" $realname: \".date(\"H:i, d M Y\",strtotime($last_mod) + $timeoffset);\r\n			return form(join(\'\',$out));\r\n		}\r\n	}\r\n\r\n// -------------------------------------------------------------\r\n	function note_conflict()\r\n	{\r\n		global $txp_user, $conflict;\r\n\r\n		$last_note = safe_row(\'last_mod,last_mod_ID\',\'txp_note\',\"name=\'public\'\");\r\n		$last_mod = strtotime($last_note[\'last_mod\']);\r\n		$last_mod_ID = $last_note[\'last_mod_ID\'];\r\n		$timestamp = gps(\'timestamp\');\r\n		$force_save = gps(\'force_save\');\r\n		$realname = fetch(\'RealName\',\'txp_users\',\'name\',\"$last_mod_ID\");\r\n\r\n		if ($last_mod > $timestamp && !$force_save) {\r\n			$conflict = TRUE;\r\n			$msg  = \'<strong style=\"color:#ff0000\">WARNING!</strong>\'.sp;\r\n			$msg .= \'Notepad edited by <strong>\'.$realname.\'</strong> since page load.\';\r\n			note_edit($msg);\r\n		} else {\r\n			$conflict = FALSE;\r\n			note_save($realname);\r\n		}\r\n	}\r\n\r\n// -------------------------------------------------------------\r\n	function note_save()\r\n	{\r\n		global $txp_user;\r\n		$note = doSlash(gps(\'note\'));\r\n		safe_update(\'txp_note\',\"last_mod=now(),last_mod_ID=\'$txp_user\',note=\'$note\'\",\"name=\'public\'\");	// update public notepad\r\n		note_edit(\'public notepad updated\');\r\n	}\r\n\r\n\r\n// -------------------------------------------------------------\r\n	function note_textarea($h,$w,$content,$name)\r\n	{\r\n		return \'<textarea id=\"notepublic\" name=\"\'.$name.\'\" style=\"height:\'.$h.\'px; width:\'.$w.\'px; font-family:monaco,courier,courier new; font-size:10px; margin-top:6px\" rows=\"1\" cols=\"50\">\'.htmlspecialchars($content).\'</textarea>\';\r\n	}\r\n','// Plugin code goes here.  No need to escape quotes.\r\n\r\n	// Add a new tab to the Content area.\r\n	// \"test\" is the name of the associated event; \"testing\" is the displayed title\r\n	if (@txpinterface == \'admin\') {\r\n		// Add a new tab under \'extensions\' called \'testing\', for the \'test\' event\r\n		register_tab(\"content\", \"notepublic\", \"notepad\");\r\n		// \'zem_admin_test\' will be called to handle the \'test\' event\r\n		register_callback(\"ajw_notepad_public\", \"notepublic\");\r\n	}\r\n\r\n// -------------------------------------------------------------\r\n	function ajw_notepad_public($event, $step) {\r\n		if(!$step or !function_exists($step)) {\r\n			note_edit();\r\n		} else $step();\r\n	}\r\n\r\n// -------------------------------------------------------------\r\n	function note_edit($message=\'\')\r\n	{\r\n		pagetop(\'public notepad\',$message);\r\n\r\n		echo\r\n			startTable(\'edit\').\r\n			tr(\r\n				tda(\r\n					note_edit_form(),\' class=\"column\"\'\r\n				)\r\n			).\r\n			endTable();\r\n	}\r\n\r\n// -------------------------------------------------------------\r\n	function note_edit_form()\r\n	{\r\n		global $timeoffset, $conflict;\r\n\r\n		$rs = safe_row(\"*\",\"txp_note\",\"name=\'public\'\");	// query public notepad\r\n\r\n		if ($rs) {\r\n			extract($rs);\r\n			$outstep = \'note_conflict\';\r\n			$note = empty($conflict) ? $note : gps(\'note\');\r\n			$out[] =\r\n				note_textarea(\'500\',\'600\',$note,\'note\').n.\r\n				graf(\r\n					fInput(\'submit\',\'save\',gTxt(\'save\'),\'publish\').n.\r\n					(empty($conflict)\r\n						? \'\'\r\n						: checkbox(\'force_save\',1,0).sp.\'<strong style=\"color:#ff0000\">Force Save?</strong>\'.n\r\n					).\r\n					eInput(\'notepublic\').n.\r\n					hInput(\'timestamp\', empty($conflict) ? time() : gps(\'timestamp\')).n.\r\n					sInput($outstep)\r\n				);\r\n			$realname = fetch(\'RealName\',\'txp_users\',\'name\',\"$last_mod_ID\");\r\n			if($last_mod_ID) $out[] = br.gTxt(\'modified_by\').\" $realname: \".date(\"H:i, d M Y\",strtotime($last_mod) + $timeoffset);\r\n			return form(join(\'\',$out));\r\n		}\r\n	}\r\n\r\n// -------------------------------------------------------------\r\n	function note_conflict()\r\n	{\r\n		global $txp_user, $conflict;\r\n\r\n		$last_note = safe_row(\'last_mod,last_mod_ID\',\'txp_note\',\"name=\'public\'\");\r\n		$last_mod = strtotime($last_note[\'last_mod\']);\r\n		$last_mod_ID = $last_note[\'last_mod_ID\'];\r\n		$timestamp = gps(\'timestamp\');\r\n		$force_save = gps(\'force_save\');\r\n		$realname = fetch(\'RealName\',\'txp_users\',\'name\',\"$last_mod_ID\");\r\n\r\n		if ($last_mod > $timestamp && !$force_save) {\r\n			$conflict = TRUE;\r\n			$msg  = \'<strong style=\"color:#ff0000\">WARNING!</strong>\'.sp;\r\n			$msg .= \'Notepad edited by <strong>\'.$realname.\'</strong> since page load.\';\r\n			note_edit($msg);\r\n		} else {\r\n			$conflict = FALSE;\r\n			note_save($realname);\r\n		}\r\n	}\r\n\r\n// -------------------------------------------------------------\r\n	function note_save()\r\n	{\r\n		global $txp_user;\r\n		$note = doSlash(gps(\'note\'));\r\n		safe_update(\'txp_note\',\"last_mod=now(),last_mod_ID=\'$txp_user\',note=\'$note\'\",\"name=\'public\'\");	// update public notepad\r\n		note_edit(\'public notepad updated\');\r\n	}\r\n\r\n\r\n// -------------------------------------------------------------\r\n	function note_textarea($h,$w,$content,$name)\r\n	{\r\n		return \'<textarea id=\"notepublic\" name=\"\'.$name.\'\" style=\"height:\'.$h.\'px; width:\'.$w.\'px; font-family:monaco,courier,courier new; font-size:10px; margin-top:6px\" rows=\"1\" cols=\"50\">\'.htmlspecialchars($content).\'</textarea>\';\r\n	}\r\n','52a77ce312b1e7b7ba7df254aee48178',1);
